INSERT INTO `default_bisnis` (`id`, `nama`, `slug`, `keterangan_singkat`, `keterangan`, `logo`, `tgl_input`, `petugas_input`, `tgl_update`, `petugas_update`) VALUES
(2, 'SNW (Shad Network)', 'snw-shad-network', 'Adalah Distributor PROduk HAlalan Thayyiban Indonesia (PROHATI) dengan strategi Network Marketing', '<p><span style=\"font-size:16px\"><strong><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Assalamu&#39;alaykum wr. wb.,</span></span></strong></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Selamat datang di website bisnis saya.</span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:10.5pt\"><span style=\"font-family:Consolas\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Semoga kita dapat bershilaturrahim dan bersinergi dalam bisnis yang saling menguntungkan penuh berkah.</span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Apakah bisnis saya?</span></span></strong></span></p>\r\n\r\n<p><span style=\"font-size:10.5pt\"><span style=\"font-family:Consolas\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Alhamdlillah saat ini saya menjalankan bisnis <strong>SNW</strong>&nbsp;(Shad Network) yaitu Bisnis Syariah yang bergerak dalam bidang Distribusi&nbsp;<strong>PRO</strong>duk&nbsp;<strong>HA</strong>lalan&nbsp;<strong>T</strong>hayyiban&nbsp;<strong>I</strong>ndonesia (<strong>PROHATI</strong>) dengan strategi <em>Network Marketing</em>.</span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Mengapa Saya Memilih Bisnis SNW?</span></span></strong></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Karena SNW adalah BISNIS SYARIAH dengan sistem yang MUDAH DIJALANKAN dan SANGAT MENGUNTUNGKAN.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Karena produk-produk SNW merupakan produk-produk HALALAN THAYYIBAN INDONESIA.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Karena SNW dapat dijadikan SUMBER PENGHASILAN YANG HALAL, baik bulanan maupun tahunan bagi saya dan keluarga.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Karena melalui SNW saya BISA MEMBANTU ORANG LAIN untuk SUKSES BERSAMA.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Karena SNW merupakan bisnis yang FLEKSIBELdan COCOK bagi siapa saja termasuk saya dan Anda. </span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Karena MODAL USAHA untuk menjalankan bisnis SNW adalah RELATIF KECIL atau terjangkau oleh seluruh kalangan masyarakat.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Karena SNW merupakan Bisnis Syariah yang memberikan keuntungan sangat besar berupa FASILITAS BISNIS dan MANFAAT atau BENEFIT bagi para Mitraniaganya dan sudah TERBUKTI serta TERUJI.</span></span></span></span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"font-size:16px\"><strong><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Apa saja Manfaat yang dapat diperoleh dari SNW?</span></span></strong></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">MANFAAT FINANSIAL yakni </span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">manfaat</span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> dalam bentuk uang atau dapat dinilai dengan uang berupa <strong>R</strong>abat, <strong>A</strong>suransi, <strong>H</strong>adiah, <strong>M</strong>anfaat Khusus, <strong>A</strong>ndil dan <strong>T</strong>abungan hari tua atau disingkat <strong>RAHMAT.</strong></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">MANFAAT NON-FINANSIAL</span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> yakni manfaat tidak dalam bentuk uang atau tidak dapat dinilai dengan uang berupa <strong>K</strong>egotongroyongan, <strong>A</strong>sistensi Usaha, <strong>W</strong>aktu Luang, <strong>A</strong>khlaqul Karomah dan <strong>N</strong>ilai Ibadah dan Persaudaraan yang disingkat <strong>KAWAN</strong>.</span></span></span></span></li>\r\n</ol>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Apa saja MANFAAT FINANSIAL yang bisa kita terima dari kemitraan SNW?</span></span></span></strong></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Rabat</span></span></strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">, yakni DISKON HARGA atau selisih antara Harga Mitrabisnis dengan Harga </span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Konsumen</span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">.</span></span></span></span></span></li>\r\n</ol>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Asuransi</span></span></strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> yakni PROTEKSI ASURANSI berupa Asuransi Jiwa Kecelakaan dan Asuransi Rawat Inap.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Hadiah</span></span></strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> yakni INSENTIF yang diberikan kepada Mitrabisnis setiap bulan dan setiap tahun sesuai dengan omset dan perkembangan jaringannya.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Manfaat Khusus</span></span></strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> yakni BONUS TAMBAHAN berupa Biaya Perjalanan Ibadah Haji, Umrah, Wisata Islami Dalam Negeri (WILDAN) dan Wisata Islami Manca Negara (WISMA), Emas dan Permata.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Andil</span></span></strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> yakni SAHAM Kepemilikan Perusahaan.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Tabungan Hari Tua</span></span></strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> yakni DANA PENSIUN yang bisa dicairkan saat usia pensiun. </span></span></span></span></span></li>\r\n</ol>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Apa saja MANFAAT NON-FINANSIAL yang bisa kita terima dari kemitraan SNW?</span></span></span></strong></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Kegotongroyongan</span></span></strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> yakni bekerja secara berjamaah. </span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Asistensi Usaha</span></span></strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> yakni </span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">dukungan pengembangan bisnis. </span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Waktu Luang</span></span></strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\"> yakni bek</span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">erja lebih leluasa dengan menggunakan atau memanfaatkan waktu luang.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Akhlaqul Karimah</span></span></strong> <span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">yakni </span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Pendidikan dan Pelatihan Peningkatan Akhlaq untuk menjadi lebih baik.</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Nilai Ibadah serta Persaudaraan</span></span></strong> <span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">yakni </span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Pahala dari Allah SWT serta nikmat kebahagiaan bersaudara.</span></span></span></span></span></li>\r\n</ol>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Apakah perlu keahlian khusus untuk menjalankan Bisnis SNW?</span></span></span></strong></p>\r\n\r\n<p style=\"margin-left:19px\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Tentu dalam setiap profesi diperlukan keahlian. </span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:19px\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Alhamdulillah di SNW terdapat banyak media bagi saya dan Anda untuk sama-sama belajar dan berlatih melalui BUKU, PERTEMUAN atau PELATIHAN serta AUDIO dan VIDEO pembelajaran.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:19px\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Disamping itu saya pun menyediakan diri untuk menjadi <strong>partner diskusi, sharing</strong> serta <strong>konsultasi</strong> untuk kemajuan bisnis Anda.</span></span></span></span></span></p>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Siapa saja yang bisa menjalankan Bisnis SNW?</span></span></span></strong></p>\r\n\r\n<p style=\"margin-left:18px\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Siapa saja insya Allah bisa menjalankan Bisnis SNW. </span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:18px\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Pria, wanita, orang tua, anak muda, pegawai negeri, pegawai swasta, ibu rumah tangga, dosen, guru, mahasiswa dan berbagai latar belakang lainnya, insya Allah BISA.</span></span></span></span></span></p>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Berapa investasi yang dibutuhkan untuk menjalankan Bisnis SNW?</span></span></span></strong></p>\r\n\r\n<p style=\"margin-left:19px\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Untuk memulai bisnis ini saya dan Anda bisa memulainya dengan investasi yang sangat terjangkau. </span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:19px\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Biaya pendaftaran menjadi Mitra Bisnis SNW cukup dengan Rp 40.000 dan Anda akan mendapatkan berbagai fasilitas bisnis berupa:</span></span></span></span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Kartu <strong>Kemitraan</strong> Digital</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Proteksi Asuransi Jiwa Kecelakaan senilai 5 jt untuk 1 tahun </span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Buku Panduan Mitraniaga Sukses (PMS) digital</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Buku SMART Marketing Plan Digital </span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Website Bisnis Pribadi (Web Replika)</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Aplikasi Mitraniaga Area (Business Dashboard)</span></span></span></span></span></li>\r\n</ol>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Berapa penghasilan yang bisa didapat dari Bisnis SNW?</span></span></span></strong></p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Jika Anda&nbsp;menjalankan<em> bisnis</em>&nbsp;ini&nbsp;<em>dengan baik dan benar sesuai sistem</em>nya, maka Anda berpeluang untuk memiliki penghasilan&nbsp;<em>puluhan juta rupiah dalam kurun waktu yang relatif singkat</em></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Adakah hal lain yang bisa didapat dari Bisnis SNW?</span></span></span></strong></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Sebagai gambaran, Alhamdulillah sudah banyak yang:</span></span></span></span></span></p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">mendapatkan penghasilan bulanan dan tahunan</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">diberangkatkan ibadah Haji dan Umrah</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">setiap tahun diberangkatkan Wisata Islami Dalam Negeri (WILDAN) ke berbagai kota di Indonesia</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">diberangkatkan Wisata Islami Manca Negara (WISMA) ke berbagai Negara di dunia seperti, Malaysia, Singapura, Thailand, Tiongkok, Korea, Jepang, Turki dan ke negara-negara Eropa lainnya.</span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Bagaimana cara bergabung manjadi Mitrbisnis SNW?</span></span></span></strong></p>\r\n\r\n<p style=\"margin-left:19px\"><span style=\"font-size:10.5pt\"><span style=\"font-family:Consolas\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Melalui Komputer:&nbsp; - Silakan klik menu &quot;Daftar&quot; di bagian atas layar komputer Anda</span></span></span></span></p>\r\n\r\n<p style=\"margin-left:19px\"><span style=\"font-size:10.5pt\"><span style=\"font-family:Consolas\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Atau</span></span></span></span></p>\r\n\r\n<p style=\"margin-left:19px\"><span style=\"font-size:10.5pt\"><span style=\"font-family:Consolas\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Melalui HP:&nbsp; - Silakan tap icon &quot;<span style=\"background-color:white\"><span style=\"color:black\"><img alt=\"https://www.mysuperboss.com/images/3-grs_1636501297.jpg\" src=\"https://www.mysuperboss.com/images/3-grs_1636501297.jpg\" style=\"height:12px; width:15px\" /></span></span>&quot;&nbsp;pada pojok kanan atas layar HP Anda, kemudian tap menu &quot;Daftar&quot;</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">SNW, Bisnis Impian Sukses Anda</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"font-family:Consolas\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">SNW, Insya Allah Bisa !</span></span></span></strong></p>', 'images/logo_snw.png', '2021-08-14 02:42:48', 'Bayu Nugraha', '2021-11-18 02:34:28', 'bss');
