INSERT INTO `default_produk` (`id`, `bisnis_id`, `nama_brg`, `slug`, `keterangan_singkat`, `keterangan`, `harga`, `foto`, `tgl_input`, `petugas_input`, `tgl_update`, `petugas_update`) VALUES
(4, 2, 'SHAD Linnisa, 30 kapsul', 'shad-linnisa-30-kapsul', 'SHAD LIN NISA adalah herbal khusus untuk wanita yang diformulasikan dari bahan-bahan herbal yang secara luas dikenal dapat menyelesaikan masalah kewanitaan di organ intimnya, seperti keputihan, haid yang tidak teratur, otot kendor dan lendir berlebihan di rahim, bau yang kurang sedap, masalah kesuburan, serta berbagai permasalahan saat nifas.', '<p style=\"text-align:justify\"><strong>SHAD LIN NISA</strong> adalah herbal khusus untuk wanita yang diformulasikan dari bahan-bahan herbal yang secara luas dikenal dapat menyelesaikan masalah kewanitaan di organ intimnya, seperti keputihan, haid yang tidak teratur, otot kendor dan lendir berlebihan di rahim, bau yang kurang sedap, masalah kesuburan, serta berbagai permasalahan saat nifas.</p>\r\n\r\n<p style=\"text-align:justify\">Bahan herbal pembuat <strong>SHAD LIN NISA</strong> antara lain:&nbsp;<em>Gallae&nbsp;</em>(majaan),&nbsp;<em>Parameriae cortex</em>&nbsp;(kayu rapat),&nbsp;<em>Granati fructus cortex&nbsp;</em>(delima putih),&nbsp;<em>Amomi fructus&nbsp;</em>(buah kapulaga), dan beberapa herbal lainnya.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>SHAD LIN NISA</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Membantu melembutkan dan menghaluskan kulit wanita</li>\r\n	<li>Membantu menguatkan otot rahim dan mengurangi lendir yang berlebihan</li>\r\n	<li>Membantu mencegah dan mengobati keputihan</li>\r\n	<li>Membantu mengatasi bau badan dan meningkatkan gairah wanita</li>\r\n	<li>Bersifat aromatik (menimbulkan wangi khas pada organ kewanitaan)</li>\r\n	<li>Membantu membersihkan darah</li>\r\n	<li>Membantu menormalkan siklus haid</li>\r\n</ol>\r\n\r\n<p><strong>Kandungan dan Khasiat SHAD ENDIABET antara lain:</strong></p>\r\n\r\n<p><strong>Gallae (Manjakani)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><em>Gallae&nbsp;</em>(manjakani) kaya dengan&nbsp;<em>tannin</em>&nbsp;yang berkhasiat untuk mengencangkan otot vagina, membantu siklus haid lebih teratur, dan meningkatkan gairah wanita dengan cara meningkatkan hormon estrogen.</li>\r\n	<li style=\"text-align:justify\"><em>Gallae&nbsp;</em>(manjakani) juga mengandung vitamin A dan C, kalsium, protein, serta elemen&nbsp;<em>astringent&nbsp;</em>sehingga dapat membantu elastisitas dan mengencangkan organ intim kewanitaaan, membantu menghilangkan bakteri penyebab keputihan, mengurangi cairan yang berlebihan atau membantu mengatasi kekeringan cairan vagina sehingga pH rahim tetap terjaga, dan membersihkan darah kotor saat menstruasi atau sehabis melahirkan. &nbsp;</li>\r\n</ul>\r\n\r\n<p><strong><em>Parameriae cortex&nbsp;</em>(Kayu Rapat)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><em>Parameriae cortex&nbsp;</em>(kayu rapat) mengandung&nbsp;<em>flavonoid&nbsp;</em>dan&nbsp;<em>polifenol</em>,&nbsp;<em>saponin</em>, dan&nbsp;<em>tannin&nbsp;</em>yang sangat membantu untuk mengatasi keputihan, mengkerutkan rahim, membersihkan darah haid dan nifas, juga sebagai antibakteri dan anti jamur.</li>\r\n</ul>\r\n\r\n<p><strong><em>Granati fructus cortex&nbsp;</em>(Delima Putih)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Ekstrak kulit buah delima putih mengandung&nbsp;<em>alkaloid&nbsp;</em>dan&nbsp;<em>flavonoid&nbsp;</em>yang tinggi sehingga sangat membantu dalam menghambat aktivitas jamur&nbsp;<em>Candida albicans&nbsp;</em>pemicu keputihan yang sering menyerang organ intim wanita (Hasil penelitian Neny Nuraini, dkk dari Sekolah Farmasi ITB)</li>\r\n	<li style=\"text-align:justify\">Kandungan&nbsp;<em>polifenol&nbsp;&nbsp;</em>dalam delima putih mampu menghambat sintesis estrogen secara berlebihan, sehingga dapat menghambat penyebaran sel&ndash;sel kanker di rahim dan payudara.</li>\r\n</ul>\r\n\r\n<p><strong><em>Amomi fructus&nbsp;</em>(Buah Kapulaga)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Buah kapulaga kaya dengan kandungan minyak atsiri yang dapat berkhasiat meningkatkan gairah seksual pada wanita, meningkatkan stamina setelah melahirkan, serta memberikan aroma wangi khas pada organ kewanitaan.</li>\r\n</ul>', 149000, 'photos/shadlinnisa.jpg', NULL, 'spangat', NULL, 'Bayu Nugraha'),
(5, 2, 'SHAD Nigella Plus 50 kapsul', 'shad-nigella-plus-50-kapsul', '<p style=\"text-align:justify\"><strong>SHAD NIGELLA PLUS</strong> adalah makanan kesehatan yang dikombinasikan secara ideal dari bahan alami pilihan yakni: habbatussauda (Nigella sativa), hilbah (Fenugreek), dan ginseng (Panax) untuk membantu meningkatkan daya tahan dan stamina tubuh, serta membantu mencegah dan mengatasi berbagai penyakit.</p>', '<p style=\"text-align:justify\"><strong>SHAD NIGELLA PLUS</strong> adalah makanan kesehatan yang dikombinasikan secara ideal dari bahan alami pilihan yakni: habbatussauda (Nigella sativa), hilbah (Fenugreek), dan ginseng (Panax) untuk membantu meningkatkan daya tahan dan stamina tubuh, serta membantu mencegah dan mengatasi berbagai penyakit.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>SHAD NIGELLA PLUS</strong> secara rutin sesuai dosis yang dianjurkan, dapat memberikan manfaat antara lain:</p>\r\n\r\n<p>1. Membantu mengontrol sistem immune/kekebalan tubuh<br />\r\n2. Membantu mencegah penyumbatan pembuluh darah, menurunkan kolesterol dan meningkatkan kinerja jantung<br />\r\n3. Membantu meningkatkan daya ingat, konsentrasi, dan kewaspadaan<br />\r\n4. Membantu meningkatkan bioaktivitas hormon<br />\r\n5. Membantu menetralisir racun dalam tubuh<br />\r\n6. Membantu mengatasi gangguan tidur, migrain, dan stres<br />\r\n7. Membantu memperbaiki saluran pencernaan, saluran pernapasan, dan meredakan asma<br />\r\n8. Antibakteri<br />\r\n9. Antiinflamasi</p>\r\n\r\n<p><br />\r\n<strong>Kandungan dan Khasiat Komposisi SHAD NIGELLA PLUS antara lain:</strong></p>\r\n\r\n<p><strong>Ekstrak habbatussauda (Nigella sativa)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kandungan senyawa aktif dalam habbatussauda antara lain: fixed oil (oleat/omega 9, linoleat/omega 6, linolenat/omega 3, dan eicosadionat), saponin, minyak esensial, fitosterol, alkaloid (nigellieine dan nigellamine-n-oxide), asam amino (lysin, lesitin, methionine), berbagai vitamin dan mineral, yang bekerja secara sinergis memberikan efek farmakologis sebagai peningkat serta pengontrol sistem kekebalan tubuh, penawar racun dalam tubuh (detoksifikasi), dan antibakteri (pencegah infeksi)</li>\r\n	<li style=\"text-align:justify\">Kandungan asam linoleat dan asam linolenat dalam habbatussauda merupakan nutrisi yang baik bagi otak sehingga mengkonsumsinya dapat meningkatkan daya ingat, konsentrasi, dan kewaspadaan.</li>\r\n	<li style=\"text-align:justify\">Kandungan crystalline nigellone dalam habbatussauda bersifat antihistamin (pencegah alergi) sehingga dapat membantu mengatasi berbagai penyakit yang disebabkan alergen seperti asma, bronkitis, migrain, dan lain-lain</li>\r\n	<li style=\"text-align:justify\">Kandungan sterol dalam habbatussauda dapat meningkatkan bioktivitas hormon, sehingga dapat memperbaiki metabolisme tubuh</li>\r\n	<li style=\"text-align:justify\">Kandungan saponin dalam habbatussauda dapat membantu tubuh mempertahankan diri dan menyesuaikan dengan kondisi lingkungan, serta membantu mengatasi gangguan tidur dan stres.</li>\r\n	<li style=\"text-align:justify\">Kandungan minyak atsiri dan minyak esensial dalam habbatussauda dapat membantu mengatasi kembung serta memperbaiki sistem pencernaan. &nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Hulbah (Fenugreek)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Biji hulbah kaya dengan karbohidrat sampai dengan 60%, protein, minyak lemak, minyak atsiri, flavonoid, vitexin, sapogenin, saponin (diosgenin, yamogenin, gitogenin, tigogenin, dan neotigogens), musilago, kumarin, polisakarida, galaktomannan, Vitamin A B2, B1, B3, B5, B6, B15, B17, C, D, E, kolin, asam folat, inositol dan hampir semua mineral. Secara sinergis berbagai kandungan tersebut memberikan efek farmakologis antara lain sebagai antioksidan yang dapat membantu menangkal radikal bebas dalam tubuh sekaligus meningkatkan sistem kekebalan tubuh</li>\r\n	<li style=\"text-align:justify\">Kandungan senyawa steroid dalam hulbah dapat membantu meningkatkan stamina, sehingga cocok digunakan oleh orang dengan aktivitas padat.</li>\r\n	<li style=\"text-align:justify\">Kandungan senyawa bioaktif alkaloid trigonelina dalam biji hulbah berperan sebagai antidiabetik sehingga dapat membantu penanganan diabetes melitus.</li>\r\n	<li style=\"text-align:justify\">Kandungan senyawa fitoestrogen dalam biji hulbah dapat membantu kesehatan wanita pasca menopause, sedangkan kandungan musilago (serat) dan saponinnya yang tinggi dapat membantu mengatasi sembelit</li>\r\n	<li style=\"text-align:justify\">Kandungan zat besi, vitamin, kalsium dan mineral dalam biji hulbah dapat membantu meningkatkan produksi ASI.<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"><strong>Ginseng (Panax)</strong><br />\r\nKandungan senyawa utama ginseng adalah ginsenosides yang merupakan senyawa kompleks dari sekitar 25 zat aktif individual. Secara sinergis berbagai senyawa itu berefek farmakologis antara lain:</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Bersifat afrodisiak (meningkatkan libido lelaki), karena ginseng dapat meningkatan pembentukan dan pelepasan hormon-hormon, termasuk hormon seks</li>\r\n	<li style=\"text-align:justify\">Bersifat antidepresi, oleh karena itu ginseng dapat membantu melawan stres dan depresi ringan</li>\r\n	<li style=\"text-align:justify\">Bersifat adaptogen, karena dapat meningkatkan daya adaptasi tubuh terhadap faktor stres mental dan fisik, menjaga konsentrasi mental, dan membantu mencegah serta mengatasi aterosklerosis (pengapuran dinding pembuluh darah) dan berbagai penyakit peredaran darah lainnya.</li>\r\n</ul>', 149000, 'photos/shadnigella.jpg', NULL, 'spangat', NULL, 'irwan'),
(6, 2, 'SHAD Hilba Plus 50 kapsul', 'shad-hilba-plus-50-kapsul', '<p style=\"text-align:justify\"><strong>SHAD HILBA PLUS</strong> merupakan kapsul yang diramu dari beberapa herbal berkhasiat seperti hulbah (fenugreek), habbatussauda (Nigella sativa), zanjabil (Zingiberis rhizoma) dan beberapa herbal lainnya, yang dapat membantu menjaga kesehatan usus, mengatasi anemia dan tekanan darah rendah, mengobati gangguan pencernaan seperti sembelit (susah BAB dan wasir), serta berbagai gangguan lambung lainnya.</p>', '<p style=\"text-align:justify\"><strong>SHAD HILBA PLUS</strong> merupakan kapsul yang diramu dari beberapa herbal berkhasiat seperti hulbah (<em>fenugreek</em>), habbatussauda (<em>Nigella sativa</em>), zanjabil (<em>Zingiberis rhizoma</em>) dan beberapa herbal lainnya, yang dapat membantu menjaga kesehatan usus, mengatasi anemia dan tekanan darah rendah, mengobati gangguan pencernaan seperti sembelit (susah BAB dan wasir), serta berbagai gangguan lambung lainnya.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>SHAD HILBA PLUS</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Membantu mengatasi sembelit/susah buang air besar</li>\r\n	<li>Membantu mencegah dan mengobati wasir</li>\r\n	<li>Membantu mengatasi masalah usus</li>\r\n	<li>Membantu mengatasi migrain, insomnia, dan stres</li>\r\n	<li>Membantu mengatasi anemia dan darah rendah</li>\r\n	<li style=\"text-align:justify\">Membantu mengatasi kembung, sebagai antiradang, dan membantu pembentukan tulang, gigi, dan kuku</li>\r\n</ol>\r\n\r\n<p><strong>Sifat dan Khasiat Herbal Komposisi SHAD HILBA PLUS antara lain:</strong></p>\r\n\r\n<p><strong>Ekstrak Biji Hulbah (<em>Fenugreek</em>)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Biji hulbah mengandung senyawa aktif antara lain musilago, alkaloid&nbsp;<em>trigonelina</em>,&nbsp;<em>steroida</em>,&nbsp;<em>sapogenin</em>,&nbsp;<em>diosgenin</em>,&nbsp;<em>gitogenin</em>,&nbsp;<em>tigogenin</em>,&nbsp;<em>yamogenin</em>,&nbsp;<em>trilin</em>,&nbsp;<em>diosin</em>,&nbsp;<em>flavonoid vitexin</em>, dan enzim yang secara sinergis dapat memberikan efek farmakologis sebagai pencahar (melancarkan BAB),&nbsp;<em>antiinflamasi&nbsp;</em>(mencegah pembengkakan),&nbsp;<em>analgesik&nbsp;</em>(penghilang nyeri),&nbsp;<em>karminatif&nbsp;</em>(pencegah kembung),&nbsp;<em>antiseptik&nbsp;</em>(pembunuh kuman), dan&nbsp;<em>diaforetik&nbsp;</em>(peluruh keringat)</li>\r\n	<li style=\"text-align:justify\">Kandungan senyawa steroid dalam hulbah dapat membantu meningkatkan stamina sehingga cocok untuk orang dengan aktivitas yang padat.</li>\r\n	<li style=\"text-align:justify\">Kandungan musilago (serat) dan saponin yang tinggi dalam biji hulbah dapat membantu mengatasi sembelit, mencegah wasir dan usus buntu, dan menurunkan kolesterol.</li>\r\n	<li style=\"text-align:justify\">Kandungan fosfor dalam biji hulbah berperan dalam penyimpanan dan pengeluaran energi, serta membantu pembentukan tulang, gigi, dan kuku.</li>\r\n	<li style=\"text-align:justify\">Biji hulbah kaya dengan zat besi (Fe) sehingga dapat mengatasi anemia dan tekanan darah rendah, serta membantu memperlancar ASI.</li>\r\n	<li style=\"text-align:justify\">Kandungan senyawa&nbsp;<em>fitoestrogen&nbsp;</em>dalam biji hulbah dapat membantu kesehatan wanita pasca menopause.</li>\r\n	<li style=\"text-align:justify\">Kandungan&nbsp;<em>flavonoid&nbsp;</em>dalam biji hulbah merupakan antioksidan yang dapat menangkal radikal bebas, membantu metabolisme karbohidrat, protein dan lemak, memperbaiki fungsi jantung, ginjal, otot tubuh , dan sistem saraf.</li>\r\n</ul>\r\n\r\n<p><strong>Habbatussauda (<em>Nigella Sativa</em>)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kandungan&nbsp;<em>sterol&nbsp;</em>dalam&nbsp;<em>habbatussauda&nbsp;</em>dapat meningkatkan bioktivitas hormon, sehingga dapat memperbaiki metabolisme tubuh.</li>\r\n	<li style=\"text-align:justify\">Kandungan&nbsp;<em>saponin&nbsp;</em>dalam&nbsp;<em>habbatussauda&nbsp;</em>dapat membantu tubuh mempertahankan diri dan menyesuaikan dengan kondisi lingkungan, serta membantu mengatasi gangguan tidur dan stres.</li>\r\n	<li style=\"text-align:justify\">Kandungan minyak atsiri dan minyak esensial dalam&nbsp;<em>habbatussauda</em>&nbsp;dapat membantu mengatasi kembung serta memperbaiki sistem pencernaan. &nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Zanjabil (Zingiberis Rhizoma)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kandungan senyawa aktif zanjabil berupa&nbsp;<em>sterol/terpen</em>, minyak atsiri, dan&nbsp;<em>oleoresin</em>&nbsp;memberikan efek farmakologis sebagai&nbsp;<em>analgesik&nbsp;</em>(penghilang nyeri) sehingga sangat membantu wanita mengatasi rasa nyeri saat haid, nyeri sendi dan pegal linu.</li>\r\n	<li style=\"text-align:justify\">Minyak atsiri dalam zanjabil juga membantu mengatasi kembung, menambah nafsu makan, menguatkan tubuh melawan kuman, dan meluruhkan keringat, lemak, dan air seni.</li>\r\n</ul>', 149000, 'photos/shad_hilba.jpg', NULL, 'spangat', NULL, 'irwan'),
(7, 2, 'SHAD Endiabet, 30 kapsul', 'shad-endiabet-30-kapsul', '<p style=\"text-align:justify\"><strong>SHAD ENDIABET</strong> adalah herbal yang diramu khusus untuk membantu mengatasi penyakit diabetes melitus dengan komposisi bahan herbal pilihan antara lain: Alstoniae cortex (kulit pule), Andrographis folium (sambiloto), Orthosiponis folium (kumis kucing), Tinosporae caulis (brotowali), dan herbal lain.</p>', '<p style=\"text-align:justify\"><strong>SHAD ENDIABET</strong> adalah herbal yang diramu khusus untuk membantu mengatasi penyakit diabetes melitus dengan komposisi bahan herbal pilihan antara lain:&nbsp;<em>Alstoniae cortex&nbsp;</em>(kulit pule),&nbsp;<em>Andrographis folium&nbsp;</em>(sambiloto),&nbsp;<em>Orthosiponis folium&nbsp;</em>(kumis kucing),&nbsp;<em>Tinosporae caulis&nbsp;</em>(brotowali), dan herbal lain.</p>\r\n\r\n<p style=\"text-align:justify\">Proses pembuatan <strong>SHAD ENDIABET</strong> mulai dari pemilihan bahan herbal, panen, dan perlakuan pasca panen hingga pengolahan bahan baku menjadi jamu kapsul, disesuaikan dengan standar Cara Pembuatan Obat Tradisional yang Baik (CPOTB) dan&nbsp;<em>Good Manufacturing Practice&nbsp;</em>(GMP), sehingga kualitas, higienitas, dan khasiatnya untuk mengatasi diabetes melitus sangat terjaga. Semua bahan herbal yang menjadi komposisi <strong>SHAD ENDIABET</strong> telah mendapatkan sertifikat halal dari LP POM Majelis Ulama Indonesia (LP POM MUI) dan BP POM TR sehingga aman dikonsumsi.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>SHAD ENDIABET</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Membantu menurunkan kadar gula darah sekaligus meningkatkan kadar insulin baik secara empiris maupun laboratoris</li>\r\n	<li style=\"text-align:justify\">Memperbaiki kerja pankreas sehingga dapat berfungsi lebih maksimal menghasilkan insulin</li>\r\n	<li>Membantu mengobati diabetes melitus (kencing manis)</li>\r\n</ol>\r\n\r\n<p><strong>Sifat dan Khasiat Herbal Komposisi SHAD ENDIABET antara lain:</strong></p>\r\n\r\n<p><strong><em>Alstoniae Cortex&nbsp;</em>(Ekstrak Kulit Pule)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><em>Alstoniae cortex&nbsp;</em>(kulit pule) merupakan tumbuhan asli Indonesia dengan kandungan senyawa aktif pada kulit batang antara lain:&nbsp;<em>saponin</em>,&nbsp;<em>flavonoida&nbsp;</em>dan&nbsp;<em>polifenol</em>. Alkaloid:&nbsp;<em>ditamine&nbsp;</em>(C18H19NO3), ditaine (<em>echititamine</em>),&nbsp;<em>echi-kaoetchine</em>,&nbsp;<em>alstonin</em>,&nbsp;<em>porfirin</em>,&nbsp;<em>triterpenoid</em>. Zat pahit:&nbsp;<em>echeretine&nbsp;</em>dan&nbsp;<em>echicherine</em></li>\r\n	<li style=\"text-align:justify\">Zat aktif&nbsp;<em>triterpenoid&nbsp;</em>dari kulit kayu pule secara klinis dapat menurunkan kadar glukosa darah</li>\r\n	<li style=\"text-align:justify\">Dalam berbagai pustaka dan pengalaman empiris pemakainya, kulit pule secara tradisional dinyatakan berkhasiat sebagai penurun demam (<em>antipiretika</em>), antimalaria, pemacu kinerja enzim pencernaan,&nbsp; peningkat nafsu makan, pengobat radang ginjal, pengobat kencing manis, tekanan darah tinggi, dan pembasmi cacing parasit dalam perut</li>\r\n</ul>\r\n\r\n<p><strong><em>Andrographis Folium&nbsp;</em>(Ekstrak Daun Sambiloto)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kandungan senyawa utama sambiloto adalah&nbsp;<strong><em>andrographolide&nbsp;</em></strong>yang tidak dapat ditemukan pada tanaman lain, dan zat&nbsp;<strong><em>panicolin</em></strong></li>\r\n	<li style=\"text-align:justify\">Fungsi utama kedua zat tersebut adalah untuk&nbsp;<strong>meningkatkan daya tahan tubuh</strong>, Daya tahan tubuh rendah adalah salah satu masalah terbesar orang yang mengidap diabetesmelitus. Di Amerika sambiloto telah dipatenkan sebagai obat penyakit AIDS</li>\r\n	<li style=\"text-align:justify\">senyawa&nbsp;<em>andrographolide&nbsp;</em>dalam ekstrak daun sambiloto bersifat sebagai pelindung hati (<em>hepatoprotektif</em>), dan terbukti mampu melindungi hati dari efek negatif&nbsp;<em>galaktosamin&nbsp;</em>dan&nbsp;<em>parasetamol&nbsp;</em>yang biasa dialami oleh penderita diabetes melitus</li>\r\n	<li style=\"text-align:justify\">Senyawa andrographolide yang merupakan komponen&nbsp;<em>fitokimia&nbsp;</em>utama pada sambiloto terbukti mampu menurunkan kadar glukosa darah (salah satu hasil penelitian dari Universitas Gadjah Mada)</li>\r\n	<li style=\"text-align:justify\">Sambiloto dikenal sebagai tanaman yang memiliki kandungan&nbsp;<strong><em>flavonoid</em></strong>&nbsp;sebagai&nbsp;<em><strong>zat antioksidan</strong></em>, yang dapat berfungsi melindungi sel dari bahaya radikal bebas seperti tifoid, disentri, diare, radang saluran napas, radang paru, influenza, sakit kepala, demam, tuberkulosis pada paru, batuk pertusis, tekanan darah tinggi, faringitis, dan kencing manis&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n</ul>\r\n\r\n<p><strong><em>Orthosiponis Folium&nbsp;</em>(Ekstrak Daun Kumis Kucing)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Daun kumis kucing mengandung senyawa aktif&nbsp;<em>orthosiphonin glikosida</em>, minyak atsiri,&nbsp;<em>sapofonin</em>, garam kalium,&nbsp;<em>sinensetin</em>,&nbsp;<em>mioinositol</em>,&nbsp;<em>saponin</em>, minyak lemak, zat samak, dan lain-lain</li>\r\n	<li style=\"text-align:justify\">Kandungan senyawa aktif daun kumis&nbsp;<em>orthosiphonin glikosida&nbsp;</em>bersifat diuretik (peluruh), sehingga daun kumis kucing sangat baik untuk melarutkan asam urat, fosfat, dan oksalat dari tubuh, terutama dari kandung kemih, empedu, dan ginjal, lalu mengeluarkannya melalui urine. Asam urat, fosfat, dan oksalat merupakan salah satu pemicu terbesar penyakit diabetes melitus</li>\r\n	<li style=\"text-align:justify\">Karena bersifat sebagai peluruh, daun kumis kucing sangat bermanfaat untuk membersihkan empedu dan ginjal, menyembuhkan rematik, menjaga tekanan darah yang menjadi keluhan terbesar penderita diabetes</li>\r\n	<li style=\"text-align:justify\">Kumis kucing sangat ampuh untuk mencegah berbagai penyakit yang berhubungan dengan tekanan darah seperti hipertensi, jantung, stroke, migrain,dan sebagainya, karena perannya yang vital dalam mencegah penyempitan pembuluh darah (<em>arteriosclerosis</em>)</li>\r\n</ul>\r\n\r\n<p><strong><em>Tinosporae Caulis&nbsp;</em>(Ekstrak Batang Brotowali)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kandungan senyawa aktif utama brotowali antara lain:&nbsp;<em>pikoretine</em>,&nbsp;<em>alkaloida</em>,&nbsp;<em>berberin</em>,&nbsp;<em>columbine</em>, damar lunak, pati, glikosida pikroretosid, zat pahit pikroretin, hars, palmatin, dan kokulin</li>\r\n	<li style=\"text-align:justify\">Dalam dunia medis, secara klinis dan empiris brotowali terbukti memiliki sifat sebagai:&nbsp;<em>analgesik&nbsp;</em>(penghilang rasa sakit),&nbsp;<em>antipiretikum&nbsp;</em>(sebagai penurun panas demam),&nbsp;<em>tonikum&nbsp;</em>(sebagai obat penguat tubuh),&nbsp;<em>antiperiodikum</em>,&nbsp;<em>diuretikum&nbsp;</em>(peluruh air seni),&nbsp;<em>antidiabetik&nbsp;</em>(pencegah diabetes)</li>\r\n	<li style=\"text-align:justify\">Kandungan&nbsp;<em>alkaloid&nbsp;</em>serta damar lunak pada brotowali dapat melumpuhkan bakteri pada luka, mengobati rasa gatal, sehingga dapat digunakan untuk mengobati luka pada koreng dan borok yang sulit disembuhkan atau penyakit ganreng dan gatal-gatal yang biasa dialami penderita diabetes</li>\r\n	<li style=\"text-align:justify\">Zat pahit pikroretin dapat merangsang kerja urat saraf sehingga organ pernapasan dapat bekerja dengan baik, oleh karena itu baik digunakan oleh penderita gangguan pernapasan</li>\r\n	<li style=\"text-align:justify\">Pikroretin dalam brotowali dapat menggiatkan pertukaran zat sehingga dapat menurunkan panas bagi penderita demam</li>\r\n	<li style=\"text-align:justify\">Brotowali juga mengandung senyawa&nbsp;<em>glikosid&nbsp;</em>yang di dalamnya terdapat senyawa aktif&nbsp;<em>tinokrisposid&nbsp;</em>yang berkhasiat untuk mempercepat keluarnya glukosa melalui peningkatan metabolisme atau disimpan secara langsung sebagai lemak, sehingga dapat menurunkan kadar gula darah secara signifikan</li>\r\n</ul>', 149000, 'photos/shadendiabet.jpg', NULL, 'spangat', NULL, 'irwan'),
(8, 2, 'SHAD Prodet 30 kapsul', 'shad-prodet-30-kapsul', '<p style=\"text-align:justify\"><strong>SHAD PRODET</strong> adalah kapsul herbal yang mengandung bahan antioksidan, vitamin, dan mineral alami yang diramu dari bahan-bahan herbal pilihan dan berkhasiat menangkal radikal bebas, menetralisasi racun dalam tubuh akibat radikal bebas, dan mencegah penuaan dini. <strong>SHAD</strong>&nbsp;<strong>PRODET</strong> cocok bagi Anda pria dan wanita yang memiliki aktivitas padat dan sering terpapar berbagai zat polutan.</p>', '<p style=\"text-align:justify\"><strong>SHAD PRODET</strong> adalah kapsul herbal yang mengandung bahan antioksidan, vitamin, dan mineral alami yang diramu dari bahan-bahan herbal pilihan dan berkhasiat menangkal radikal bebas, menetralisasi racun dalam tubuh akibat radikal bebas, dan mencegah penuaan dini. <strong>SHAD PRODET</strong> cocok bagi Anda pria dan wanita yang memiliki aktivitas padat dan sering terpapar berbagai zat polutan.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Komposisi bahan herbal <strong>SHAD&nbsp;PRODET</strong> antara lain:&nbsp;<em>Alyxiae cortex</em>&nbsp;(ekstrak pulasari),&nbsp;<em>Curcuma rhizoma</em>&nbsp;(ekstrak temulawak),&nbsp;<em>Gallae</em>(ekstrak manjakani),&nbsp;<em>Parkiae semen</em>&nbsp;(ekstrak kedawung), dan beberapa herbal pilihan lainnya.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>SHAD&nbsp;PRODET</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Membantu mencegah dan menetralisir racun dalam tubuh akibat radikal bebas dari debu, asap rokok, kendaraan, dan pabrik, bahan kimia obat, makanan berpengawet, dan sebagainya</li>\r\n	<li>Membantu memperlancar perdaran darah dalam tubuh</li>\r\n	<li style=\"text-align:justify\">Membantu membentuk serat elastis pada kulit sehingga kulit menjadi lebih kenyal, lembut dan halus sehingga tampak lebih awet muda</li>\r\n	<li>Membantu memberikan efek segar bagi tubuh</li>\r\n</ol>\r\n\r\n<p><br />\r\n<strong>Sifat dan Khasiat Herbal Komposisi PRODET antara lain:</strong></p>\r\n\r\n<p><strong><em>Alyxiae cortex</em>&nbsp;(Ekstrak Pulasari)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Ekstrak batang pulasari mengandung senyawa aktif antara lain:&nbsp;<em>andrografin</em>,&nbsp;<em>andrografoloid</em>,&nbsp;<em>panikulin</em>,&nbsp;<em>tanin</em>, zat pahit,&nbsp;<em>kumarin</em>, minyak asiri,&nbsp;<em>alkaloid</em>,&nbsp;<em>saponin</em>, dan&nbsp;<em>polifenol</em>. Senyawa aktif ini secara sinergis memiliki efek farmakologis sebagai:&nbsp;<em>stomakik</em>&nbsp;(penambah nafsu makan),&nbsp;<em>karminatif</em>&nbsp;(pencegah kembung),&nbsp;<em>antispasmodik</em>&nbsp;(pencegah kejang usus),&nbsp;<em>antitusif</em>(penekan batuk),&nbsp;<em>emenagog</em>&nbsp;(peluruh darah haid).</li>\r\n	<li style=\"text-align:justify\">Kandungan&nbsp;<em>flavonoid</em>&nbsp;dalam batang pulosari bersifat sebagai antioksidan dan penentral racun, sehingga dapat membantu mengatasi berbagai penyakit akibat infeksi bakteri dan virus, atau akibat radikal bebas lainnya.&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong><em>Curcuma rhizoma</em>&nbsp;(Ekstrak Temulawak)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Temulawak mengandung senyawa aktif&nbsp;<em>kurkuminoid</em>&nbsp;yang terdiri atas&nbsp;<em>kurkumin</em>&nbsp;dan&nbsp;<em>desmetoksikurkumin</em>. Kedua senyawa ini membantu menetralkan racun dalam tubuh, meningkatkan sekresi empedu, dan mencegah pelemakan dalam sel-sel hati, sehingga sangat membantu hati untuk menetralisasi berbagai jenis racun akibat radikal bebas maupun yang berasal dari makanan.</li>\r\n	<li style=\"text-align:justify\">Kurkumin dalam temulawak bersifat sebagai antibakteri dan antioksidan dapat mencegah dan menghambat pertumbuhan kanker dengan cara bekerja menghentikan pembuluh darah yang menyuplai pertumbuhan kanker, sehingga sangat membantu bagi penderita kanker.</li>\r\n	<li style=\"text-align:justify\">Temulawak juga mengandung minyak atsiri yang berkhasiat membantu melancarkan fungsi ginjal dan senyawa&nbsp;<em>phelandren</em>yang dapat membantu mengeluarkan racun dari tubuh melalui air seni.</li>\r\n</ul>\r\n\r\n<p><strong><em>Gallae</em>&nbsp;(Ekstrak Manjakani)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><em>Gallae</em>&nbsp;(manjakani) memiliki kandungan&nbsp;<em>tanin</em>, asid tanik, antioksidan, vitamin (terutama vitamin A dan C), kalsium, besi, serat, protein dan karbohidrat, serta senyawa yang bersifat&nbsp;<em>astringent</em>, antimikrobial, dan antiradang. Kandungan tanin, zat antioksidan, dan senyawa yang bersifat astringent dapat membantu menguatkan otot rahim setelah melahirkan, mencegah penuaan dini dan mempertahankan kekenyalan/elastisitas kulit sehingga menghambat pengeriputan kulit, menangkal radikal bebas, menetralisasi racun, dan bersifat antikanker.</li>\r\n	<li style=\"text-align:justify\">Sifat&nbsp;<em>astringent</em>&nbsp;dalam&nbsp;<em>gallae</em>&nbsp;(manjakani) dapat menghambat perkembangan bakteri dalam tubuh sehingga dapat mencegah bau badan dan gatal-gatal.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong><em>Parkiae semen</em>&nbsp;(Ekstrak Kedawung)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Dalam ekstrak biji kedawung terkandung senyawa aktif&nbsp;<em>saponin</em>,&nbsp;<em>flavonoid</em>,&nbsp;<em>glikosid</em>, damar, hidrat arang, tanin, dan garam-garam alkali. Secara sinergis berbagai senyawa aktif itu memiliki efek farmakologis seperti antioksidan, antibakteri, antimikroba, dan bersifat astringent, sehingga sangat membantu tubuh melawan infeksi bakteri, virus, dan menetralisasi radikal bebas.</li>\r\n	<li style=\"text-align:justify\">Kandungan senyawa&nbsp;<em>beta-sitoserol</em>&nbsp;dalam&nbsp;<em>Parkiae semen</em>&nbsp;(kedawung) dapat mempercepat rusaknya enzim spesifik yang dibutuhkan hati untuk memproduksi kolesterol jahat (LDL), &nbsp;sehingga mampu mengurangi kadar kolesterol total dan LDL dalam darah. Secara tidak langsung keberadaan senyawa&nbsp;<em>beta-sitoserol</em>&nbsp;dalam&nbsp;<em>Parkiae semen</em>&nbsp;(kedawung) ini dapat membantu mencegah dan mengatasi penyakit yang berhubungan dengan peredaran darah seperti hipertensi, jantung, dan&nbsp;<em>stroke</em>.</li>\r\n</ul>', 149000, 'photos/shad_prodet.jpg', NULL, 'spangat', NULL, 'irwan'),
(9, 2, 'SHAD Tosliming, 30 kapsul', 'shad-tosliming-30-kapsul', '<p style=\"text-align:justify\"><strong>SHAD TOSLIMING</strong> adalah kaspsul herbal yang diramu dari bahan-bahan alami khusus untuk membantu mengendalikan berat badan. Komposisi herbal <strong>SHAD TOSLIMING</strong> antara lain: ekstrak daun jati belanda (Guazumae folium), ekstrak Gallae (manjakani), ekstrak daun kumis kucing (Orthoshiponis folium), ekstrak buah kapulaga (Amomi fructus), dan beberapa herbal lainnya.</p>', '<p style=\"text-align:justify\"><strong>SHAD TOSLIMING</strong> adalah kaspsul herbal yang diramu dari bahan-bahan alami khusus untuk membantu mengendalikan berat badan. Komposisi herbal <strong>SHAD TOSLIMING</strong> antara lain: ekstrak daun jati belanda (<em>Guazumae folium</em>), ekstrak&nbsp;<em>Gallae&nbsp;</em>(manjakani), ekstrak daun kumis kucing (<em>Orthoshiponis folium</em>), ekstrak buah kapulaga (<em>Amomi fructus</em>), dan beberapa herbal lainnya. &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>SHAD TOSLIMING</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Membantu mencegah kegemukan/obesitas dengan mengurangi penyerapan lemak dari makanan</li>\r\n	<li>Membantu meluruhkan timbunan lemak tubuh</li>\r\n	<li>Membantu menjaga kesegaran tubuh agar tetap fit</li>\r\n</ol>\r\n\r\n<p><strong>Kandungan dan Khasiat SHAD TOSLIMING antara lain:</strong></p>\r\n\r\n<p><strong><em>Guazumae Folium</em>&nbsp;(Ekstrak Daun Jati Belanda)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Daun jati belanda memiliki senyawa utama&nbsp;<em>tanin&nbsp;</em>dan musilago (serat), di mana&nbsp;<em>tanin&nbsp;</em>sangat berperan dalam mengendapkan protein pada mukus yang melapisi bagian dalam usus halus agar lapisan ini sulit ditembus, sehingga dapat mengurangi penyerapan dan mengendalikan lemak yang masuk dalam tubuh. Sedangkan kandungan senyawa musilago (serat) bersifat lubricating untuk melicinkan, sehingga dapat menghambat penyerapan lemak, glukosa, dan kolesterol yang terdapat dalam makanan dan minuman, lalu membuang kelebihannya saat BAB.</li>\r\n</ul>\r\n\r\n<p><strong><em>Gallae&nbsp;</em>(Manjakani)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Dalam manjakani terdapat senyawa aktif bernama&nbsp;<em>pirogalotonin&nbsp;</em>yang salah satu manfaatnya dapat meluruhkan lemak sehingga mempunyai efek melangsingkan.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong><em>Orthoshiponis Folium</em>&nbsp;(daun kumis kucing)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kandungan senyawa aktif dalam kumis kucing di antaranya adalah&nbsp;<em>orthosiphonin glikosida</em>, minyak atsiri,&nbsp;<em>saponin</em>, garam kalium, zat samak, minyak lemak,&nbsp;<em>sapofonin</em>,&nbsp;<em>mioinositol</em>, dan&nbsp;<em>sinensetin</em>. Sinergi beberapa senyawa aktif itu secara farmakologis berefek sebagai diuretik (peluruh) dengan membuang zat-zat yang tidak berguna bagi tubuh seperti kelebihan asam urat, fosfat, oksalat, dan lemak bersama air seni, sehingga dapat lebih cepat menyeimbangkan berat badan.</li>\r\n</ul>\r\n\r\n<p><strong><em>Amomi Fructus</em>&nbsp;(Kapulaga)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kapulaga mengandung senyawa dan zat aktif antara lain minyak atsiri,&nbsp;<em>sineol</em>,&nbsp;<em>terpineol</em>,&nbsp;<em>borneol</em>, protein, gula, lemak, silikat,&nbsp;<em>betakamfer</em>,&nbsp;<em>sebinena</em>,&nbsp;<em>mirkena</em>,&nbsp;<em>mirtenal</em>,&nbsp;<em>karvona</em>,&nbsp;<em>terpinil asetat</em>, dan kersik. Kandungan beberapa zat aktif tersebut berkhasiat untuk membantu normalisasi sistem pencernaan, seperti lambung dan usus, sehingga secara tidak langsung dapat mengendalikan berat badan dengan baik.</li>\r\n</ul>', 149000, 'photos/shadtosliming.jpg', NULL, 'spangat', NULL, 'irwan'),
(10, 2, 'SHAD Zedaca, 60 kapsul', 'shad-zedaca-60-kapsul', '<p style=\"text-align:justify\"><strong>ZEDACA</strong> merupakan pengembangan baru produk herbal yang diramu secara khusus dari beberapa herbal unggulan seperti ekstrak temu putih (Curcuma zhedoaria), keladi tikus (Typhonium flagelliformes) dan sambiloto (Andrographis paniculata).</p>', '<p style=\"text-align:justify\"><strong>ZEDACA</strong> merupakan pengembangan baru produk herbal yang diramu secara khusus dari beberapa herbal unggulan seperti ekstrak temu putih (Curcuma zhedoaria), keladi tikus (Typhonium flagelliformes) dan sambiloto (Andrographis paniculata).</p>\r\n\r\n<p style=\"text-align:justify\"><strong>ZEDACA</strong> diolah dari bahan-bahan herbal pilihan terbaik yang sangat memperhatikan dan mengutamakan proses dengan standar tertentu sehingga kualitas dan khasiatnya tetap terjaga. Berbagai proses mulai dari pemilihan bahan herbal, panen, dan perlakuan pasca panen hingga pengolahan menjadi bahan baku sangat diawasi dengan baik dan ketat, sehingga <strong>ZEDACA</strong> merupakan produk yang terjamin mutu dan higienitasnya.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>ZEDACA</strong> adalah kapsul herbal yang diolah dan dikemas dalam sebuah pabrik yang sesuai standar Cara Pembuatan Obat Tradisional yang Baik (CPOTB) dan Good Manufacturing Practice (GMP). Semua bahan herbal yang menjadi komposisi <strong>ZEDACA </strong>telah mendapatkan sertifikat halal dari LP POM Majelis Ulama Indonesia (LP POM MUI) sehingga aman dikonsumsi.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>ZEDACA</strong> diramu dan dikemas secara khusus untuk mendapatkan khasiat yang spesifik antara lain:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Membantu memblokir, menonaktifkan pertumbuhan, dan meluruhkan sel kanker, kista, maupun muim</li>\r\n	<li style=\"text-align:justify\">Membantu menghambat mutasi gen (antimutagenik) sehingga mencegah munculnya sel kanker</li>\r\n	<li style=\"text-align:justify\">Membantu menghambat sitoksisitas (tingkat keracunan sel) hepar/hati</li>\r\n	<li style=\"text-align:justify\">Membantu meningkatkan daya tahan tubuh, dan sebagai antioksidan sehingga dapat mempercepat proses penyembuhan kanker</li>\r\n	<li style=\"text-align:justify\">Membantu mengurangi dampak negatif dari kemoterapi</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><strong>Sifat dan Khasiat Herbal Komposisi ZEDACA antara lain:</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Temu Putih (Curcuma zhedoaria)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Temu putih mengandung banyak senyawa kimia seperti: 1-1,5% minyak dasar yang terdiri dari d-borneol, d-camphene, d-camphor, cineole, curculone, curcumadiol, curcumanolide A dan B, curcumenol, curcumeone curcumin, curcumol, curdione, dehydrocurdione, alpha-pinene, getah perekat, zat tepung/kanji, damar, dan sesquiterpen</li>\r\n	<li style=\"text-align:justify\">Rimpang temu putih juga mengandung tanin dan flavonoid yang berkhasiat sebagai antitumor</li>\r\n	<li style=\"text-align:justify\">Kandungan sesquiterpene dalam temu putih berkhasiat sebagai antiradang. Sifat ini berhubungan dengan efek antioksidan yang berfungsi mencegah kerusakan gen</li>\r\n	<li style=\"text-align:justify\">Ekstrak temu putih bersifat antimutagenik (mencegah bermutasinya gen) Ekstrak temu putih dapat menghambat perkembangan sel-sel OVCAR-3 (cell-line kanker ovarium manusia)</li>\r\n	<li style=\"text-align:justify\">Temu putih mengandung RIP (Ribosome Inacting Protein) berkhasiat menon-aktifkan pertumbuhan sel kanker, meluruhkan sel kanker tanpa merusak jaringan di sekitarnya, dan memblokir pertumbuhannya. (Hasil penelitian American Institute Cancer Reports)</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Keladi Tikus (Typhonium flagelliformes)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kandungan kimia pada keladi tikus di antaranya adalah alkaloid, saponin, steroid, glikosida flavonoid, fitol, dan triterpenoid</li>\r\n	<li style=\"text-align:justify\">Senyawa triterpenoid dalam keladi tikus dapat menghambat kerja enzim DNA yang berperan dalam proses replikasi dan proliferasi sel kanker. Terhentinya enzim DNA bekerja membuat proses dalam sel terhenti dan menyebabkan kematian sel kanker</li>\r\n	<li style=\"text-align:justify\">Choo Sheen Lai dari Pusat Penelitian Obat Universitas Sains Malaysia membuktikan senyawa fitol dalam keladi tikus bersifat antikanker. Fitol melawan sel kanker dengan cara apoptosis (matinya sel dengan sendirinya)</li>\r\n	<li style=\"text-align:justify\">Rimpang keladi tikus mengandung phenylpropanoid glikosida, sterol, dan cerebrosida, yang berfungsi sebagai antihepatotoksik (mencegah keracunan hati)</li>\r\n	<li style=\"text-align:justify\">Kandungan senyawa-senyawa keladi tikus dapat berkhasiat sebagai sitotoksik (menghambat pertumbuhan sel), sehingga secara empiris dapat digunakan untuk mengobati kanker</li>\r\n	<li style=\"text-align:justify\">Keladi tikus merupakan salah satu jenis tanaman obat yang bermanfaat dalam menyembuhkan penyakit kanker di antaranya kanker payudara dan kanker rahim (Heyne, 1987)</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Sambiloto (Andrographis paniculata)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kandungan senyawa utama sambiloto adalah andrographolide yang tidak dapat ditemukan pada tanaman lain, dan zat panicolin</li>\r\n	<li style=\"text-align:justify\">Fungsi utama kedua zat tersebut adalah untuk meningkatkan daya tahan tubuh, dengan cara meningkatkan pembelahan limfosit dan produksi interleukin-2. Di Amerika sambiloto telah dipatenkan sebagai obat penyakit AIDS</li>\r\n	<li style=\"text-align:justify\">Sambiloto juga dapat menekan pertumbuhan sel kanker, karena senyawa aktifnya (yakni andrographolide) dapat menurunkan ekspresi enzim CDK4 (cyclin dependent kinase 4), yang menentukan kecepatan terpicunya transisi fase dalam siklus sel</li>\r\n	<li style=\"text-align:justify\">Sambiloto dikenal sebagai tanaman yang memiliki kandungan flavonoid tinggi sebagai zat antioksidan, sehingga dapat berfungsi untuk melindungi sel dari bahaya radikal bebas seperti tifoid, disentri, diare, radang saluran napas, radang paru, influenza, sakit kepala, demam, tuberkulosis pada paru, batuk pertusis, tekanan darah tinggi, faringitis, dan kencing manis</li>\r\n	<li style=\"text-align:justify\">Sambiloto juga dapat berkhasiat untuk meningkatkan daya tahan tubuh, sehingga dapat membantu tubuh lebih optimal untuk melawan kanker dan mempercepat pemulihan tubuh.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>', 470000, 'photos/Zedaca.jpg', NULL, 'nurhidayat', NULL, 'irwan'),
(11, 2, 'SHAD Uliver 30 kapsul', 'shad-uliver-30-kapsul', '<p style=\"text-align:justify\"><strong>ULIVER</strong> adalah kapsul herbal yang dibuat dari bahan-bahan herbal yang secara spesifik dapat mencegah sekaligus mengobati penyakit hepatitis. ULIVER diramu dari kombinasi ekstrak daun sambiloto (Andrographis folium), ekstrak kunyit (Curcuma domisticae rhizoma), ekstrak temulawak (Curcumae xanthorizae rizhoma), Ecliptica herba, Plantaginis folium (daun sendok) dan beberapa herbal pilihan lainnya.</p>', '<p style=\"text-align:justify\"><strong>ULIVER</strong> adalah kapsul herbal yang dibuat dari bahan-bahan herbal yang secara spesifik dapat mencegah sekaligus mengobati penyakit hepatitis. ULIVER diramu dari kombinasi ekstrak daun sambiloto (Andrographis folium), ekstrak kunyit (Curcuma domisticae rhizoma), ekstrak temulawak (Curcumae xanthorizae rizhoma), Ecliptica herba, Plantaginis folium (daun sendok) dan beberapa herbal pilihan lainnya.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi ULIVER secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Melindungi sel hati dari kerusakan akibat obat kimia dan racun</li>\r\n	<li>Melindungi keracunan sel hati</li>\r\n	<li>Mencegah dan menurunkan pelemakan sel hati</li>\r\n	<li>Melawan infeksi</li>\r\n	<li>Meredakan peradangan dan mencegah penyumbatan hati dan kantung empedu</li>\r\n</ol>\r\n\r\n<p><strong>Kandungan dan Khasiat ULIVER antara lain:</strong></p>\r\n\r\n<p><strong>Andrographis folium (Ekstrak Daun Sambiloto)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Daun sambiloto sangat kaya senyawa andrographolide yang memiliki sifat sebagai pelindung hati (hepatoprotektif untuk menghambat sitoksisitas (tingkat keracunan sel) hepar/hati, mencegah dan menurunkan pelemakan hati, dan terbukti mampu melindungi hati dari efek negatif galaktosamin dan parasetamol.</li>\r\n	<li style=\"text-align: justify;\">Senyawa andrographolide pada daun sambiloto dapat merusak inti sel tumor dan meningkatkan daya tahan tubuh serta memicu fagositosis (kemampuan membunuh benda asing) sehingga dapat berperan sebagai imunostimulan (menstimulasi sistem kekebalan tubuh). Manfaat ini sangat baik bagi penderita hepatitis/liver yang biasanya bermasalah dengan sistem kekebalan tubuh.</li>\r\n	<li style=\"text-align: justify;\">Senyawa neo-andrographolide dan deoksi-andrographolide dalam ekstrak daun sambiloto bersifat sebagai antiinflamasi sehingga dapat membantu meredakan peradangan serta mencegah penyumbatan hati dan kantung empedu<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Curcumae Domisticae Rhizoma (Kunyit)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa utama pada kunyit adalah kurkumin dan minyak atsiri, di samping kandungan lain seperti arabinosa, fruktosa, glukosa, pati, tanin, damar, serta beberapa mineral. Kandungan kurkumin secara klinis dan empiris terbukti menghambat infeksi virus hepatitis C sekaligus mencegah reinfeksi virus hepatitis C yang sering dialami pasien transplantasi hati. (Hasil penelitian Angga Kusuma, Hannover Medical School, Jerman)</li>\r\n	<li style=\"text-align: justify;\">Kurkumin dalam kunyit dapat menghambat produksi protein tertentu yang menyebabkan terjadinya inflamasi pada sel-sel hati, dan efektif mendetoksifikasi hati, sehingga hati tetap dapat menjalankan fungsinya</li>\r\n	<li style=\"text-align: justify;\">Minyak atsiri dalam kunyit bersifat analgesik (pereda rasa sakit) yang biasa dialami oleh penderita hepatitis/liver<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Curcumae Xanthorizae Rhizoma (Temulawak)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa utama temulawak adalah kurkumin yang bersifat sebagai antibakteri, antitumor/kanker, antiradang, antioksidan (dengan menetralkan racun), hepatoprotektor (mencegah pelemakan hati), dan hipokolesterolemik (menurunkan kadar kolesterol), sehingga sangat membantu mengatasi keluhan penderita hepatitis/liver&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Temulawak juga mengandung minyak atsiri yang terdiri dari 32 komponen yang bersifat sebagai analgesik (penghilang rasa sakit) sekaligus membantu meningkatkan produksi getah empedu dan mampu menekan pembengkakan jaringan yang biasa dialami penderita hepatitis/liver &nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ecliptica Herba (Urang-Aring)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Daun Ecliptica herba (urang-aring) kaya kandungan alkaloida, saponin, flavonoida, dan tanin. Beberapa senyawa ini secara sinergis bersifat sebagai antiracun dan dapat membantu membersihkan hati, sehingga membantu mencegah dan mengatasi penyakit hepatitis/liver<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Plantaginis Folium (Daun Sendok)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Daun sendok kaya dengan senyawa aukubin yang sangat berperan untuk meningkatkan biosintesa RNA dalam sel hati, sehingga dapat melindungi hati dari zat beracun yang dapat merusak sel-selnya. Senyawa aukubin juga bersifat antiseptik sehingga dapat membunuh dan menghambat bakteri dan virus yang berbahaya bagi hati.</li>\r\n</ul>', 149000, 'photos/SHAD Uliver.jpg', NULL, 'irwan', NULL, NULL),
(12, 2, 'SHAD Imun 30 kapsul', 'shad-imun-30-kapsul', '<p style=\"text-align:justify\"><strong>MENIRAN/SHAD IMUN</strong> adalah kapsul herbal khusus yang diramu dari ekstrak meniran (Phyllanthus niruri) kualitas unggul untuk meningkatkan daya tahan dan sistem kekebalan tubuh sehingga mengoptimalkan kemampuan tubuh untuk melawan berbagai penyakit yang disebabkan oleh bakteri dan virus.</p>', '<p style=\"text-align:justify\"><strong>MENIRAN/SHAD IMUN</strong> adalah kapsul herbal khusus yang diramu dari ekstrak meniran (Phyllanthus niruri) kualitas unggul untuk meningkatkan daya tahan dan sistem kekebalan tubuh sehingga mengoptimalkan kemampuan tubuh untuk melawan berbagai penyakit yang disebabkan oleh bakteri dan virus.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi MENIRAN/SHAD IMUN secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Sebagai imunostimulator dalam tubuh untuk membantu melawan penyakit yang disebabkan oleh virus, bakteri, dan mikroba lainnya</li>\r\n	<li>Membantu mencegah berbagai penyakit yang disebabkan oleh virus, kuman atau bakteri</li>\r\n	<li>Antiradang dan menurunkan demam akibat infeksi</li>\r\n</ol>\r\n\r\n<p><strong>Kandungan dan Khasiat Meniran (Phyllanthus niruri) dalam Herbal MENIRAN/SHAD IMUN antara lain:</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Meniran mempunyai kandungan senyawa aktif berupa filantin, hipofilantin, kalium, damar, tanin, flavonoid, alkaloid, triperpenoid, asam lemak dan vitamin C. Dari beberapa senyawa tersebut, yang paling banyak dimanfaatkan adalah senyawa flavonoid. Flavonoid ini bekerja pada sel-sel tubuh yang menjadi bagian dari sistem imun dengan cara mengirimkan sinyak intraseluler pada reseptor sel, sehingga sel bekerja lebih optimal.<br />\r\n	&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Flavonoid pada meniran bekerja lebih baik untuk menyeimbangkan sistem pertahanan tubuh (imunomodulator) daripada flavonoid yang dimiliki herbal lain. Sifat imunomodulator dalam meniran ini sangat berperan membuat sistem imun lebih aktif dalam menjalankan fungsinya dengan menguatkan sistem imun tubuh (imunostimulator) saat daya tahan tubuh rendah, atau menekan reaksi sistem imun (imunosuppressan) saat sistem pertahanan tubuh berlebihan. Dengan demikian, kekebalan atau daya tahan tubuh dapat selalu optimal sehingga tetap sehat saat ada infeksi virus, bakteri, dan mikroba lainnya. Meniran dapat juga dikonsumsi untuk membantu mengatasi penyakit, asma, bronkitis, lupus, dan berbagai penyakit infeksi bakteri dan virus.<br />\r\n	&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Flavonoid dan tanin dalam meniran bersifat diuretik (peluruh) zat-zat yang tidak diperlukan oleh tubuh, sehingga sangat baik digunakan untuk membantu penyembuhan penyakit gangguan fungsi hati dan ginjal. (Hasil penelitian Balai Penelitian Tanaman Obat dan Aromatik (Balittro).<br />\r\n	&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Kemampuan meniran untuk meningkatkan sistem kekebalan tubuh tubuh yang baik membuatnya dapat menjadi pelengkap untuk mengobati penyakit TBC (Desertasi Dr. Zulkifli Amin SpPD, dari Departemen Ilmu Penyakit Dalam FKUI/RSCM).<br />\r\n	&nbsp;</li>\r\n</ul>', 149000, 'photos/shad_imun.jpg', NULL, 'irwan', NULL, NULL);
INSERT INTO `default_produk` (`id`, `bisnis_id`, `nama_brg`, `slug`, `keterangan_singkat`, `keterangan`, `harga`, `foto`, `tgl_input`, `petugas_input`, `tgl_update`, `petugas_update`) VALUES
(13, 2, 'SHAD Shipon, 30 kapsul', 'shad-shipon-30-kapsul', '<p style=\"text-align:justify\"><strong>SHAD SIPHONE</strong> adalah kapsul herbal khusus yang diramu dari ekstrak Orthosiphon aristatus (ekstrak kumis kucing) kualitas unggul untuk yang dibuat khusus untuk menjaga kesehatan kandung kemih, saluran kemih, dan melindungi ginjal dari kerusakan.</p>', '<p style=\"text-align:justify\"><strong>SHAD SIPHONE</strong> adalah kapsul herbal khusus yang diramu dari ekstrak Orthosiphon aristatus (ekstrak kumis kucing) kualitas unggul untuk yang dibuat khusus untuk menjaga kesehatan kandung kemih, saluran kemih, dan melindungi ginjal dari kerusakan.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi SHAD SIPHONE secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Membantu mencegah dan mengobati infeksi saluran kemih</li>\r\n	<li>Membantu melancarkan buang air kecil</li>\r\n	<li>Membantu mencegah dan mengatasi pengendapan batu pada ginjal</li>\r\n</ol>\r\n\r\n<p><strong>Kandungan dan Khasiat Orthosiphon aristatus (Ekstrak Kumis Kucing) dalam Herbal SHAD SIPHONE antara lain:</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Kumis kucing mengandung zat-zat yang bermanfaat untuk kesehatan, antara lain: orthosiphonin glikosida, minyak atsiri, sapofonin, garam kalium, sinensetin, mioinositol, saponin, minyak lemak, zat samak, dan lain-lain. Senyawa ortosiphonin dan garam kalium dapat membantu melarutkan asam urat, fosfat, dan oksalat dalam tubuh, terutama pada kandung kemih, empedu, dan ginjal, sehingga dapat mencegah terjadinya endapan yang menjadi pemicu batu ginjal, batu saluran kemih, dan batu empedu.</li>\r\n	<li style=\"text-align: justify;\">Kandungan sinensetin dalam ekstrak daun kumis kucing berkhasiat sebagai antibakteri, sehingga dapat mencegah berkembangbiaknya bakteri dalam air seni pada kandung kemih. Dengan demikian kumis kucing dapat digunakan untuk membantu mencegah dan mengobati infeksi kandung kemih dan saluran kemih.</li>\r\n	<li style=\"text-align: justify;\">Berbagai senyawa aktif dalam ekstrak daun kumis kucing secara sinergis dapat meringankan kejang otot ringan, membantu mengatasi rasa sakit karena batu empedu dan batu ginjal, serta bersifat antiallergic. Selain itu, ekstrak daun kumis kucing dapat mencegah penyakit arteriosclerosis (penyempitan pada pembuluh kapiler), sehingga dapat mencegah gangguan peredaran dan tekanan darah yang menjadi salah satu pemicu batu ginjal dan batu empedu.</li>\r\n	<li style=\"text-align: justify;\">Ekstrak daun kumis kucing juga mengandung methyl-ripariochromene (MRC) yang mempunyai efek diuresis dengan memancing pengeluaran cairan urine, sehingga memperlancar air kecil. Bagi penderita anyang-anyangan (susah buang air kecil atau buang air kecil tersendat-sendat) sangat disarankan untuk mengkonsumsinya.<br />\r\n	&nbsp;</li>\r\n</ul>', 167000, 'photos/shad_shipon.jpg', NULL, 'irwan', NULL, NULL),
(14, 2, 'SHAD Mindatop, 30 kapsul', 'shad-mindatop-30-kapsul', '<p style=\"text-align:justify\"><strong>SHAD MINDATOP</strong> adalah kapsul herbal khusus untuk menambah nutrisi otak yang dibuat dari ekstrak pegagan (Centella asiatica) kualitas terbaik. SHAD MINDATOP sangat berperan untuk memperlancar peredaran darah menuju otak, sehingga dapat memasok oksigen dan nutrisi sel ke otak agar dapat berfungsi secara optimal.</p>', '<p style=\"text-align:justify\"><strong>SHAD MINDATOP</strong> adalah kapsul herbal khusus untuk menambah nutrisi otak yang dibuat dari ekstrak pegagan (Centella asiatica) kualitas terbaik. SHAD MINDATOP sangat berperan untuk memperlancar peredaran darah menuju otak, sehingga dapat memasok oksigen dan nutrisi sel ke otak agar dapat berfungsi secara optimal.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi SHAD MINDATOP secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Membantu meningkatkan kemampuan mental dan meningkatkan IQ</li>\r\n	<li>Membantu meningkatkan kemampuan saraf memori</li>\r\n	<li>Membantu meningkatkan daya ingat dan konsentrasi</li>\r\n	<li>Membantu mencegah stroke</li>\r\n	<li>Membantu mencegah pikun</li>\r\n	<li>Membantu mempercepat pemulihan pada penderita stroke</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><strong>Kandungan dan Khasiat Pegagan (Centella asiatica) dalam SHAD MINDATOP</strong><br />\r\nDalam daun pegagan (Centella asiatica) terdapat banyak senyawa aktif yang berkhasiat, beberapa di antaranya adalah:</p>\r\n\r\n<ul>\r\n	<li><strong>Triterpenoid</strong></li>\r\n</ul>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Senyawa ini adalah senyawa terpenting dari tanaman pegagan, karena senyawa ini sangat berperan untuk meningkatkan fungsi mental lebih baik dan memberi efek menenangkan, sehingga cocok untuk orang-orang yang mengidap penyakit yang berkaitan dengan saraf yang overaktif, misalnya autis, atau penderita Attention Deficit Disorder (ADD). Senyawa triterpenoid juga dapat merevitalisasi pembuluh darah sehingga memperlancar peredaran darah menuju otak. Kondisi ini sangat membantu bagi penderita pikun dini dan mempercepat pemulihan bagi penderita stroke.</li>\r\n	<li style=\"text-align: justify;\">Senyawa triterpenoid bersifat sebagai antioksidan yang bekerja menangkap radikal bebas, sehingga sel otak terhindar dari kematian yang menyebabkan berkurangnya memori. Sebaliknya otak dapat lebih terangsang untuk bekerja dalam peningkatan kemampuan belajar dan daya ingat.<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li><strong>Asiaticoside</strong></li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\">Senyawa ini adalah bagian dari triterpenoid. Senyawa ini sangat berperan untuk menstimulasi sel darah dan sistem imun sehingga darah dapat berfungsi optimal mensuplai nutrisi dan oksigen ke otak. Senyawa itu juga merupakan antibiotik alami dan mencegah kelelahan sebagai pemicu tidak konsentrasinya seseorang.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Brahmoside</strong></li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\">Senyawa ini sangat berperan untuk memperlancar peredaran darah menuju otak, sehingga dapat memasok oksigen dan nutrisi sel ke otak. Lancarnya nutrisi sel otak dapat meningkatkan kemampuan otak (IQ) untuk menelaah, meningkatkan memori, baik jangka pendek maupun jangka panjang.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Brahminoside</strong></li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\">Senyawa brahminoside merupakan protein penting bagi sel otak untuk perkembangannya, sehingga dapat mencegah dan menghambat datangnya pikun.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Vitamin dan Garam Mineral</strong></li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\">Di dalam pegagan terdapat Kalsium, magnesium, fosfor, seng, tembaga, batakaroten, vitamin B1, B2, B3, C. Berbagai vitamin dan garam mineral dalam tersebut sangat berkhasiat untuk meningkatkan stamina dan vitalitas, serta sebagai antioksidan yang membantu dalam perkembangan sel-sel otak, dan membantu memperkuat sekaligus meningkatkan daya tahan otak dan saraf.<br />\r\n&nbsp;</p>', 159000, 'photos/shad_mindatop.jpg', NULL, 'irwan', NULL, NULL),
(15, 2, 'SHAD Tensikol, 30 kapsul', 'shad-tensikol-30-kapsul', '<p style=\"text-align:justify\"><strong>SHAD TENSIKOL</strong> adalah kapsul herbal yang dibuat dari bahan pilihan dengan khasiat khusus untuk mencegah serta mengobati hipertensi dan penumpukan kolesterol. Herbal pilihan yang menjadi komposisi SHAD TENSIKOL antara lain ekstrak sambiloto (Andrographis paniculata) dan ekstrak temulawak (Curcuma Xanthorrhiza Roxb).</p>', '<p style=\"text-align:justify\"><strong>SHAD TENSIKOL</strong> adalah kapsul herbal yang dibuat dari bahan pilihan dengan khasiat khusus untuk mencegah serta mengobati hipertensi dan penumpukan kolesterol. Herbal pilihan yang menjadi komposisi SHAD TENSIKOL antara lain ekstrak sambiloto (Andrographis paniculata) dan ekstrak temulawak (Curcuma Xanthorrhiza Roxb).</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi SHAD TENSIKOL secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Membantu menurunkan tekanan darah</li>\r\n	<li>Membantu menurunkan kolesterol jahat dalam darah</li>\r\n	<li>Membantu mencegah secara dini penyakit jantung dan stroke</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><strong>Kandungan dan Khasiat SHAD TENSIKOL antara lain:</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Andrographis Paniculata (Ekstrak Sambiloto)</strong><br />\r\nSambiloto adalah herbal yang biasa digunakan sebagai tanaman obat dengan kandungan senyawa utama berupa andrographolide yang tidak dapat ditemukan pada tanaman lain, dan zat panicolin. Herbal isitimewa ini kaya dengan khasiat bagi kesehatan tubuh antara lain:</p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Senyawa flavonoid di dalamnya berkhasiat mencegah sekaligus menghancurkan penggumpalan darah, sehingga dapat mencegah sekaligus mengobati gangguan yang berhubungan dengan peredaran darah yang tidak lancar.</li>\r\n	<li style=\"text-align: justify;\">Kandungan kaliumnya yang banyak sangat berperan dalam pengeluaran air dan natrium dalam tubuh sehingga dapat menurunkan tekanan darah.</li>\r\n	<li style=\"text-align: justify;\">Senyawa andrographolide dan panicolin berkhasiat untuk meningkatkan daya tahan tubuh terhadap infeksi kuman, sebagai antidiare, antibakteri, serta membantu menurunkan kolesterol dan tekanan darah tinggi (Balai Penelitian Tanaman Obat dan Aromatik (BALITTRO).</li>\r\n</ul>\r\n\r\n<p><strong>Curcuma Xanthorrhiza Roxb (Ekstrak Temulawak)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa kurkumin bersifat sebagai hipokolesterolemik (menurunkan kadar kolesterol jahat dan menaikkan kolesterol baik), sehingga sangat membantu untuk normalisasi kolesterol dalam darah, serta mencegah penggumpalan darah yang memicu hipertensi.</li>\r\n	<li style=\"text-align: justify;\">Senyawa aktif kurkumin juga dapat meningkatkan aliran empedu dari dalam kandung empedu ke hati, sehingga proses penyerapan sari makanan berjalan baik dan tidak memicu menumpuknya kolesterol jahat dalam darah. (uji klinis Suwijiyo Pramono dari Fakultas Farmasi, Universitas Gadjah Mada)&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>', 167000, 'photos/shad_tensikol.jpg', NULL, 'irwan', NULL, NULL),
(16, 2, 'SHAD Asratik, 30 kapsul', 'shad-asratik-30-kapsul', '<p style=\"text-align:justify\"><strong>SHAD ASRATIK</strong> merupakan kapsul herbal yang dibuat dari ekstrak Sida rhombifolia (sidaguri) dan ekstrak Tinospora crispa (brotowali) yang diformulasikan secara proporsional sehingga secara spesifik dapat membantu mengatasi radang asam urat dan rematik.</p>', '<p style=\"text-align:justify\"><strong>SHAD ASRATIK</strong> merupakan kapsul herbal yang dibuat dari ekstrak Sida rhombifolia (sidaguri) dan ekstrak Tinospora crispa (brotowali) yang diformulasikan secara proporsional sehingga secara spesifik dapat membantu mengatasi radang asam urat dan rematik.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>SHAD ASRATIK</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Mencegah dan mengobati asam urat serta rematik</li>\r\n	<li style=\"text-align: justify;\">Membantu mengatasi rasa sakit dan nyeri pada sendi, tulang, dan otot akibat radang asam urat dan rematik</li>\r\n</ol>\r\n\r\n<p><strong>Kandungan dan Khasiat SHAD ASRATIK antara lain:</strong></p>\r\n\r\n<p><strong>Ekstrak Sida Rhombifolia (Sidaguri)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Daun sidaguri mengandung alkaloid, kalsium oksalat, tanin, saponin, fenol, asam amino, minyak atsiri, steroid, dan efedrine yang secara sinergis dapat memiliki efek farmakologis sebagai antiradang, antiinflamasi, diuretik, dan analgesik, sehingga dapat meluruhkan asam urat melalui urine, mengatasi nyeri dan bengkak yang biasa dialami penderita radang asam urat dan rematik.</li>\r\n	<li style=\"text-align: justify;\">Senyawa flavonoid yang tinggi dalam sidaguri bekerja menghambat produksi enzim xantin oksidase (XO) dalam mensintesa asam urat hingga 55,29%, sehingga dapat mencegah penumpukan asam urat dalam tubuh.&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Ekstrak Tinospora Crispa (Brotowali)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Ekstrak brotowali mengandung senyawa aktif pikroretin, berberin, tinokrisposid, saponin, tanin, kolumbin, palmatin, kaempferol, dan pati yang secara sinergis memiliki efek farmakologis sebagai penghilang rasa sakit (analgetik), penurun panas (antipiretik), dan melancarkan berbagai meridian tubuh (saluran penghubung dalam tubuh) pada penderita radang asam urat dan rematik.&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Kandungan berberin dalam ekstrak brotowali juga berkhasiat untuk membunuh bakteri (antibakteri), sehingga dapat membantu mngatasi infeksi yang biasa menyertai dan memperparah kondisi penderita radang asam urat dan rematik.<br />\r\n	&nbsp;</li>\r\n</ul>', 167000, 'photos/shad_asratik.jpg', NULL, 'irwan', NULL, NULL),
(17, 2, 'Shadina Shampoo Anti Dandruff', 'shadina-shampoo-anti-dandruff', 'SHADINA Shampoo Anti Dandruff diformulasikan secara khusus dengan bahan aktif yang dapat membersihkan kulit kepala dari ketombe', '<p>SHADINA Shampoo Anti Dandruff diformulasikan secara khusus dengan bahan aktif yang dapat membersihkan kulit kepala dari ketombe serta menjaga kesehatan rambut dan kulit kepala.&nbsp;</p>\r\n\r\n<p>Kandungan Bahan Aktif:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><em><strong>Xylitol</strong></em> (menjaga rambut dan kulit kepala tidak kering dan mencegah jamur dan bakteri) Terbuat dari ekstraksi berbagai macam buah dan sayuran seperti dari pohon birch, jagung, buah plum dan buah beri yang bermanfaat untuk melawan berbagai macam infeksi, anti jamur dan bakteri, serta menjaga rambut tidak mudah kering.</li>\r\n	<li style=\"text-align:justify\"><em><strong>Polyquternium-22</strong></em> (<em>moisturizer</em> yang dapat menjaga kelembutan rambut, rambut mudah diatur, menyehatkan rambut rusak). Moisturizer yang membantu melembabkan dan menghaluskan rambut, membuat rambut mudah diatur, tidak mudah lepek, tampak tebal, dan merawat rambut rusak serta membuat rambut terjaga kelembutannya</li>\r\n	<li style=\"text-align:justify\"><em><strong>Cetrimonium Chloride</strong></em> (zat <em>antistatic</em> yaitu mencegah debu dan kotoran menempel pada kulit kepala)&nbsp;Conditioner dengan sifat anti-statis, anti kusut, dan anti mikroba yang sangat efektif untuk melembutkan rambut&nbsp;</li>\r\n	<li style=\"text-align:justify\"><em><strong>Cocamidopropyl Betaine</strong></em> (zat <em>antistatic</em> yaitu mencegah debu dan kotoran menempel pada kulit kepala)&nbsp;Memiliki sifat <em>antiseptic</em>, zat <em>antistatic</em> dan zat antiiritasi yang bermanfaat untuk mengurangi iritasi kulit, dan berefek tidak pedih di mata</li>\r\n	<li style=\"text-align:justify\"><em><strong>Salicylic Acid</strong></em> (Membantu membersihkan kulit kepala) Menjaga kandungan minyak pada rambut sehingga tidak mudah lepek&nbsp;</li>\r\n	<li style=\"text-align:justify\"><em><strong>Salix Alba Bark Extract</strong></em> (anti radang, baik digunakan untuk kulit kepala sensitif) Berasal dari kulit kayu (bark) dari pohon white willow (salix alba) yang bermanfaat sebagai anti radang, kaya antioksidan, anti bakteri dan sebagai pembersih yang menjangkau pori kulit kepala dan tidak menyebabkan iritasi&nbsp;</li>\r\n	<li style=\"text-align:justify\"><em><strong>Panthenol</strong></em> (Menutrisi rambut dan kulit kepala, anti kusut, anti lepek) Provitamin B5 yang bermanfaat untu melembabkan rambut dan kulit kepala, menjaga rambut tampak tebal, membuat rambut berkilap dan bersinar, mudah diserap kulit serta dapat menjaga kesehatan kulit kepala&nbsp;</li>\r\n	<li style=\"text-align:justify\"><strong><em>Cetylpyridinium Chloride</em></strong> (mencegah jamur dan bakteri berkembang di kulit kepala)&nbsp;Memiliki zat antiseptik yang dapat membunuh bakteri berbahaya dan mikroorganisme lainnya, sehingga kulit rambut lebih sehat.&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Keunggulan:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Mengandung conditioner sehingga rambut tetap mudah diatur, lembut, tampak tebal juga tidak mudah lepek</li>\r\n	<li>Mengandung moisturizer untuk kesehatan rambut dan kulit kepala</li>\r\n	<li>Membuat kulit kepala sehat dan tidak kering</li>\r\n	<li>Menutrisi rambut agar selalu sehat</li>\r\n	<li>Dapat digunakan untuk rambut dan kulit kepala yang sensitive</li>\r\n	<li>Cocok untuk segala jenis rambut</li>\r\n	<li>Mengandung anti oksidan, anti bakteri, dan anti jamur</li>\r\n	<li>Aman digunakan setiap hari&nbsp;</li>\r\n	<li>Terdaftar di BPOM-RI</li>\r\n	<li>Bersertifikasi halal MUI&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penggunaan:</strong></p>\r\n\r\n<ol>\r\n	<li>Tuangkan sedikit SHADINA Shampoo Anti Dandruff pada rambut yang telah dibasahi.</li>\r\n	<li>Gunakan ujung jari untuk memijat kulit kepala &amp; membuat shampoo berbusa.&nbsp;</li>\r\n	<li>Kemudian bilas dengan air bersih</li>\r\n</ol>', 57000, 'photos/shampoo_ok.jpg', NULL, 'irwan', NULL, 'nurhidayat'),
(18, 2, 'Shadina Brightening Hand Body Lotion', 'shadina-brightening-hand-body-lotion', '<p style=\"text-align:justify\">SHADINA Brightening Hand &amp; Body Lotion mengandung vitamin dan <em>moisturizer</em> yang dapat merawat kelembapan kulit agar tetap halus, lembut, dan lembap.</p>', '<p>SHADINA Brightening Hand &amp; Body Lotion mengandung vitamin dan <em>moisturizer</em> yang dapat merawat kelembapan kulit agar tetap halus, lembut, dan lembap.</p>\r\n\r\n<p>SHADINA Brightening Hand &amp; Body Lotion cocok digunakan untuk semua jenis kulit.</p>\r\n\r\n<p>Kandungan Bahan Aktif:</p>\r\n\r\n<p>1. <em><strong>Niacinamide</strong></em> (Baik untuk Metabolisme Kulit, Melembabkan Kulit, Mencerahkan Kulit, Antiaging)</p>\r\n\r\n<p style=\"margin-left:40px\">Vitamin B3 merupakan salah satu antioksidan yang sangat bermanfaat untuk mengatasi masalah kulit (keriput, kesehatan kulit, dan memberikan manfaat antiinflamasi), membantu metabolisme sel, mengurangi hiperpigmentasi dan sebagai antiaging.</p>\r\n\r\n<p>2. <em><strong>Propylene Glycol</strong></em> (<em>Moisturizer</em> yang Melembabkan Kulit)</p>\r\n\r\n<p style=\"margin-left:40px\">Selain dapat membantu memaksimalkan penyerapan bahan aktif ke kulit, <em>propylene glycol</em> juga memiliki fungsi antibacterial (antibakteri) dan antifungal (antijamur).</p>\r\n\r\n<p>3. <em><strong>Glycolic Acid</strong></em> (<em>Whitening</em> Agent)</p>\r\n\r\n<p style=\"margin-left:40px\"><em>Glycolic acid</em> atau asam glikolat merupakan bentuk lain dari <em>Alpha Hydroxy</em> <em>Acid</em> (AHA). Selain berfungsi untuk membantu peremajaan kulit, asam glikolat juga dikenal efektif sebagai bahan eksfoliasi dengan mengangkat sel kulit mati, memperbaiki tekstur kulit yang kasar, mencerahkan kulit, menghaluskan dan melembutkan kulit. Glycolic acid dapat digunakan untuk semua jenis kulit.</p>\r\n\r\n<p>4. <em><strong>Trehalose</strong></em> (<em>Antioksidan</em> dan Melembapkan Kulit)</p>\r\n\r\n<p style=\"margin-left:40px\"><em>Trehalose</em> merupakan senyawa kimia yang dapat melindungi jaringan kulit dari kerusakan, menjaga kelembapan kulit, melindungi kulit dari faktor lingkungan (radiasi UV, polusi, asap, penyebab iritasi), serta baik digunakan untuk kulit sensitif dan sebagai antioksidan</p>\r\n\r\n<p>5. <em><strong>Kojic Acid</strong></em> (Mencerahkan Kulit, Antiaging)</p>\r\n\r\n<p style=\"margin-left:40px\"><em>Asam kojic</em> merupakan zat penghambat ringan yang mempengaruhi pembentukan pigmen (zat pemberi warna). Asam kojic berfungsi sebagai pencerah kulit, membantu menghilangkan bercak-bercak akibat penuaan (anti penuaan dini alami), bintik-bintik, noda hitam, dan menghilangkan tanda-tanda hiperpigmentasi.</p>\r\n\r\n<p>6. <em><strong>Tocopheryl Acetate</strong></em> (Menutrisi Kulit, Antioksidan)</p>\r\n\r\n<p style=\"margin-left:40px\">Merupakan antioksidan alami dalam vitamin E yang dapat menutrisi kulit, mencerahkan kulit, meningkatkan SPF, pelembap dan antiaging effect (memperbaiki kulit relief permukaan), menenangkan, sebagai antiinflamasi, serta mengembangkan epitelisasi dan aktivitas enzim.</p>\r\n\r\n<p>7. <em><strong>Allantoin</strong></em> (Mencegah Iritasi Kulit, Meregenerasi Kulit, Baik untuk Kulit Sensitif <em>Antiinflammatory</em>)</p>\r\n\r\n<p style=\"margin-left:40px\"><em>Allantoin</em> termasuk ke dalam zat emmolients, yaitu zat yang berfungsi untuk melembutkan dan melembabkan kulit, mengurangi gatal-gatal, mencegah iritasi, dan membantu mengelupaskan sel-sel kulit mati, sehingga dapat mempercepat proses pertumbuhan sel dan jaringan kulit baru yang lebih sehat.</p>\r\n\r\n<p style=\"margin-left:40px\"><em>Allantoin</em> juga dapat membantu mengecilkan pori-pori kulit, menyamarkan bekas luka, kemerahan, dan bersifat sebagai zat pendingin kulit dan pencegah iritasi.</p>\r\n\r\n<p>Keunggulan:</p>\r\n\r\n<ol>\r\n	<li>Mengandung bahan aktif yang berfungsi mencerahkan</li>\r\n	<li>Menutrisi kulit dengan Vitamin E dan Vitamin B3</li>\r\n	<li>Cocok untuk semua jenis kulit</li>\r\n	<li>Cocok untuk pria dan wanita</li>\r\n	<li>Kemasan melindungi isi produk dari paparan sinar matahari, sehingga kualitas tetap baik</li>\r\n	<li>Aman digunakan setiap hari</li>\r\n	<li>Terdaftar di BPOM-RI</li>\r\n	<li>Bersertifikasi halal dari MUI</li>\r\n</ol>\r\n\r\n<p>Cara Penggunaan:</p>\r\n\r\n<ol>\r\n	<li>Tuangkan SHADINA Brightening Hand &amp; Body Lotion secukupnya pada telapak tangan, lalu usapkan ke seluruh bagian tubuh.</li>\r\n</ol>\r\n\r\n<p>Gunakan setelah mandi atau saat kulit terasa kering.</p>', 65000, 'photos/hand & body shadina.jpg', NULL, 'irwan', NULL, 'sholeh'),
(19, 2, 'Shadina Moist Lipstick SNW Lovely Red', 'shadina-moist-lipstick-snw-lovely-red', '<p style=\"text-align:justify\">SHADINA Brightening Hand &amp; Body Lotion mengandung vitamin dan moisturizer yang dapat merawat kelembapan kulit agar tetap halus, lembut, dan lembap.</p>', '<p>Shadina <em>Moist Lipstick SNW Lovely Red</em> merupakan lipstick dengan formulasi khusus yang berfungsi sebagai tata rias sekaligus menutrisi bibir agar lembab dan melindungi bibir dari UV. Diperkaya dengan vitamin, <em>moisturizer</em> yang dapat memberikan nutrisi serta merawat kelembaban dan melindungi bibir dari efek buruk sinar matahari. Bibir menjadi lebih terawat serta tidak kering dan pecah-pecah.</p>\r\n\r\n<p><br />\r\nKandungan</p>\r\n\r\n<p>1. <em>Ricinus Communis Seed Oil</em> (mencegah iritasi kulit)</p>\r\n\r\n<p>Adalah minyak nabati yang diperoleh dari ekstraksi biji tanaman jarak (<em>Ricinus communis</em>). Dalam bidang farmasi dikenal pula sebagai minyak kastroli atau castor. Castor oil atau minyak jarak adalah bahan alami yang sangat baik digunakan untuk untuk merawat bibir wanita serta bermanfaat untuk memerahkan bibir, mencegah bibir pecah-pecah, melembabkan bibir dan mengilangkan bintik hitam.</p>\r\n\r\n<p>2. <em>Lanolin</em> (melembabkan kulit)</p>\r\n\r\n<p>adalah zat berminyak yang terdapat pada bulu domba dan digunakan sebagai salah satu bahan pembuat produk pelembab kulit, yang bermanfaat untuk mencegah serta mengatasi kulit yang kering, kasar, gatal, dan bersisik</p>\r\n\r\n<p>3. Vitamin E (menutrisi, antioksidan)</p>\r\n\r\n<p>Kandungan antioksidan dalam vitamin E dapat mencerahkan kulit. Pada wanita lanjut usia, vitamin E juga bekerja untuk memerangi penuaan, seperti menyamarkan lingkaran gelap dan bibir kering.</p>\r\n\r\n<p>4. Tabir Surya (menjaga dari efek negatif sinar matahari)</p>\r\n\r\n<p>Apabila seseorang yang terlalu sering terpapar sinar matahari bisa meningkatkan risiko terjadinya kanker kulit. Tabir surya adalah produk yang dapat Anda gunakan untuk melindungi kulit Anda dari paparan sinar matahari.</p>\r\n\r\n<p>Manfaat Produk<br />\r\nDiperkaya dengan vitamin, <em>moisturizer </em>yang dapat memberikan nutrisi serta merawat kelembaban dan melindungi bibir dari efek buruk sinar matahari. Bibir menjadi lebih terawat serta tidak kering dan pecah-pecah</p>\r\n\r\n<p>Keunggulan</p>\r\n\r\n<p>1. Kemasan Eksklusif dan Elegan<br />\r\n2. Praktis dibawa saat berpergian<br />\r\n3. Warna cocok untuk berbagai acara<br />\r\n4. Menutrisi bibir agar lembab<br />\r\n5. Melindungi bibir dari Ultra Violet<br />\r\n6. Bibir lebih sehat dan menawan<br />\r\n7. Terdaftar di BPOM-RI<br />\r\n8. Bersertifikasi Halal MUI</p>\r\n\r\n<p>Cara Penggunaan<br />\r\nOleskan SHADINA Moist Lipstick SNW Lovely Red pada kedua bibir Anda dengan tipis dan merata.</p>', 59000, 'photos/shadina_lipstick.jpg', NULL, 'irwan', NULL, 'sholeh'),
(20, 2, 'Shadina Brightening Two Way Cake Natural', 'shadina-brightening-two-way-cake-natural', '<p style=\"text-align:justify\">Shadina Brightening Two Way Cake Natural merupakan bedak padat yang diformulasikan secara khusus dari powder pilihan yang lembut. Berfungsi untuk memulas kulit wajah menjadi lebih lembut dan halus sehingga dapat meningkatkan penampilan serta mengandung bahan aktif Whitening Agent yang dapat menjadikan kulit tampak lebih cerah. Cocok digunakan untuk semua jenis kulit.</p>', '<p>Shadina Brightening Two Way Cake Natural merupakan bedak padat yang diformulasikan secara khusus dari powder pilihan yang lembut. Berfungsi untuk memulas kulit wajah menjadi lebih lembut dan halus sehingga dapat meningkatkan penampilan serta mengandung bahan aktif Whitening Agent yang dapat menjadikan kulit tampak lebih cerah. Cocok digunakan untuk semua jenis kulit.</p>\r\n\r\n<p><br />\r\nKandungan:<br />\r\n1. Squalane (pelembab, antioksidan alami)</p>\r\n\r\n<p>Squalane dalam produk perawatan kulit berguna untuk melembabkan kulit yang kering, karena squalane merupakan salah komponen yang membentuk minyak pada kulit. Dalam dunia kosmetik, penggunaan squalane dikenal paling aman untuk menjadi cantik alami serta menyehatkan kulit. Squalane yang digunakan dalam produk Shadina adalah squalane alami dari pemurnian bertingkat minyak tumbuhan. Sehingga menjadi keunggulan tersendiri bagi produk Shadina Brightening Two Way Cake Natural.</p>\r\n\r\n<p>2. Whitening Agent (menjadikan kulit tampak lebih cerah)</p>\r\n\r\n<p>Asia adalah salah satu konsumen terbesar di dunia pengguna kosmetika yang mengandung bahan pencerah warna kulit (whitening agent). Berhati-hatilah memilih produk kosmetik yang mengandung pemutih atau whitening agent, Mercury dan Hidroquinon adalah contoh pemutih berbahaya.<br />\r\nArbutin menjadi salah satu kandungan Shadina Brightening TW Cake Natural adalah whitening agent yang berasal dari alam (tumbuhan) dan terkenal menjadi salah satu whitening agent alami yang baik dan aman bagi kulit. Arbutin berasal dari tumbuhan bearberry yang memiliki mekanisme kerja menyerupai hidrokuinon dalam mengatasi hiperpigmentasi</p>\r\n\r\n<p>3. Vitamin E (menutrisi kulit, antioksidan)</p>\r\n\r\n<p>Kandungan antioksidan dalam vitamin E dapat mencerahkan kulit. Pada wanita lanjut usia, vitamin E juga bekerja untuk memerangi penuaan, seperti menyamarkan lingkaran gelap dan bibir kering.</p>\r\n\r\n<p>4. Vitamin C (menyehatkan jaringan kulit, antioksidan)</p>\r\n\r\n<p>Vitamin C adalah nutrisi penting untuk kulit yang dapat melindungi dari kerusakan sinar matahari. Vitamin C juga mampu menyembuhkan luka, dengan melibatkan sintetis kolagen pada kulit.</p>\r\n\r\n<p>5. Aloe Barbadensis Leaf Extract (melindungi dari radikal bebas)</p>\r\n\r\n<p>Aloe Barbadensis Leaf Extract adalah tanaman yang kaya akan protein, kalsium, vitamin A, C, dan E dan sangat bermanfaat untuk:<br />\r\n&bull; Membersihkan kulit hingga ke pori-pori<br />\r\n&bull; Menghilangkan jerawat<br />\r\n&bull; Menghilangkan kantung mata (mata panda)<br />\r\n&bull; Mengencangkan dan meremajakan kulit<br />\r\n&bull; Mengurangi minyak berlebih pada wajah</p>\r\n\r\n<p>6. Vitis Vinifera Seed Extract (menghaluskan dan melembabkan kulit wajah)</p>\r\n\r\n<p>Vitis vinifera seed extract adalah ekstrak biji anggur yang mengandung antioksidan tinggi. Ekstrak biji anggur terdiri dari campuran flavonoid kompleks, vitamin E, asam linoleat dan procyanidin fenolik. Senyawa tersebut juga bisa ditemukan di kulit dan jus buah anggur.<br />\r\nVitis vinifera seed extract adalah ekstrak biji anggur yang mengandung antioksidan tinggi. Zat aktif vitis vinifera seed extract sebagian besar adalah polifenol atau OPC (procyanidin oligomer). Proanthocyanidins dan catechins merupakan antioksidan kuat pada biji anggur yang diyakini 50 kali lebih besar dari vitamin E dan 20 kali lebih besar dari vitamin C (Food Research Center di Guelph, Kanada)</p>\r\n\r\n<p>7. Tabir Surya (melindungi dari efek negatif sinar matahari)</p>\r\n\r\n<p>Apabila seseorang yang terlalu sering terpapar sinar matahari bisa meningkatkan risiko terjadinya kanker kulit.<br />\r\nTabir surya adalah produk yang dapat Anda gunakan untuk melindungi kulit Anda dari paparan sinar matahari.</p>\r\n\r\n<p>Keunggulan:</p>\r\n\r\n<ul>\r\n	<li>Mengandung bahan aktif yang berfungsi whitening</li>\r\n	<li>Riasan Make Up lebih terlihat alami</li>\r\n	<li>Menutrisi kulit dengan vitamin E dan vitamin C</li>\r\n	<li>Menghaluskan kulit dengan kandungan biji anggur</li>\r\n	<li>Mengandung Squalane yang baik untuk melembabkan dan menjaga kesehatan kulit</li>\r\n	<li>Cocok untuk segala jenis kulit</li>\r\n	<li>Kemasan Elegan</li>\r\n	<li>Praktis dibawa saat berpergian</li>\r\n	<li>Terdaftar di BPOM-RI</li>\r\n	<li>Bersertifikasi Halal MUI</li>\r\n</ul>\r\n\r\n<p>Cara Penggunaan:<br />\r\nSapukan spon pada SHADINA Brightening Two Way Cake Natural secukupnya lalu sapukan dengan lembut pada wajah hingga rata.<br />\r\nPeringatan: Jangan terlalu lama terpapar sinar matahari, meskipun menggunakan sediaan tabir surya</p>', 93500, 'photos/shadina_TWC.jpg', NULL, 'irwan', NULL, 'sholeh'),
(26, 2, 'Zahra Facial Wash (banded 6)', 'zahra-facial-wash-banded-6', '<p style=\"text-align:justify\"><strong>Zahra facial wash</strong> adalah busa pembersih wajah dengan pH balance sehingga dapat mengangkat dan membersihkan kotoran di wajah sampai ke pori-pori tanpa menimbulkan efek negatif. Zahra facial wash diformulasikan secara tepat dan disesuaikan dengan kebutuhan kulit wajah serta bebas dari bahan-bahan kimia berbahaya. Rutin mencuci wajah menggunakan Zahra facial wash adalah cara efektif agar Anda mendapatkan kulit wajah bersih, sehat, dan segar alami.</p>', '<p style=\"text-align:justify\"><strong>Zahra facial wash</strong> adalah busa pembersih wajah dengan pH balance sehingga dapat mengangkat dan membersihkan kotoran di wajah sampai ke pori-pori tanpa menimbulkan efek negatif. Zahra facial wash diformulasikan secara tepat dan disesuaikan dengan kebutuhan kulit wajah serta bebas dari bahan-bahan kimia berbahaya. Rutin mencuci wajah menggunakan Zahra facial wash adalah cara efektif agar Anda mendapatkan kulit wajah bersih, sehat, dan segar alami.</p>\r\n\r\n<p style=\"text-align:justify\">Zahra Facial Wash, mengandung komponen yang membersihkan, melembabkan, dan melindungi kulit, juga memberikan nutrisi untuk kulit karena mengandung ekstrak Alga Hijau</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nKeistimewaan dari Produk Zahra Facial Wash adalah kandungan zat aktifnya yang berupa kandungan Alga Hijaunya yang memiliki manfaat sebagai berikut :</p>\r\n\r\n<ol>\r\n	<li>Menutrisi kulit dengan kandungan vitamin dan mineral dari laut</li>\r\n	<li>Berfungsi sebagai anti-oksidan</li>\r\n	<li>Berfungsi sebagai anti-inflamasi</li>\r\n	<li>Berfungsi sebagai pembersih zat berbahaya bagi kulit</li>\r\n	<li style=\"text-align:justify\">Keunggulan lain dari produk ini adalah pH balance. Zahra Facial Wash yang ber-PH 5,5 adalah pembersih wajah yang paling baik karena dapat mencegah munculnya jerawat, iritasi, infeksi, dan dapat pula mengurangi gejala penuaan pada wajah. Produk dengan pH balance 5,5 sangat penting karena dapat melindungi lapisan asam pada kulit.</li>\r\n	<li>Zahra Facial Wash cocok untuk semua jenis kulit dan tidak perih di mata.</li>\r\n	<li style=\"text-align:justify\">Zahra Facial Wash diformulasikan secara tepat dan disesuaikan dengan kebutuhan kulit serta bebas dari bahan kimia.</li>\r\n	<li style=\"text-align:justify\">Rutin menggunakan Zahra Facial Wash adalah cara efektif agar anda mendapatkan kulit wajah bersih, sehat, dan segar alami.</li>\r\n</ol>\r\n\r\n<p>Manjakan kulit anda dengan Zahra Facial Wash dan dapatkan kulit segar sepanjang hari.</p>', 102000, 'photos/6-facial-wash.jpg', NULL, 'irwan', NULL, 'sholeh'),
(27, 2, 'Balqis Sabun Susu Mangir (banded 3)', 'balqis-sabun-susu-mangir-banded-3', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki PH yang disesuaikan dengan pH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi. Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki PH yang disesuaikan dengan pH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi. Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun Susu Mangir, berbagai bahan rempah yang terkandung dalam Sabun Susu Mangir dapat membantu merawat kehalusan dan kesehatan kulit, menghilangkan bau keringat, menjadikan kulit tampak kuning langsat dan membersihkan noda pada kulit. Sabun Susu Mangir juga dapat melindungi kulit agar terhindar dari dehidrasi, kusam, dan terbakar akibat sengatan sinar matahari.</p>\r\n\r\n<p style=\"text-align:justify\">Mangir dalam sabun BALQIS terbuat dari tepung beras, asam Jawa, lengkuas, daun pandan, kunyit, dan lain-lain<br />\r\nMangir dipercaya dapat merawat kehalusan dan kesehatan kulit, menghilangkan bau keringat, menjadikan kulit menjadi kuning langsat, dan membersihkan noda-noda pada kulit<br />\r\nMangir dapat melindungi kulit agar terhindar dari dehidrasi, kusam, dan terbakar akibat sengatan matahari<br />\r\nDi pasaran, sulit membedakan antara sabun yang menggunakan lemak sapi/domba dengan sabun yang menggunakan lemak babi. Lebih mengkhawatirkan lagi, kebanyakan sabun yang beredar di pasaran biasanya mengandung bahan kimia surface active agent (agen pembersih) seperti Sodium Lauryl Sulfate ( SLS), Sodium Laureth Sulfate (SLES) yang merupakan bahan dasar pembuat detergen. Karena bersifat pembersih (detergen), maka lemak-lemak yang berfungsi untuk melindungi kulit dapat ikut larut, sehingga kulit menjadi kering dan dapat memicu iritasi. Bahkan, untuk sabun yang mengklaim antibakteri/antikuman sangat mungkin mengandung triclosan (golongan pestisida) yang bersifat karsinogenik (pemicu kanker). Oleh karena itu, sedapat mungkin gunakanlah sabun mandi yang bahan bakunya sudah jelas dan tidak mengandung bahan kimia berbahaya. Selain itu, Anda juga harus berhati-hati, karena biasanya sabun yang mengandung bahan kimia di pasaran memiliki pH 7 hingga 9.2, sehingga dapat memicu peningkatan pH kulit (kulit berkurang keasamannya) dan berdampak kulit menjadi lebih rentan rusak serta infeksi.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nSabun mandi yang paling aman bagi kulit adalah sabun yang terbuat dari bahan-bahan alami seperti sabun BALQIS. Sabun BALQIS dengan varian lemon, jasmin, dan mangir terdiri dari bahan dasar susu sapi, dan dibuat menggunakan minyak nabati dari coconut oil dan palm oil yang kaya nutrisi, termasuk bagi kesehatan kulit. Kandungan susu sapi dalam sabun BALQIS kaya dengan asam beta hydroxy, sehingga dapat membantu pengelupasan sel kulit mati, dan mempercepat pergantiannya dengan sel kulit baru. Kandungan asam asam laurat, asam kaprat, dan asam kaprilat dalam coconut oil berkhasiat sebagai antibiotik, antiviral, anti parasit, anti jamur, dan antibakteri. Sedangkan kandungan vitamin E dengan konsentrasi tinggi pada coconut oil dapat melindungi kulit dari paparan sinar ultraviolet yang berbahaya, serta dapat menjaga kelembaban kulit.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nDi dalam sabun BALQIS, juga terkandung palm oil kaya karotenoid, sebagai sumber vitamin A yang berkhasiat untuk membantu menjaga kesehatan kulit agar mampu bernapas dan terbebas dari kotoran. Selain itu palm oil mengandung beberapa asam lemak tak jenuh seperti asam lemak palmitat, yang berperan untuk membantu mempercepat penyerapan zat-zat penting ke dalam kulit, sehingga dapat menjaga kelembaban sekaligus sebagai penghalus kulit. Asam lemak oleat, yang berkhasiat untuk menjaga kelembaban kulit. Asam lemak stearat yang berfungsi untuk mengeraskan dan menstabilkan busa. Asam lemak miristat, yang berkhasiat untuk mengangkat kotoran dari kulit secara lebih cepat, serta dapat mengurangi kadar minyak di wajah.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nSabun BALQIS memiliki pH yang hampir sama dengan pH kulit sehingga dapat mencegah kulit menjadi kering dan terhindar dari iritasi. Yang lebih istimewa, sabun BALQIS dapat digunakan untuk semua jenis kulit, dan aman digunakan untuk muka. Bila sudah mengetahui sabun dengan bahan baku yang aman, segeralah untuk menggunakannya. Lalu, apakah Anda masih percaya dengan klaim sabun dengan berbagai merek di pasaran yang bahan bakunya tidak jelas?</p>', 30000, 'photos/3-sabun-mangir.jpg', NULL, 'irwan', NULL, 'sholeh'),
(28, 2, 'Balqis Sabun Susu Lemon (banded 3)', 'balqis-sabun-susu-lemon-banded-3', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki pH yang disesuaikan dengan PH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi. Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki pH yang disesuaikan dengan PH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi. Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun Susu Lemon, lebih dari sekedar sabun untuk kesehatan kulit, karena aroma segar lemon pada Sabun Susu Lemon dapat membantu mendapatkan konsentrasi dan pikiran yang segar. Sabun Susu Lemon juga dapat menetralisasi bau keringat lebih cepat.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nSeorang psikolog bernama Robert L. Leahy, menyarankan beberapa kliennya untuk lebih sering menghirup aroma lemon, karena aroma lemon dapat menyegarkan pikiran dan meredam marah<br />\r\nAroma wangi lemon dapat meningkatkan konsentrasi<br />\r\nAroma wangi lemon lebih mudah menetralisasi bau yang tidak sedap<br />\r\nDi pasaran, sulit membedakan antara sabun yang menggunakan lemak sapi/domba dengan sabun yang menggunakan lemak babi. Lebih mengkhawatirkan lagi, kebanyakan sabun yang beredar di pasaran biasanya mengandung bahan kimia surface active agent (agen pembersih) seperti Sodium Lauryl Sulfate ( SLS),