at, yang berperan untuk membantu mempercepat penyerapan zat-zat penting ke dalam kulit, sehingga dapat menjaga kelembaban sekaligus sebagai penghalus kulit. Asam lemak oleat, yang berkhasiat untuk menjaga kelembaban kulit. Asam lemak stearat yang berfungsi untuk mengeraskan dan menstabilkan busa. Asam lemak miristat, yang berkhasiat untuk mengangkat kotoran dari kulit secara lebih cepat, serta dapat mengurangi kadar minyak di wajah.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun BALQIS memiliki pH yang hampir sama dengan pH kulit sehingga dapat mencegah kulit menjadi kering dan terhindar dari iritasi. Yang lebih istimewa, sabun BALQIS dapat digunakan untuk semua jenis kulit, dan aman digunakan untuk muka. Bila sudah mengetahui sabun dengan bahan baku yang aman, segeralah untuk menggunakannya. Lalu, apakah Anda masih percaya dengan klaim sabun dengan berbagai merek di pasaran yang bahan bakunya tidak jelas?</p>', 30000, 'photos/3-sabun-lemon.jpg', NULL, 'irwan', NULL, 'sholeh'),
(29, 2, 'Balqis Sabun Susu Jasmin (banded 3)', 'balqis-sabun-susu-jasmin-banded-3', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki pH yang disesuaikan dengan pH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi.</p>', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki pH yang disesuaikan dengan pH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi. Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>\r\n\r\n<p style=\"text-align:justify\">Balqis Sabun Susu Jasmine, selain dapat membersihkan dan menjaga kesehatan kulit, aroma Sabun Susu Jasmin dapat membantu memberikan efek ketenangan dan relaksasi pada Anda. Profesor Hanns Hatt dari Ruhr University dalam penelitiannya membuktikan, bahwa jasmin dapat memicu aktifnya GABA (senyawa alami yang ada di otak dan berfungsi sebagai penenang), sehingga disimpulkan bahwa dengan mencium aroma wangi jasmin (melati), seseorang dapat merasakan ketenangan, karena salah satu efek aroma jasmin (melati) adalah dapat dapat meredakan ketegangan Kemampuan jasmin (melati) memberikan efek ketenangan setara dengan obat penenang Sebagian orang meyakini, bahwa aroma jasmin dapat memberikan banyak manfaat kesehatan, mulai dari relaksasi hingga mengatasi berbagai masalah menstruasi dan menopause</p>\r\n\r\n<p style=\"text-align:justify\">Di pasaran, sulit membedakan antara sabun yang menggunakan lemak sapi/domba dengan sabun yang menggunakan lemak babi. Lebih mengkhawatirkan lagi, kebanyakan sabun yang beredar biasanya mengandung bahan kimia surface active agent (agen pembersih) seperti Sodium Lauryl Sulfate ( SLS), Sodium Laureth Sulfate (SLES) yang merupakan bahan dasar pembuat detergen. Karena bersifat pembersih (detergen), maka lemak-lemak yang berfungsi untuk melindungi kulit dapat ikut larut, sehingga kulit menjadi kering dan dapat memicu iritasi. Bahkan, untuk sabun yang mengklaim anti-bakteri/anti-kuman sangat mungkin mengandung triclosan (golongan pestisida) yang bersifat karsinogenik (pemicu kanker). Oleh karena itu, sedapat mungkin gunakanlah sabun mandi yang bahan bakunya sudah jelas dan tidak mengandung bahan kimia berbahaya. Selain itu, Anda juga harus berhati-hati, karena biasanya sabun yang mengandung bahan kimia di pasaran memiliki pH 7 hingga 9.2, sehingga dapat memicu peningkatan pH kulit (kulit berkurang keasamannya) dan berdampak kulit menjadi lebih rentan rusak serta infeksi.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun mandi yang paling aman bagi kulit adalah sabun yang terbuat dari bahan-bahan alami seperti Balqis Sabun Susu. Sabun BALQIS dengan varian lemon, jasmin, dan mangir terdiri dari bahan dasar susu sapi, dan dibuat menggunakan minyak nabati dari coconut oil dan palm oil yang kaya nutrisi, termasuk bagi kesehatan kulit. Kandungan susu sapi dalam sabun BALQIS kaya dengan asam beta hydroxy, sehingga dapat membantu pengelupasan sel kulit mati, dan mempercepat pergantiannya dengan sel kulit baru. Kandungan asam asam laurat, asam kaprat, dan asam kaprilat dalam coconut oil berkhasiat sebagai anti-biotik, anti-viral, anti-parasit, anti-jamur, dan anti-bakteri. Sedangkan kandungan vitamin E dengan konsentrasi tinggi pada coconut oil dapat melindungi kulit dari paparan sinar ultraviolet yang berbahaya, serta dapat menjaga kelembaban kulit.</p>\r\n\r\n<p style=\"text-align:justify\">Di dalam sabun BALQIS, juga terkandung palm oil kaya karotenoid, sebagai sumber vitamin A yang berkhasiat untuk membantu menjaga kesehatan kulit agar mampu bernapas dan terbebas dari kotoran. Selain itu palm oil mengandung beberapa asam lemak tak jenuh seperti asam lemak palmitat, yang berperan untuk membantu mempercepat penyerapan zat-zat penting ke dalam kulit, sehingga dapat menjaga kelembaban sekaligus sebagai penghalus kulit. Asam lemak oleat, yang berkhasiat untuk menjaga kelembaban kulit. Asam lemak stearat yang berfungsi untuk mengeraskan dan menstabilkan busa. Asam lemak miristat, yang berkhasiat untuk mengangkat kotoran dari kulit secara lebih cepat, serta dapat mengurangi kadar minyak di wajah.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun BALQIS memiliki pH yang hampir sama dengan pH kulit sehingga dapat mencegah kulit menjadi kering dan terhindar dari iritasi. Yang lebih istimewa, sabun BALQIS dapat digunakan untuk semua jenis kulit, dan aman digunakan untuk muka. Bila sudah mengetahui sabun dengan bahan baku yang aman, segeralah untuk menggunakannya.</p>', 30000, 'photos/3-sabun-jasmin.jpg', NULL, 'irwan', NULL, 'sholeh');
INSERT INTO `default_produk` (`id`, `bisnis_id`, `nama_brg`, `slug`, `keterangan_singkat`, `keterangan`, `harga`, `foto`, `tgl_input`, `petugas_input`, `tgl_update`, `petugas_update`) VALUES
(30, 2, 'Zahra Facial Wash', 'zahra-facial-wash', '<p style=\"text-align:justify\"><strong>Zahra facial wash</strong> adalah busa pembersih wajah dengan pH balance sehingga dapat mengangkat dan membersihkan kotoran di wajah sampai ke pori-pori tanpa menimbulkan efek negatif. Zahra facial wash diformulasikan secara tepat dan disesuaikan dengan kebutuhan kulit wajah serta bebas dari bahan-bahan kimia berbahaya. Rutin mencuci wajah menggunakan Zahra facial wash adalah cara efektif agar Anda mendapatkan kulit wajah bersih, sehat, dan segar alami.</p>', '<p style=\"text-align:justify\"><strong>Zahra facial wash</strong> adalah busa pembersih wajah dengan pH balance sehingga dapat mengangkat dan membersihkan kotoran di wajah sampai ke pori-pori tanpa menimbulkan efek negatif. Zahra facial wash diformulasikan secara tepat dan disesuaikan dengan kebutuhan kulit wajah serta bebas dari bahan-bahan kimia berbahaya. Rutin mencuci wajah menggunakan Zahra facial wash adalah cara efektif agar Anda mendapatkan kulit wajah bersih, sehat, dan segar alami.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Zahra Facial Wash</strong>, mengandung komponen yang membersihkan, melembabkan, dan melindungi kulit, juga memberikan nutrisi untuk kulit karena mengandung ekstrak Alga Hijau</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nKeistimewaan dari Produk <strong>Zahra Facial Wash </strong>adalah kandungan zat aktifnya yang berupa kandungan Alga Hijaunya yang memiliki manfaat sebagai berikut :</p>\r\n\r\n<ol>\r\n	<li>Menutrisi kulit dengan kandungan vitamin dan mineral dari laut</li>\r\n	<li>Berfungsi sebagai anti-oksidan</li>\r\n	<li>Berfungsi sebagai anti-inflamasi</li>\r\n	<li>Berfungsi sebagai pembersih zat berbahaya bagi kulit</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\">Keunggulan lain dari produk ini adalah pH balance. Zahra Facial Wash yang ber-PH 5,5 adalah pembersih wajah yang paling baik karena dapat mencegah munculnya jerawat, iritasi, infeksi, dan dapat pula mengurangi gejala penuaan pada wajah. Produk dengan pH balance 5,5 sangat penting karena dapat melindungi lapisan asam pada kulit.</p>\r\n\r\n<p>Zahra Facial Wash cocok untuk semua jenis kulit dan tidak perih di mata.</p>\r\n\r\n<p style=\"text-align:justify\">Zahra Facial Wash diformulasikan secara tepat dan disesuaikan dengan kebutuhan kulit serta bebas dari bahan kimia.</p>\r\n\r\n<p style=\"text-align:justify\">Rutin menggunakan Zahra Facial Wash adalah cara efektif agar anda mendapatkan kulit wajah bersih, sehat, dan segar alami.</p>\r\n\r\n<p>Manjakan kulit anda dengan Zahra Facial Wash dan dapatkan kulit segar sepanjang hari.</p>', 17000, 'photos/Zahra Facial Wash.jpg', NULL, 'irwan', NULL, NULL),
(31, 2, 'Balqis Sabun Susu Mangir', 'balqis-sabun-susu-mangir', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki PH yang disesuaikan dengan pH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi. Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki PH yang disesuaikan dengan pH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi. Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun Susu Mangir, berbagai bahan rempah yang terkandung dalam Sabun Susu Mangir dapat membantu merawat kehalusan dan kesehatan kulit, menghilangkan bau keringat, menjadikan kulit tampak kuning langsat dan membersihkan noda pada kulit. Sabun Susu Mangir juga dapat melindungi kulit agar terhindar dari dehidrasi, kusam, dan terbakar akibat sengatan sinar matahari.</p>\r\n\r\n<p style=\"text-align:justify\">Mangir dalam sabun BALQIS terbuat dari tepung beras, asam Jawa, lengkuas, daun pandan, kunyit, dan lain-lain Mangir dipercaya dapat merawat kehalusan dan kesehatan kulit, menghilangkan bau keringat, menjadikan kulit menjadi kuning langsat, dan membersihkan noda-noda pada kulit Mangir dapat melindungi kulit agar terhindar dari dehidrasi, kusam, dan terbakar akibat sengatan matahari</p>\r\n\r\n<p style=\"text-align:justify\">Di pasaran, sulit membedakan antara sabun yang menggunakan lemak sapi/domba dengan sabun yang menggunakan lemak babi. Lebih mengkhawatirkan lagi, kebanyakan sabun yang beredar di pasaran biasanya mengandung bahan kimia surface active agent (agen pembersih) seperti Sodium Lauryl Sulfate ( SLS), Sodium Laureth Sulfate (SLES) yang merupakan bahan dasar pembuat detergen. Karena bersifat pembersih (detergen), maka lemak-lemak yang berfungsi untuk melindungi kulit dapat ikut larut, sehingga kulit menjadi kering dan dapat memicu iritasi. Bahkan, untuk sabun yang mengklaim antibakteri/antikuman sangat mungkin mengandung triclosan (golongan pestisida) yang bersifat karsinogenik (pemicu kanker). Oleh karena itu, sedapat mungkin gunakanlah sabun mandi yang bahan bakunya sudah jelas dan tidak mengandung bahan kimia berbahaya. Selain itu, Anda juga harus berhati-hati, karena biasanya sabun yang mengandung bahan kimia di pasaran memiliki pH 7 hingga 9.2, sehingga dapat memicu peningkatan pH kulit (kulit berkurang keasamannya) dan berdampak kulit menjadi lebih rentan rusak serta infeksi.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nSabun mandi yang paling aman bagi kulit adalah sabun yang terbuat dari bahan-bahan alami seperti sabun BALQIS. Sabun BALQIS dengan varian lemon, jasmin, dan mangir terdiri dari bahan dasar susu sapi, dan dibuat menggunakan minyak nabati dari coconut oil dan palm oil yang kaya nutrisi, termasuk bagi kesehatan kulit. Kandungan susu sapi dalam sabun BALQIS kaya dengan asam beta hydroxy, sehingga dapat membantu pengelupasan sel kulit mati, dan mempercepat pergantiannya dengan sel kulit baru. Kandungan asam asam laurat, asam kaprat, dan asam kaprilat dalam coconut oil berkhasiat sebagai antibiotik, antiviral, anti parasit, anti jamur, dan antibakteri. Sedangkan kandungan vitamin E dengan konsentrasi tinggi pada coconut oil dapat melindungi kulit dari paparan sinar ultraviolet yang berbahaya, serta dapat menjaga kelembaban kulit.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nDi dalam sabun BALQIS, juga terkandung palm oil kaya karotenoid, sebagai sumber vitamin A yang berkhasiat untuk membantu menjaga kesehatan kulit agar mampu bernapas dan terbebas dari kotoran. Selain itu palm oil mengandung beberapa asam lemak tak jenuh seperti asam lemak palmitat, yang berperan untuk membantu mempercepat penyerapan zat-zat penting ke dalam kulit, sehingga dapat menjaga kelembaban sekaligus sebagai penghalus kulit. Asam lemak oleat, yang berkhasiat untuk menjaga kelembaban kulit. Asam lemak stearat yang berfungsi untuk mengeraskan dan menstabilkan busa. Asam lemak miristat, yang berkhasiat untuk mengangkat kotoran dari kulit secara lebih cepat, serta dapat mengurangi kadar minyak di wajah.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nSabun BALQIS memiliki pH yang hampir sama dengan pH kulit sehingga dapat mencegah kulit menjadi kering dan terhindar dari iritasi. Yang lebih istimewa, sabun BALQIS dapat digunakan untuk semua jenis kulit, dan aman digunakan untuk muka. Bila sudah mengetahui sabun dengan bahan baku yang aman, segeralah untuk menggunakannya. Lalu, apakah Anda masih percaya dengan klaim sabun dengan berbagai merek di pasaran yang bahan bakunya tidak jelas?</p>', 10000, 'photos/balqis_susu mangir.jpg', NULL, 'irwan', NULL, NULL),
(32, 2, 'Balqis Sabun Susu Lemon', 'balqis-sabun-susu-lemon', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki pH yang disesuaikan dengan PH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi. Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki pH yang disesuaikan dengan PH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi. Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun Susu Lemon, lebih dari sekedar sabun untuk kesehatan kulit, karena aroma segar lemon pada Sabun Susu Lemon dapat membantu mendapatkan konsentrasi dan pikiran yang segar. Sabun Susu Lemon juga dapat menetralisasi bau keringat lebih cepat.</p>\r\n\r\n<p style=\"text-align:justify\">Seorang psikolog bernama Robert L. Leahy, menyarankan beberapa kliennya untuk lebih sering menghirup aroma lemon, karena aroma lemon dapat menyegarkan pikiran dan meredam marah Aroma wangi lemon dapat meningkatkan konsentrasi Aroma wangi lemon lebih mudah menetralisasi bau yang tidak sedap</p>\r\n\r\n<p style=\"text-align:justify\">Di pasaran, sulit membedakan antara sabun yang menggunakan lemak sapi/domba dengan sabun yang menggunakan lemak babi. Lebih mengkhawatirkan lagi, kebanyakan sabun yang beredar di pasaran biasanya mengandung bahan kimia surface active agent (agen pembersih) seperti Sodium Lauryl Sulfate ( SLS), Sodium Laureth Sulfate (SLES) yang merupakan bahan dasar pembuat detergen. Karena bersifat pembersih (detergen), maka lemak-lemak yang berfungsi untuk melindungi kulit dapat ikut larut, sehingga kulit menjadi kering dan dapat memicu iritasi. Bahkan, untuk sabun yang mengklaim antibakteri/antikuman sangat mungkin mengandung triclosan (golongan pestisida) yang bersifat karsinogenik (pemicu kanker). Oleh karena itu, sedapat mungkin gunakanlah sabun mandi yang bahan bakunya sudah jelas dan tidak mengandung bahan kimia berbahaya. Selain itu, Anda juga harus berhati-hati, karena biasanya sabun yang mengandung bahan kimia di pasaran memiliki pH 7 hingga 9.2, sehingga dapat memicu peningkatan pH kulit (kulit berkurang keasamannya) dan berdampak kulit menjadi lebih rentan rusak serta infeksi.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun mandi yang paling aman bagi kulit adalah sabun yang terbuat dari bahan-bahan alami seperti sabun BALQIS. Sabun BALQIS dengan varian lemon, jasmin, dan mangir terdiri dari bahan dasar susu sapi, dan dibuat menggunakan minyak nabati dari coconut oil dan palm oil yang kaya nutrisi, termasuk bagi kesehatan kulit. Kandungan susu sapi dalam sabun BALQIS kaya dengan asam beta hydroxy, sehingga dapat membantu pengelupasan sel kulit mati, dan mempercepat pergantiannya dengan sel kulit baru. Kandungan asam asam laurat, asam kaprat, dan asam kaprilat dalam coconut oil berkhasiat sebagai anti-biotik, anti-viral, anti-parasit, anti-jamur, dan anti-bakteri. Sedangkan kandungan vitamin E dengan konsentrasi tinggi pada coconut oil dapat melindungi kulit dari paparan sinar ultra-violet yang berbahaya, serta dapat menjaga kelembaban kulit.</p>\r\n\r\n<p style=\"text-align:justify\">Di dalam sabun BALQIS, juga terkandung palm oil kaya karotenoid, sebagai sumber vitamin A yang berkhasiat untuk membantu menjaga kesehatan kulit agar mampu bernapas dan terbebas dari kotoran. Selain itu palm oil mengandung beberapa asam lemak tak jenuh seperti asam lemak palmitat, yang berperan untuk membantu mempercepat penyerapan zat-zat penting ke dalam kulit, sehingga dapat menjaga kelembaban sekaligus sebagai penghalus kulit. Asam lemak oleat, yang berkhasiat untuk menjaga kelembaban kulit. Asam lemak stearat yang berfungsi untuk mengeraskan dan menstabilkan busa. Asam lemak miristat, yang berkhasiat untuk mengangkat kotoran dari kulit secara lebih cepat, serta dapat mengurangi kadar minyak di wajah.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun BALQIS memiliki pH yang hampir sama dengan pH kulit sehingga dapat mencegah kulit menjadi kering dan terhindar dari iritasi. Yang lebih istimewa, sabun BALQIS dapat digunakan untuk semua jenis kulit, dan aman digunakan untuk muka. Bila sudah mengetahui sabun dengan bahan baku yang aman, segeralah untuk menggunakannya. Lalu, apakah Anda masih percaya dengan klaim sabun dengan berbagai merek di pasaran yang bahan bakunya tidak jelas?</p>', 10000, 'photos/balqislemon.jpg', NULL, 'irwan', NULL, NULL),
(33, 2, 'Balqis Sabun Susu Jasmin', 'balqis-sabun-susu-jasmin', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki pH yang disesuaikan dengan pH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi.</p>', '<p style=\"text-align:justify\"><strong>Sabun BALQIS</strong> adalah produk perawatan kulit berasal dari susu sapi murni yang dikombinasikan dengan coconut oil dan palm oil. Sabun BALQIS memiliki pH yang disesuaikan dengan pH kulit sehingga sangat berperan dalam pengelupasan sel kulit mati dan mempercepat pergantiannya dengan sel kulit baru, menjaga kelembaban alami kulit, dan mencegah iritasi.</p>\r\n\r\n<p style=\"text-align:justify\">Kaya dengan asam beta hydroxy, asam laktat, vitamin E, zat besi, dan anti-aging.</p>\r\n\r\n<p style=\"text-align:justify\">Balqis Sabun Susu Jasmine, selain dapat membersihkan dan menjaga kesehatan kulit, aroma Sabun Susu Jasmin dapat membantu memberikan efek ketenangan dan relaksasi pada Anda. Profesor Hanns Hatt dari Ruhr University dalam penelitiannya membuktikan, bahwa jasmin dapat memicu aktifnya GABA (senyawa alami yang ada di otak dan berfungsi sebagai penenang), sehingga disimpulkan bahwa dengan mencium aroma wangi jasmin (melati), seseorang dapat merasakan ketenangan, karena salah satu efek aroma jasmin (melati) adalah dapat meredakan ketegangan</p>\r\n\r\n<p style=\"text-align:justify\">Kemampuan jasmin (melati) memberikan efek ketenangan setara dengan obat penenang<br />\r\nSebagian orang meyakini, bahwa aroma jasmin dapat memberikan banyak manfaat kesehatan, mulai dari relaksasi hingga mengatasi berbagai masalah menstruasi dan menopause</p>\r\n\r\n<p style=\"text-align:justify\">Di pasaran, sulit membedakan antara sabun yang menggunakan lemak sapi/domba dengan sabun yang menggunakan lemak babi. Lebih mengkhawatirkan lagi, kebanyakan sabun yang beredar biasanya mengandung bahan kimia surface active agent (agen pembersih) seperti Sodium Lauryl Sulfate ( SLS), Sodium Laureth Sulfate (SLES) yang merupakan bahan dasar pembuat detergen. Karena bersifat pembersih (detergen), maka lemak-lemak yang berfungsi untuk melindungi kulit dapat ikut larut, sehingga kulit menjadi kering dan dapat memicu iritasi. Bahkan, untuk sabun yang mengklaim anti-bakteri/anti-kuman sangat mungkin mengandung triclosan (golongan pestisida) yang bersifat karsinogenik (pemicu kanker). Oleh karena itu, sedapat mungkin gunakanlah sabun mandi yang bahan bakunya sudah jelas dan tidak mengandung bahan kimia berbahaya. Selain itu, Anda juga harus berhati-hati, karena biasanya sabun yang mengandung bahan kimia di pasaran memiliki pH 7 hingga 9.2, sehingga dapat memicu peningkatan pH kulit (kulit berkurang keasamannya) dan berdampak kulit menjadi lebih rentan rusak serta infeksi.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun mandi yang paling aman bagi kulit adalah sabun yang terbuat dari bahan-bahan alami seperti Balqis Sabun Susu. Sabun BALQIS dengan varian lemon, jasmin, dan mangir terdiri dari bahan dasar susu sapi, dan dibuat menggunakan minyak nabati dari coconut oil dan palm oil yang kaya nutrisi, termasuk bagi kesehatan kulit. Kandungan susu sapi dalam sabun BALQIS kaya dengan asam beta hydroxy, sehingga dapat membantu pengelupasan sel kulit mati, dan mempercepat pergantiannya dengan sel kulit baru. Kandungan asam asam laurat, asam kaprat, dan asam kaprilat dalam coconut oil berkhasiat sebagai anti-biotik, anti-viral, anti-parasit, anti-jamur, dan anti-bakteri. Sedangkan kandungan vitamin E dengan konsentrasi tinggi pada coconut oil dapat melindungi kulit dari paparan sinar ultraviolet yang berbahaya, serta dapat menjaga kelembaban kulit.</p>\r\n\r\n<p style=\"text-align:justify\">Di dalam sabun BALQIS, juga terkandung palm oil kaya karotenoid, sebagai sumber vitamin A yang berkhasiat untuk membantu menjaga kesehatan kulit agar mampu bernapas dan terbebas dari kotoran. Selain itu palm oil mengandung beberapa asam lemak tak jenuh seperti asam lemak palmitat, yang berperan untuk membantu mempercepat penyerapan zat-zat penting ke dalam kulit, sehingga dapat menjaga kelembaban sekaligus sebagai penghalus kulit. Asam lemak oleat, yang berkhasiat untuk menjaga kelembaban kulit. Asam lemak stearat yang berfungsi untuk mengeraskan dan menstabilkan busa. Asam lemak miristat, yang berkhasiat untuk mengangkat kotoran dari kulit secara lebih cepat, serta dapat mengurangi kadar minyak di wajah.</p>\r\n\r\n<p style=\"text-align:justify\">Sabun BALQIS memiliki pH yang hampir sama dengan pH kulit sehingga dapat mencegah kulit menjadi kering dan terhindar dari iritasi. Yang lebih istimewa, sabun BALQIS dapat digunakan untuk semua jenis kulit, dan aman digunakan untuk muka. Bila sudah mengetahui sabun dengan bahan baku yang aman, segeralah untuk menggunakannya.</p>', 10000, 'photos/balqis_susu jasmin.jpg', NULL, 'irwan', NULL, NULL),
(34, 2, 'Raihan Pasta Gigi Herbal 1 Tube', 'raihan-pasta-gigi-herbal-1-tube', '<p style=\"text-align:justify\"><strong>Pasta gigi RAIHAN Herbal</strong> merupakan pasta gigi dengan formula khusus hasil kombinasi ekstrak daun sirih, minyak cengkeh, dan ekstrak daun mint sehingga efektif melindungi kesehatan gigi, gusi, mencegah bau mulut, serta mempertahankan kesegaran napas lebih lama.</p>', '<p style=\"text-align:justify\"><strong>Pasta gigi RAIHAN Herbal </strong>merupakan pasta gigi dengan formula khusus hasil kombinasi ekstrak daun sirih, minyak cengkeh, dan ekstrak daun mint sehingga efektif melindungi kesehatan gigi, gusi, mencegah bau mulut, serta mempertahankan kesegaran napas lebih lama.</p>\r\n\r\n<p style=\"text-align:justify\">Kaya dengan senyawa eugenol untuk kesehatan saraf gigi, xylitol untuk mencegah infeksi jamur, serta bersifat sebagai antibakteri mulut dan anti-septik.</p>\r\n\r\n<p><strong>Beberapa Bahan Aktif dalam Pasta Gigi RAIHAN</strong></p>\r\n\r\n<ul>\r\n	<li>Ekstrak Daun Sirih (Piper bettle)</li>\r\n	<li>Minyak Cengkeh (Clove Oil)</li>\r\n	<li>Ekstrak Daun Mint (Mentha piperita)&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Manfaat Sirih bagi Kesehatan Mulut</strong></p>\r\n\r\n<p style=\"text-align:justify\">Kandungan fenol dan kovikol di dalam daun sirih berfungsi sebagai anti-bakteri sehingga dapat melumpuhkan bakteri pemicu kerusakan gigi (bakteri staphylococcus aureus, eschericia coli, dan candida albicans). Ketiga bakteri ini menyebabkan berbagai penyakit/kerusakan pada gigi dan gusi, serta menimbulkan bau yang tidak sedap di mulut Aroma segar dari daun sirih sangat bermanfaat untuk menghilangkan bau mulut&nbsp;</p>\r\n\r\n<p><strong>Manfaat Cengkeh Bagi Kesehatan Mulut</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Cengkeh mengandung minyak esensial yang berfungsi sebagai anestetik (pembius/penghilang rasa sakit) dan antimicrobial</li>\r\n	<li>Cengkeh mengandung eugenol yang biasa digunakan untuk memperbaiki saraf gigi</li>\r\n	<li style=\"text-align: justify;\">Cengkeh mengandung anti-oksidan tinggi sehingga dapat menghambat perkembangbiakan bakteri pemicu keracunan dan menghilangkan bau mulut</li>\r\n	<li>Cengkeh juga bersifat anti-septik sehingga dapat membantu mencegah infeksi pada gigi dan gusi</li>\r\n</ol>\r\n\r\n<p><strong>Manfaat Mint Bagi Kesehatan Mulut</strong></p>\r\n\r\n<p style=\"text-align:justify\">Mint berperan sebagai anti-oksidan sehingga dapat menghambat pertumbuhan bakteri berbahaya dalam mulut<br />\r\nAroma mint yang segar dan mengandung bahan menthol sebagai bahan aktifnya dapat membuat nafas segar bertahan lebih lama</p>\r\n\r\n<p><strong>Keunggulan Pasta Gigi RAIHAN Herbal</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Semua bahan yang terkandung dalam RAIHAN merupakan bahan yang menunjang untuk kesehatan gigi, gusi, dan mulut</li>\r\n	<li style=\"text-align: justify;\">Semua bahan terjamin kehalalan dan keamanannya yang diperkuat dengan sertifikasi halal oleh MUI</li>\r\n	<li>RAIHAN diproduksi dengan pabrik modern secara higienis dan memperhatikan standar kualitas</li>\r\n	<li>RAIHAN dijual dengan harga terjangkau</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\">Menggunakan RAIHAN berarti Anda telah berpartisipasi dalam proyek pengembangan ekonomi umat muslim</p>', 15000, 'photos/Raihan Satuan.jpg', NULL, 'irwan', NULL, NULL),
(35, 2, 'Raihan Pasta Gigi Herbal 4 Tube', 'raihan-pasta-gigi-herbal-4-tube', '<p style=\"text-align:justify\"><strong>Pasta gigi RAIHAN Herbal</strong> merupakan pasta gigi dengan formula khusus hasil kombinasi ekstrak daun sirih, minyak cengkeh, dan ekstrak daun mint sehingga efektif melindungi kesehatan gigi, gusi, mencegah bau mulut, serta mempertahankan kesegaran napas lebih lama.</p>', '<p style=\"text-align:justify\"><strong>Pasta gigi RAIHAN Herbal</strong> merupakan pasta gigi dengan formula khusus hasil kombinasi ekstrak daun sirih, minyak cengkeh, dan ekstrak daun mint sehingga efektif melindungi kesehatan gigi, gusi, mencegah bau mulut, serta mempertahankan kesegaran napas lebih lama.</p>\r\n\r\n<p style=\"text-align:justify\">Kaya dengan senyawa eugenol untuk kesehatan saraf gigi, xylitol untuk mencegah infeksi jamur, serta bersifat sebagai anti-bakteri mulut dan anti-septik.</p>\r\n\r\n<p><strong>Beberapa Bahan Aktif dalam Pasta Gigi RAIHAN</strong></p>\r\n\r\n<ul>\r\n	<li>Ekstrak Daun Sirih (Piper bettle)</li>\r\n	<li>Minyak Cengkeh (Clove Oil)</li>\r\n	<li>Ekstrak Daun Mint (Mentha piperita)&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Manfaat Sirih bagi Kesehatan Mulut</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Kandungan fenol dan kovikol di dalam daun sirih berfungsi sebagai antibakteri sehingga dapat melumpuhkan bakteri pemicu kerusakan gigi (bakteri staphylococcus aureus, eschericia coli, dan candida albicans). Ketiga bakteri ini menyebabkan berbagai penyakit/kerusakan pada gigi dan gusi, serta menimbulkan bau yang tidak sedap di mulut &nbsp;</li>\r\n	<li>Aroma segar dari daun sirih sangat bermanfaat untuk menghilangkan bau mulut&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Manfaat Cengkeh Bagi Kesehatan Mulut</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Cengkeh mengandung minyak esensial yang berfungsi sebagai anestetik (pembius/penghilang rasa sakit) dan antimicrobial</li>\r\n	<li style=\"text-align: justify;\">Cengkeh mengandung eugenol yang biasa digunakan untuk memperbaiki saraf gigi</li>\r\n	<li style=\"text-align: justify;\">Cengkeh mengandung antioksidan tinggi sehingga dapat menghambatperkembangbiakan bakteri pemicu keracunan dan menghilangkan bau mulut</li>\r\n	<li style=\"text-align: justify;\">Cengkeh juga bersifat antiseptik sehingga dapat membantu mencegah infeksi pada gigi dan gusi</li>\r\n</ul>\r\n\r\n<p><strong>Manfaat Mint Bagi Kesehatan Mulut</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Mint berperan sebagai antioksidan sehingga dapat menghambat pertumbuhan bakteri berbahaya dalam mulut</li>\r\n	<li style=\"text-align: justify;\">Aroma mint yang segar dan mengandung bahan menthol sebagai bahan aktifnya dapat membuat nafas segar bertahan lebih lama</li>\r\n</ul>\r\n\r\n<p><strong>Alasan Anda Harus Memilih RAIHAN</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Semua bahan yang terkandung dalam RAIHAN merupakan bahan yang menunjang untuk kesehatan gigi, gusi, dan mulut</li>\r\n	<li style=\"text-align: justify;\">Semua bahan terjamin kehalalan dan keamanannya yang diperkuat dengan sertifikasi halal oleh MUI</li>\r\n	<li>RAIHAN diproduksi dengan pabrik modern secara higienis dan memperhatikan standar kualitas</li>\r\n	<li>RAIHAN dijual dengan harga terjangkau</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\">Menggunakan RAIHAN berarti Anda telah berpartisipasi dalam proyek pengembangan ekonomi umat muslim</p>', 60000, 'photos/Raihan 4 nTube.jpg', NULL, 'irwan', NULL, NULL),
(54, 2, 'Teh Hijau Istimewa Cap Pucuk', 'teh-hijau-istimewa-cap-pucuk', '<p style=\"text-align:justify\"><strong>Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo;</strong> merupakan minuman yang terbuat dari bahan baku pucuk teh hijau yang diolah menggunakan standar tinggi sehingga khasiat dan keunggulan teh tetap terjaga.</p>', '<p style=\"text-align:justify\"><strong>Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo;</strong> merupakan minuman yang terbuat dari bahan baku pucuk teh hijau yang diolah menggunakan standar tinggi sehingga khasiat dan keunggulan teh tetap terjaga.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; merupakan teh yang merupakan sumber alami kafein, teofilin dan antioksidan dengan kadar lemak, karbohidrat atau protein mendekati nol persen.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Bila dibuat dan diminum sesuai dengan anjuran, Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; dapat memberi khasiat antara lain:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Membantu menurunkan kadar kolesterol, dan kadar gula darah</li>\r\n	<li style=\"text-align: justify;\">Membantu meluruhkan lemak sehingga berefek melangsingkan</li>\r\n	<li style=\"text-align: justify;\">Membantu mencegah penyakit kanker dan mencegah pertumbuhan sel kanker</li>\r\n	<li style=\"text-align: justify;\">Membantu menurunkan dan menstabilkan tekanan darah</li>\r\n	<li style=\"text-align: justify;\">Membantu membersihkan ginjal sehingga dapat mencegah batu ginjal</li>\r\n	<li style=\"text-align: justify;\">Membantu mencegah penyempitan pembuluh darah sehingga dapat mencegah sakit jantung koroner dan stroke</li>\r\n	<li style=\"text-align: justify;\">Membantu menghaluskan kulit wajah sehingga tampak awet muda&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Keunggulan Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; antara lain:</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Bibit teh berasal dari bibit unggul yang berkualitas terjamin sejak zaman Belanda.</li>\r\n	<li style=\"text-align: justify;\">Pemangkasan daun yang teratur (dipangkas setiap 3 bulan), sehingga selalu menghasilkan pucuk baru yang berkualitas.</li>\r\n	<li style=\"text-align: justify;\">Pengeringan pucuk teh menggunakan rotary drum drier sehingga pengeringan merata sampai kadar air berkurang hingga 65%.</li>\r\n	<li style=\"text-align: justify;\">In-aktivasi enzim (penonaktifkan enzim) dengan penguapan suhu 80-90 derajat celsius yang tidak menyebabkan oksidasi sehingga kandungan polifenol tinggi tetap dapat dipertahankan.</li>\r\n	<li style=\"text-align: justify;\">Proses panen, pengangkutan, pengeringan dan pengolahan hingga pengemasan sangat singkat sehingga terhindar dari kontaminasi jamur dan bahan berbahaya lain.</li>\r\n</ul>\r\n\r\n<p><strong>Sifat dan Khasiat Teh Hijau Istimewa Cap Pucuk antara lain:</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; mengandung senyawa aktif polifenol (pencegah kanker), kafein (sebagai mild stimulant pada sistem saraf pusat untuk memperlancar sirkulasi darah ke otak), asam amino (sebagai penyusun protein), vitamin C (sebagai bahan imunitas atau penambah daya tahan tubuh), vitamin E (menjaga kesehatan jantung dan membuat kulit menjadi halus).</li>\r\n	<li style=\"text-align: justify;\">Kandungan bioflavonoid dalam Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; dapat memperkuat sistem pencernaan sekaligus menetralisir kelebihan gas lambung</li>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa epigallocatechin gallate (EGCG) dalam Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; dapat menghambat perkembangan senyawa karsinogenik, sehingga dapat mencegah pembentukan kanker.</li>\r\n	<li style=\"text-align: justify;\">Kandungan oksidan tak aktif polifenol dalam Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; dapat membantu mengurangi jumlah dan ukuran tumor.</li>\r\n	<li style=\"text-align: justify;\">Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; mengandung katekin yang dapat meningkatkan metabolisme dan membantu membakar lemak dalam tubuh, sehingga memiliki efek melangsingkan.</li>\r\n	<li style=\"text-align: justify;\">Kandungan EGCG Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; dapat membantu menghambat pertumbuhan bakteri Streptococcus mutans dan Streptococcus sobrinus, sehingga baik untuk kesehatan gigi, gusi dan mulut.</li>\r\n	<li style=\"text-align: justify;\">Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; mengandung asam amino L-teanin yang dapat membantu membuat lebih rileks dan meningkatkan daya ingat.</li>\r\n	<li style=\"text-align: justify;\">Kandungan flavonoid dalam Teh Hijau Istimewa &rdquo;Cap Pucuk&rdquo; bersifat sebagai antioksidan yang dapat mencegah penumpukan lemak dalam darah, menekan oksidasi kolesterol jahat, dan mencegah penyempitan pembuluh darah sehingga peredaran darah menjadi lancar, mencegah migrain, dan tekanan darah tinggi.</li>\r\n	<li style=\"text-align: justify;\">Teh Hijau Istimewa &ldquo;Cap Pucuk&rdquo; mengandung teanin yang dapat meningkatkan kapasitas sel Gamma Delta T untuk melawan penyakit dan membantu tubuh melawan infeksi.</li>\r\n</ul>\r\n\r\n<p><strong>Saran Penyajian Teh Hijau Istimewa Cap Pucuk</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Untuk memperoleh hasil yang optimal, sebaiknya seduh teh ke dalam air dengan suhu 80 hingga 85 derajat Celsius. Air yang terlalu panas akan merusak daun teh dan menyebabkan rasa jadi pahit.</li>\r\n	<li style=\"text-align: justify;\">Lama penyeduhan 2-3 menit, jika terlalu lama dapat merusak kandungan polifenolnya.&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Sebaiknya disajikan dengan gula rendah kalori (atau bahkan tanpa gula), agar nutrisi yang terkandung di dalamnya tidak terganggu.&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Teh hijau hanya baik dikonsumsi maksimal 2 hari, sebaiknya dihabiskan dalam satu hari karena setelah itu teh sudah rusak.&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Bila menggunakan poci atau mug sebaiknya yang tidak melepaskan bau, dan akan lebih baik dihangatkan sebelum digunakan agar teh tidak cepat dingin.</li>\r\n</ul>', 85000, 'photos/Teh Hijau Cap Pucuk.jpg', NULL, 'irwan', NULL, NULL),
(55, 2, 'Konsentea', 'konsentea', '<p style=\"text-align:justify\"><strong>KONSENTEA</strong> adalah minuman kesehatan berupa teh celup yang diramu khusus dari herbal pegagan (Centella asiatica) dan daun teh hijau (Camelia sinensis folium) pilihan untuk membantu memenuhi kebutuhan nutrisi otak sehingga dapat meningkatkan fungsi otak, daya ingat, dan konsentrasi.</p>', '<p style=\"text-align:justify\"><strong>KONSENTEA</strong> adalah minuman kesehatan berupa teh celup yang diramu khusus dari herbal pegagan (Centella asiatica) dan daun teh hijau (Camelia sinensis folium) pilihan untuk membantu memenuhi kebutuhan nutrisi otak sehingga dapat meningkatkan fungsi otak, daya ingat, dan konsentrasi.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Bila dibuat dan diminum sesuai dengan anjuran, KONSENTEA dapat memberi khasiat antara lain:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Membantu meningkatkan daya rangsang saraf otak, meningkatkan daya tahan otak, kemampuan belajar, konsentrasi, dan daya ingat.</li>\r\n	<li style=\"text-align: justify;\">Membantu mencegah stres, meningkatkan pembentukan memori jangka panjang, serta menghambat kematian sel otak.&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Sebagai antioksidan yang membantu merevitalisasi pembuluh darah dan membantu perkembangan sel-sel otak.</li>\r\n	<li style=\"text-align: justify;\">Dapat memberi efek relaksasi pada sistem saraf yang overaktif, sehingga dapat membantu anak yang hiperaktif.</li>\r\n	<li style=\"text-align: justify;\">Membantu meningkatkan IQ, kemampuan mental, serta menanggulangi lemah mental pada anak-anak.</li>\r\n	<li style=\"text-align: justify;\">Membantu menghambat pikun.</li>\r\n	<li style=\"text-align: justify;\">Membantu menjaga kesehatan gigi, gusi, dan mulut.</li>\r\n</ol>\r\n\r\n<p><strong>Sifat dan Khasiat Herbal Komposisi KONSENTEA antara lain:</strong></p>\r\n\r\n<p><strong>Ekstrak Pegagan (Centella Asiatica)</strong><br />\r\nEkstrak pegagan dalam KONSENTEA mengandung beberapa senyawa aktif antara lain:</p>\r\n\r\n<ul>\r\n	<li>Triterpenoid</li>\r\n</ul>\r\n\r\n<ol style=\"margin-left:40px\">\r\n	<li style=\"text-align: justify;\">Senyawa ini adalah senyawa terpenting dari tanaman pegagan, karena senyawa ini sangat berperan untuk meningkatkan fungsi mental lebih baik dan memberi efek menenangkan, sehingga cocok untuk orang-orang yang mengidap penyakit yang berkaitan dengan saraf yang overaktif, misalnya autis, atau penderita Attention Deficit Disorder (ADD). Senyawa triterpenoid juga dapat merevitalisasi pembuluh darah sehingga memperlancar peredaran darah menuju otak. Kondisi ini sangat membantu bagi penderita pikun dini dan mempercepat pemulihan bagi penderita stroke.</li>\r\n	<li style=\"text-align: justify;\">Senyawa triterpenoid bersifat sebagai antioksidan yang bekerja menangkap radikal bebas, sehingga sel otak terhindar dari kematian yang menyebabkan berkurangnya memori. Sebaliknya otak dapat lebih terangsang untuk bekerja dalam peningkatan kemampuan belajar dan daya ingat.</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Asiaticoside</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\">Senyawa ini adalah bagian dari triterpenoid. Senyawa ini sangat berperan untuk menstimulasi sel darah dan sistem imun sehingga darah dapat berfungsi optimal mensuplai nutrisi dan oksigen ke otak. Senyawa itu juga merupakan antibiotik alami dan mencegah kelelahan sebagai pemicu tidak konsentrasinya seseorang.</p>\r\n\r\n<ul>\r\n	<li>Brahmoside</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\">Senyawa ini sangat berperan untuk memperlancar peredaran darah menuju otak, sehingga dapat memasok oksigen dan nutrisi sel ke otak. Lancarnya nutrisi sel otak dapat meningkatkan kemampuan otak (IQ) untuk menelaah, meningkatkan memori, baik jangka pendek maupun jangka panjang.</p>\r\n\r\n<ul>\r\n	<li>Brahminoside</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\">Senyawa brahminoside merupakan protein penting bagi sel otak untuk perkembangannya, sehingga dapat mencegah dan menghambat datangnya pikun.</p>\r\n\r\n<ul>\r\n	<li>Vitamin dan Garam Mineral</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\">Di dalam pegagan terdapat Kalsium, magnesium, fosfor, seng, tembaga, batakaroten, vitamin B1, B2, B3, C. Berbagai vitamin dan garam mineral dalam tersebut sangat berkhasiat untuk meningkatkan stamina dan vitalitas, serta sebagai antioksidan yang membantu dalam perkembangan sel-sel otak, dan membantu memperkuat sekaligus meningkatkan daya tahan otak dan saraf.</p>\r\n\r\n<p><strong>Ekstrak Daun Teh Hijau</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Daun teh hijau komposisi KONSENTEA mengandung senyawa aktif polifenol (pencegah kanker), kafein (sebagai mild stimulant pada sistem saraf pusat untuk memperlancar sirkulasi darah ke otak), asam amino (sebagai penyusun protein), vitamin C (sebagai bahan imunitas atau penambah daya tahan tubuh), vitamin E (menjaga kesehatan jantung dan membuat kulit menjadi halus).</li>\r\n	<li style=\"text-align: justify;\">Kandungan bioflavonoid dalam daun teh hijau dapat memperkuat sistem pencernaan sekaligus menetralisir kelebihan gas lambung</li>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa epigallocatechin gallate (EGCG) dalam daun teh hijau dapat menghambat perkembangan senyawa karsinogenik, sehingga dapat mencegah pembentukan kanker.</li>\r\n	<li style=\"text-align: justify;\">Kandungan oksidan tak aktif polifenol dalam daun teh hijau dapat membantu mengurangi jumlah dan ukuran tumor.</li>\r\n	<li style=\"text-align: justify;\">Daun teh hijau mengandung katekin yang dapat meningkatkan metabolisme dan membantu membakar lemak dalam tubuh, sehingga memiliki efek melangsingkan.</li>\r\n	<li style=\"text-align: justify;\">Kandungan EGCG daun hijau dapat membantu menghambat pertumbuhan bakteri Streptococcus mutans dan Streptococcus sobrinus, sehingga baik untuk kesehatan gigi, gusi dan mulut.</li>\r\n</ul>\r\n\r\n<p><strong>Saran Penyajian KONSENTEA</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Seduh KONSENTEA dalam segelas air hangat dengan suhu 80-85 derajat celcius selama 2-3 menit.</li>\r\n	<li style=\"text-align: justify;\">Angkat dan buang bungkusnya minumlah selagi hangat.</li>\r\n	<li style=\"text-align: justify;\">Dapat ditambahkan gula atau madu secukupnya sesuai selera. Minumlah 2 kali sehari, sebaiknya sesudah makan</li>\r\n</ul>', 85000, 'photos/Konsentea.jpg', NULL, 'irwan', NULL, NULL),
(56, 2, 'Teh Celup Hilba', 'teh-celup-hilba', '<p style=\"text-align:justify\"><strong>TEH HILBA</strong> merupakan minuman teh celup yang terbuat dari bahan alami berupa daun teh dan biji hulbah yang sangat terkenal khasiatnya. TEH HILBA diformulasikan dan diolah dengan standar yang tinggi serta memperhatikan kualitas dan higienitas, sehingga sangat bermanfaat untuk membantu menjaga kesehatan tubuh, memelihara kesehatan pencernaan, dan menyegarkan badan.</p>', '<p style=\"text-align:justify\"><strong>TEH HILBA</strong> merupakan minuman teh celup yang terbuat dari bahan alami berupa daun teh dan biji hulbah yang sangat terkenal khasiatnya. TEH HILBA diformulasikan dan diolah dengan standar yang tinggi serta memperhatikan kualitas dan higienitas, sehingga sangat bermanfaat untuk membantu menjaga kesehatan tubuh, memelihara kesehatan pencernaan, dan menyegarkan badan.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Bila dibuat dan diminum sesuai dengan anjuran, TEH HILBA dapat memberi manfaat antara lain:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Membantu meningkatkan elatisitas pembuluh darah dan melancarkan aliran darah ke seluruh tubuh.&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Membantu menurunkan kolesterol dalam darah sehingga dapat membantu mengurangi risiko penyakit jantung koroner dan stroke.</li>\r\n	<li style=\"text-align: justify;\">Membantu menghambat pertumbuhan sel kanker.</li>\r\n	<li style=\"text-align: justify;\">Membantu meningkatkan sel darah putih dan meningkatkan kekebalan tubuh.</li>\r\n	<li style=\"text-align: justify;\">Membantu meningkatkan metabolisme dan hemoglobin sehingga dapat mencegah anemia.</li>\r\n	<li style=\"text-align: justify;\">Membantu menetralisir racun dalam tubuh serta membantu menghambat proses penuaan.</li>\r\n	<li style=\"text-align: justify;\">Membantu membersihkan usus dan mencegah wasir.</li>\r\n	<li style=\"text-align: justify;\">Membantu menguatkan dan mencegah pembusukan gigi.</li>\r\n</ol>\r\n\r\n<p><strong>Sifat dan Khasiat Herbal Komposisi TEH HILBA antara lain:</strong></p>\r\n\r\n<p><strong>Daun Teh</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Daun teh komposisi TEH HILBA mengandung senyawa aktif polifenol (pencegah kanker), kafein (sebagai mild stimulant pada sistem saraf pusat untuk memperlancar sirkulasi darah ke otak), asam amino (sebagai penyusun protein), vitamin C (sebagai bahan imunitas atau penambah daya tahan tubuh), vitamin E (menjaga kesehatan jantung dan membuat kulit menjadi halus).</li>\r\n	<li style=\"text-align: justify;\">Kandungan bioflavonoid dalam TEH HILBA dapat memperkuat sistem pencernaan sekaligus menetralisir kelebihan gas lambung</li>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa epigallocatechin gallate (EGCG) dalam TEH HILBA dapat menghambat perkembangan senyawa karsinogenik, sehingga dapat mencegah pembentukan kanker.</li>\r\n	<li style=\"text-align: justify;\">Kandungan oksidan tak aktif polifenol dalam TEH HILBA dapat membantu mengurangi jumlah dan ukuran tumor.</li>\r\n	<li style=\"text-align: justify;\">TEH HILBA mengandung katekin yang dapat meningkatkan metabolisme dan membantu membakar lemak dalam tubuh, sehingga memiliki efek melangsingkan.</li>\r\n	<li style=\"text-align: justify;\">Kandungan EGCG TEH HILBA dapat membantu menghambat pertumbuhan bakteri Streptococcus mutans dan Streptococcus sobrinus, sehingga baik untuk kesehatan gigi, gusi dan mulut.</li>\r\n</ul>\r\n\r\n<p><strong>Ekstrak Biji Hulbah</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Biji hulbah mengandung senyawa aktif antara lain musilago, alkaloid trigonelina, steroida, sapogenin, diosgenin, gitogenin, tigogenin, yamogenin, trilin, diosin, flavonoid vitexin, dan enzim yang secara sinergis dapat memberikan efek farmakologis sebagai pencahar (melancarkan BAB), antiinflamasi (mencegah pembengkakan), analgesik (penghilang nyeri), karminatif (pencegah kembung), antiseptik (pembunuh kuman), dan diaforetik (peluruh keringat)</li>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa steroid dalam hulbah dapat membantu meningkatkan stamina sehingga cocok untuk orang dengan aktivitas yang padat.</li>\r\n	<li style=\"text-align: justify;\">Kandungan musilago (serat) dan saponin yang tinggi dalam biji hulbah dapat membantu mengatasi sembelit, mencegah wasir dan usus buntu, dan menurunkan kolesterol.</li>\r\n	<li style=\"text-align: justify;\">Kandungan fosfor dalam biji hulbah berperan dalam penyimpanan dan pengeluaran energi, serta membantu pembentukan tulang, gigi, dan kuku.</li>\r\n	<li style=\"text-align: justify;\">Biji hulbah kaya dengan zat besi (Fe) sehingga dapat mengatasi anemia dan tekanan darah rendah, serta membantu memperlancar ASI.</li>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa fitoestrogen dalam biji hulbah dapat membantu kesehatan wanita pasca menopause.</li>\r\n	<li style=\"text-align: justify;\">Kandungan flavonoid dalam biji hulbah merupakan antioksidan yang dapat menangkal radikal bebas, membantu metabolisme karbohidrat, protein dan lemak, memperbaiki fungsi jantung, ginjal, otot tubuh, dan sistem saraf.</li>\r\n</ul>\r\n\r\n<p><strong>Saran Penyajian Teh HILBA:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Untuk memperoleh hasil yang optimal, sebaiknya celupkan satu kantong teh HILBA ke dalam cangkir yang berisi air dengan suhu 80 hingga 85 derajat Celsius.&nbsp;</li>\r\n	<li style=\"text-align: justify;\">Setelah 3-5 menit atau telah mendapatkan kekentalan yang diinginkan, keluarkan kantong teh HILBA.</li>\r\n	<li style=\"text-align: justify;\">Bila diinginkan, Anda dapat menambahkan gula atau madu.</li>\r\n	<li style=\"text-align: justify;\">Untuk mendapatkan kenikmatan lebih, minumlah teh HILBA selagi hangat.</li>\r\n</ol>', 53000, 'photos/Teh Hilba.jpg', NULL, 'irwan', NULL, NULL),
(57, 2, 'Mitra Sari Temulawak', 'mitra-sari-temulawak', '<p style=\"text-align:justify\"><strong>TEMULAWAK/SHAD KURKUM</strong> adalah kapsul herbal yang dibuat dari ekstrak temulawak (Curcumae xanthorizae rizhoma) terbaik dengan pengolahan standar tinggi, mengutamakan kualitas dan higienitas, sehingga sangat membantu untuk menjaga kesehatan, menambah nafsu makan, menurunkan kolesterol jahat, mengatasi maag, demam, radang sendi, serta membantu menjaga kesehatan hati.</p>', '<p style=\"text-align:justify\"><strong>H&amp;T FOOD SARI TEMULAWAK adalah Minuman kesehatan tradisional yang terdiri dari ekstrak temu lawak (Curcumae xanthorizae rizhoma) dan ekstak daun pandan (Pandamus Amaryllifolius) serta gula murni sebagai pemanis sekaligus pengawetnya ini sangat berkhasiat untuk membantu menambah nafsu makan, menurunkan kolesterol, anti-hepatitis, pereda demam, dan meningkatkan daya tahan tubuh.</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Dengan mengkonsumsi TEMULAWAK/SHAD KURKUM secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Membantu meningkatkan nafsu makan</li>\r\n	<li style=\"text-align:justify\">Membantu meredakan gejala maag</li>\r\n	<li style=\"text-align:justify\">Membantu mengatasi radang pada persendian</li>\r\n	<li style=\"text-align:justify\">Membantu melindungi hati</li>\r\n</ol>\r\n\r\n<p><strong>Sifat dan Khasiat Ekstrak Temulawak Komposisi TEMULAWAK/SHAD KURKUM antara lain:</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Ekstrak temulawak mengandung senyawa aktif kurkuminoid yang bersifat sebagai antibakteria, antiradang, dan antioksidan yang dapat membantu melancarkan metabolisme tubuh, sehingga sangat membantu meningkatkan daya tahan tubuh dalam menangkal berbagai penyakit.</li>\r\n	<li style=\"text-align:justify\">Kurkumin dalam ekstrak temulawak juga bersifat sebagai hepatoprotektor (pencegah pelemakan hati), dan hipokolesterolemik (penurun kadar kolesterol), sehingga sangat membantu mencegah dan mengatasi penyakit radang pada hati, radang sendi dengan cara menghambat migrasi sel-sel leukosit ke area radang, serta mencegah penggumpalan darah yang memicu hipertensi.&nbsp;</li>\r\n	<li style=\"text-align:justify\">Ekstrak temulawak mengandung minyak atsiri yang bersifat sebagai analgetik (penghilang rasa sakit), antipiretik (penurun demam), dan mampu meningkatkan produksi getah empedu serta mampu menekan pembengkakan.</li>\r\n	<li style=\"text-align:justify\">Ekstrak temulawak juga mengandung senyawa desmetoksikurkumin yang secara umum bermanfaat untuk menetralkan racun sehingga sangat membantu mempercepat penyembuhan penyakit.</li>\r\n	<li style=\"text-align:justify\">Kandungan minyak atsiri dan kurkuminoid dalam ekstrak temulawak dapat memberikan efek karminativum (merangsang pengeluaran gas berlebih dalam lambung), sehingga dapat mengatasi kembung dan meningkatkan nafsu makan. &nbsp;</li>\r\n	<li style=\"text-align:justify\">Kurkuminoid dalam ekstrak temulawak juga berperan untuk menetralkan asam lambung sebagai penyebab utama penyakit maag, sehingga efektif mengatasi penyakit maag.</li>\r\n</ul>', 55000, 'photos/Sari-Temulawak.jpg', NULL, 'irwan', NULL, 'sholeh');
INSERT INTO `default_produk` (`id`, `bisnis_id`, `nama_brg`, `slug`, `keterangan_singkat`, `keterangan`, `harga`, `foto`, `tgl_input`, `petugas_input`, `tgl_update`, `petugas_update`) VALUES
(58, 2, 'Salam Fit, 125 ml', 'salam-fit-125-ml', '<p style=\"text-align:justify\"><strong>SALAM FIT</strong> adalah multivitamin yang terbuat dari bahan herbal yang kaya nutrisi dan bermanfaat untuk memelihara kesehatan anak, meningkatkan imunitas tubuh dan stamina, sangat baik untuk membantu pertumbuhan otak serta tumbuh kembang anak.</p>', '<p style=\"text-align:justify\"><strong>SALAM FIT</strong> adalah multivitamin yang terbuat dari bahan herbal yang kaya nutrisi dan bermanfaat untuk memelihara kesehatan anak, meningkatkan imunitas tubuh dan stamina, sangat baik untuk membantu pertumbuhan otak serta tumbuh kembang anak.</p>\r\n\r\n<p style=\"text-align:justify\">Komposisi SALAM FIT antara lain madu (honey), Royal jelly, Bee pollen, Nigella sativa (habbatussauda), dan minyak zaitun (olive oil).</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Dengan mengkonsumsi SALAM FIT secara teratur sesuai dosis yang dianjurkan dapat memberikan manfaat antara lain:</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Sebagai multivitamin dan nutrisi tambahan bagi anak</li>\r\n	<li style=\"text-align: justify;\">Membantu memelihara kesehatan anak</li>\r\n	<li style=\"text-align: justify;\">Membantu meningkatkan imunitas tubuh anak</li>\r\n	<li style=\"text-align: justify;\">Membantu meningkatkan stamina anak</li>\r\n	<li style=\"text-align: justify;\">Membantu melancarkan peredaran darah anak</li>\r\n	<li style=\"text-align: justify;\">Membantu meningkatkan pertumbuhan dan kecerdasan anak</li>\r\n</ul>\r\n\r\n<p><strong>Sifat dan Khasiat Herbal Komposisi SALAM FIT antara lain:</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Madu (Honey)</strong><br />\r\nKandungan utama madu adalah gula dengan jenis fruktosa, glukosa, sukrosa. Unsur tambahan lainnya, seperti tepung sari dan berbagai enzim pencernaan, vitamin A, vitamin B1, vitamin B2, antibiotika, dan zat lainnya, yang secara sinergis memiliki efek farmakologis sebagai:</p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Imunostimulator, sehingga dapat membantu meningkatkan daya tahan tubuh anak.</li>\r\n	<li style=\"text-align: justify;\">Stomakik (penambah nafsu makan), sehingga sangat membantu anak yang susah makan.</li>\r\n	<li style=\"text-align: justify;\">Antimicrobial dan antiinfeksi alami sehingga dapat membantu tubuh anak melawan infeksi agar tidak semakin parah.</li>\r\n	<li style=\"text-align: justify;\">Peningkat kinerja otak anak sehingga lebih mudah berkonsentrasi dan meningkatkan kecerdasannya.</li>\r\n</ul>\r\n\r\n<p><strong>Royal Jelly</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Royal Jelly mengandung zat royalactin (sejenis protein) yang bersifat sebagai antioksidan dan sangat berperan dalam proses pertumbuhan, sehingga royal jelly sangat baik dikonsumsi oleh anak dalam masa pertumbuhan</li>\r\n	<li style=\"text-align: justify;\">Kandungan asetilkolin dalam royal jelly dapat membantu anak berkonsentrasi, meningkatkan daya ingat dan kecerdasan</li>\r\n	<li style=\"text-align: justify;\">Royal jelly mengandung royalisin yang bertindak sebagai antibakteri dan antijamur sehingga membantu anak terhindar dari penyakit yang disebabkan bakteri dan jamur.</li>\r\n	<li style=\"text-align: justify;\">Royal jelly mempunyai kandungan protein gamma-globulin yang bermanfaat untuk meningkatkan kekebalan tubuh dan bermanfaat untuk stamina tubuh anak.</li>\r\n	<li style=\"text-align: justify;\">Royal jelly dapat membantu meningkatkan kemampuan tulang menyerap kalsium sekaligus menstimulasi pembentukan tulang anak saat masa pertumbuhan.</li>\r\n</ul>\r\n\r\n<p><strong>Bee Polen</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Kandungan asam glutamat dalam bee pollen berfungsi membawa mineral kalium ke otak sehingga dapat membantu meningkatkan konsentrasi serta kemampuan daya pikir anak.</li>\r\n	<li style=\"text-align: justify;\">Bee pollen juga mengandung lecithin dan asam pantotenat yang berperan dalam membantu meningkatkan kinerja otak anak sehingga dapat meningkatkan IQ dan kecerdasan.</li>\r\n	<li style=\"text-align: justify;\">Sekitar 50% kandungan protein bee pollen (dalam bentuk asam amino) dapat langsung digunakan oleh tubuh, sehingga &nbsp;bee pollen dapat membantu mencukupi nutrisi tubuh anak sekaligus meningkatkan daya tahan tubuhnya.</li>\r\n</ul>\r\n\r\n<p><strong>Nigella Sativa (Habbatussauda)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa aktif Nigella sativa (habbatussauda) antara lain fix oil (oleat/omega 9, linoleat/omega 6, linolenat/omega 3, dan eicosadionat), saponin, minyak esensial, fitosterol, alkaloid, asam amino, karoten, berbagai vitamin (A,B, B2, C, E), dan mineral yang secara sinergis memberikan efek farmakologis membantu menguatkan sistem kekebalan tubuh, meningkatkan daya ingat, konsentrasi, meningkatkan bioaktivitas hormon, dan membantu menetralkan racun dalam tubuh.</li>\r\n	<li style=\"text-align: justify;\">Nigella sativa juga bersifat antialergi (antihistamin), sehingga melindungi anak dari berbagai alergen.</li>\r\n</ul>\r\n\r\n<p><strong>Minyak Zaitun (Olive Oil)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Kandungan senyawa aktif minyak zaitun adalah asam oleat (omega 9), asam linoleat (omega 6), asam stearat, polifenol, koloid, vitamin A, B1, B2, C, D, E, K, dan Fe.</li>\r\n	<li style=\"text-align: justify;\">Omega 3 dan omega 6 sangat berperan membantu penyusunan sel otak dan mempengaruhi kecerdasan anak, sedangkan keseimbangan omega 3 dan omega 6 dalam sel membran dapat mengoptimalkan pertahanan utama tubuh anak</li>\r\n	<li style=\"text-align: justify;\">Omega 9 dapat melindungi tubuh dengan menurunkan kolesterol jahat (LDL), sekaligus meningkatkan kolesterol baik (HDL) sehingga dapat memperlancar metabolisme dan peredaran darah anak maupun dewasa.</li>\r\n</ul>', 78000, 'photos/Salam Fit.jpg', NULL, 'irwan', NULL, NULL),
(59, 2, 'Master Coffee Herbal Plus', 'master-coffee-herbal-plus', '<p style=\"text-align:justify\">Master Coffee Herbal Plus adalah minuman instan hasil inovasi olahan kopi Arabika plus creamer yang dipadu dengan bahan herbal mengkudu, hulbah, dan purwoceng sehingga dapat memberi manfaat untuk:</p>', '<p style=\"text-align:justify\"><strong>Master Coffee Herbal Plus</strong> adalah minuman instan hasil inovasi olahan kopi Arabika plus creamer yang dipadu dengan bahan herbal mengkudu, hulbah, dan purwoceng sehingga dapat memberi manfaat untuk:</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Mengatasi anemia</li>\r\n	<li style=\"text-align:justify\">Meningkatkan stamina pria dan wanita</li>\r\n	<li style=\"text-align:justify\">Mencegah sembelit, wasir,</li>\r\n	<li style=\"text-align:justify\">Bersifat anti kanker.</li>\r\n</ul>\r\n\r\n<p><strong><em>Produk ini diformulasi istimewa tanpa pemanis buatan dan aman bagi lambung.</em></strong></p>\r\n\r\n<p><strong>Keungulan:</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kaya zat besi untuk membantu mengobati kurang darah sehingga cocok untuk penderita anemia.</li>\r\n	<li style=\"text-align:justify\">Mengandung stigmasterol untuk membantu meningkatkan stamina pada pria dan wanita.</li>\r\n	<li style=\"text-align:justify\">Mengandung serat untuk membantu mencegah sembelit dan wasir.</li>\r\n	<li style=\"text-align:justify\">Mengandung damnacanthal sebagai� anti-kanker.</li>\r\n	<li style=\"text-align:justify\">Tanpa pemanis buatan.</li>\r\n</ul>\r\n\r\n<p><strong>Komposisi:</strong></p>\r\n\r\n<ul>\r\n	<li>Kopi</li>\r\n	<li>Gula</li>\r\n	<li>Mengkudu</li>\r\n	<li>Hilba</li>\r\n	<li>Purwoceng</li>\r\n</ul>\r\n\r\n<p><strong>Saran penyajian:</strong></p>\r\n\r\n<ol>\r\n	<li>Tuangkan satu sachet Master Coffee Herbal Plus ke dalam cangkir</li>\r\n	<li>Tambahkan kurang lebih 150 cc air panas</li>\r\n	<li>Aduk dan siap disajikan</li>\r\n</ol>', 77000, 'photos/master_coffee.jpg', NULL, 'irwan', NULL, 'sholeh'),
(60, 2, 'SULTAN Madu Sari Kurma Plus', 'sultan-madu-sari-kurma-plus', '<p style=\"text-align:justify\">SULTAN MADU SARI KURMA PLUS adalah makanan kesehatan yang baik untuk untuk mejaga kebugaran dan stamina tubuh Anda. SULTAN MADU SARI KURMA PLUS merupakan kombinasi Madu, Sari Kurma, dan Serbuk Biji Angkak, dengan formulasi yang TEPAT sehingga menghasilkan cita rasa yang lezat serta kaya manfaat.</p>', '<p style=\"text-align:justify\">SULTAN MADU SARI KURMA PLUS adalah makanan kesehatan yang baik untuk untuk mejaga kebugaran dan stamina tubuh Anda. SULTAN MADU SARI KURMA PLUS merupakan kombinasi Madu, Sari Kurma, dan Serbuk Biji Angkak, dengan formulasi yang TEPAT sehingga menghasilkan cita rasa yang lezat serta kaya manfaat.</p>\r\n\r\n<p style=\"text-align:justify\">SUTAN MADU SARI KURMA PLUS memiliki komposisi sebagai berikut :<br />\r\nMadu (Mel Depuratum) : 57.3 %<br />\r\nSari Kurma (Phoenix Dactylifera) : 41.2%<br />\r\nAngkak (Monascus Purpureus) : 1.5%</p>\r\n\r\n<p style=\"text-align:justify\">Khasiat dari komposisi produk SULTAN MADU SARI KURMA PLUS adalah sebagai berikut :<br />\r\n1.Madu (Mel Depuratum)</p>\r\n\r\n<p style=\"text-align:justify\">Kandungan utama madu adalah gula dengan jenis fruktosa, glukosa, sukrosa. Unsur tambahan lainnya, seperti tepung sari dan berbagai enzim pencernaan, vitamin A, vitamin B1, vitamin B2, antibiotika, dan zat lainnya. Kandungan gula pada madu ini dapat diproses langsung menjadi glukogen sehingga manfaat madu dapat langsung dirasakan oleh tubuh.<br />\r\nBerbagai kandungan madu secara sinergis memiliki efek farmakologis sebagai:</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Antibakteri/antimikrobial sehingga dapat membantu mengatasi berbagai penyakit akibat virus dan bakteri seperti batuk, radang tenggorokan, bronkitis, dan lain-lain</li>\r\n	<li style=\"text-align:justify\">Antibiotik alami sehingga dapat mengoptimalkan kemampuan tubuh melawan penyakit sehingga dapat mempercepat penyembuhan dan pemulihan tubuh setelah sakit</li>\r\n	<li style=\"text-align:justify\">Antiinflamasi sehingga dapat membantu mengatasi berbagai penyakit yang bersifat radang</li>\r\n	<li style=\"text-align:justify\">Bersifat cleanser (pembersih) darah alami dalam tubuh</li>\r\n	<li style=\"text-align:justify\">Antidepresan (bersifat menenangkan) alami, sehingga dapat membantu mengatasi stres dan susah tidur</li>\r\n	<li style=\"text-align:justify\">Berdifusi lebih cepat melalui darah dan membantu mengoptimalkan fungsi ginjal dan usus, membantu menambah nafsu makan</li>\r\n</ul>\r\n\r\n<p>2. Sari Kurma (Phoenix Dactylifera)</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kurma matang mengandung gula sekitar 80%, sisanya terdiri dari tanin, protein, lemak dan produk mineral termasuk tembaga, besi, magnesium dan asam folat. Secara sinergis kandungan zat dalam kurma tersebut dapat memberikan efek farmakologis mempercepat pengembalian stamina saat keletihan dan mempercepat pemulihan tubuh dari sakit.</li>\r\n	<li style=\"text-align:justify\">Kandungan serat dan kalium dalam kurma dapat membantu melancarkan BAB, memperbaiki sistem pencernaan, membantu mencegah penumpukan kolesterol jahat dalam tubuh, dan membantu mengendalikan denyut jantung dan tekanan darah agar tetap normal.</li>\r\n	<li style=\"text-align:justify\">Kandungan tanin dalam kurma bersifat antiinfeksi (membantu tubuh melawan bakteri dan virus), antiinflamasi (mencegah peradangan) dan antihemoragik (mencegah pecahnya pembuluh darah), sehingga dapat membantu agar terhindar dari stroke.</li>\r\n	<li style=\"text-align:justify\">Kandungan zat besi dalam kurma dapat membantu meningkatkan hemoglobin dan membantu kelancaran aliran oksigen dalam darah.</li>\r\n	<li style=\"text-align:justify\">Kandungan vitamin A dalam kurma dapat membantu menjaga kesehatan kulit, serta dapat melindungi tubuh dari kanker paru-paru dan rongga mulut.</li>\r\n</ul>\r\n\r\n<p>3. Angkak (Monascus Purpureus)</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Angkak adalah beras putih yang telah mengalami proses fermentasi oleh jamur Monascus Purpureus dan menjadi berwarna merah kecoklatan. Banyak orang yang mengonsumsi angkak sebagai makanan pokok.</li>\r\n	<li style=\"text-align:justify\">Penggunaan angkak juga sering dijadikan sebagai suplemen makanan. Angkak mengandung beberapa zat yang sangat baik bagi kesehatan.</li>\r\n	<li style=\"text-align:justify\">Ada beberapa kandungan zat di dalam angkak yang sangat berguna bagi kesehatan tubuh. Manfaat angkak yang terkenal sebagai obat tradisional tidak terlepas dari zat-zat penting yang terkandung di dalam angkak.</li>\r\n	<li style=\"text-align:justify\">Angkak mengandung serat, karbohidrat, dan protein. Selain itu, di dalam angkak juga mengandung lovastatin yang sangat bermanfaat bagi kesehatan jantung. Lovastatin adalah zat di dalam angkak yang mirip dengan obat jantung.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">Formulasi tiga komponen tadi menghasilkan SULTAN MADU SARI KURMA PLUS yang berkhasiat sebagai berikut :</p>\r\n\r\n<ol>\r\n	<li>Membantu meningkatkan energi dan mengatasi anemia</li>\r\n	<li>Membantu meningkatkan ketahanan tubuh</li>\r\n	<li>Membantu meningkatkan Hb (hemoglobin) dan Thrombosit</li>\r\n	<li>Membantu Penyembuhan DBD (Demam Berdarah Dengue) dan Thypus</li>\r\n	<li>Membantu nyenyak tidur bagi penderita insomia</li>\r\n	<li>Melancarkan pencernaan</li>\r\n	<li>Membantu menyehatkan jantung mengatasi keletihan</li>\r\n	<li>Membantu menormalkan tekanan darah</li>\r\n</ol>\r\n\r\n<p>Aturan Minum :</p>\r\n\r\n<p>Anak-anak : 3 kali sehari 1-2 sendok teh<br />\r\nDewasa : 3 kali sehari 1-2 sendok makan</p>', 94000, 'photos/sultan.jpg', NULL, 'sholeh', NULL, 'nurhidayat'),
(61, 2, 'Madu Salsabil Plus Royal Jelly', 'madu-salsabil-plus-royal-jelly', '<p style=\"text-align:justify\"><strong>Madu SALSABIL Plus ROYAL JELLY</strong> adalah salah satu minuman kesehatan anjuran Rasulullah SAW dengan komposisi madu murni ditambah royal jelly.</p>', '<p style=\"text-align:justify\"><strong>Madu SALSABIL Plus ROYAL JELLY</strong> adalah salah satu minuman kesehatan anjuran Rasulullah SAW dengan komposisi madu murni ditambah royal jelly.</p>\r\n\r\n<p style=\"text-align:justify\">Bahan baku <strong>madu SALSABIL Plus ROYAL JELLY</strong> dipanen dan diproses menggunakan standar pengolahan yang sangat memperhatikan kebersihan, sehingga keaslian, kualitas, serta khasiat <strong>madu SALSABIL Plus ROYAL JELLY</strong> tetap terjaga.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>madu SALSABIL Plus ROYAL JELLY</strong> secara rutin sesuai dosis yang dianjurkan, dapat memberikan manfaat antara lain:</p>\r\n\r\n<p style=\"text-align:justify\">1. Membantu meningkatkan daya tahan tubuh dan vitalitas<br />\r\n2. Membantu mengoptimalkan kinerja otak, sehingga dapat membantu meningkatkan &nbsp;kecerdasan dan menghambat pikun<br />\r\n3. Membantu mengoptimalkan fungsi ginjal dan usus<br />\r\n4. Membantu melindungi tubuh dari masalah pembuluh kapiler dan pengerasan arteri (arteriosklerosis) sehingga baik untuk penderita darah tinggi<br />\r\n5. Sebagai antibiotik dan antioksidan alami, sehingga baik untuk membantu mengatasi asma, batuk, bronkitis, radang tenggorokan, dan lain-lain<br />\r\n6. Membantu mempercepat pemulihan dari sakit dan perbaikan sel tubuh yang rusak</p>\r\n\r\n<p>Kandungan dan Khasiat Komposisi <strong>Madu SALSABIL Plus ROYAL JELLY</strong> antara lain:</p>\r\n\r\n<p><strong>Madu (Honey)</strong></p>\r\n\r\n<p style=\"text-align:justify\">Kandungan utama madu adalah gula dengan jenis fruktosa, glukosa, sukrosa. Unsur tambahan lainnya, seperti tepung sari dan berbagai enzim pencernaan, &nbsp;vitamin A, vitamin B1, vitamin B2, antibiotika, dan zat lainnya. Kandungan gula pada madu ini dapat diproses langsung menjadi glukogen sehingga manfaat madu dapat langsung dirasakan oleh tubuh. Berbagai kandungan madu secara sinergis memiliki efek farmakologis sebagai:</p>\r\n\r\n<p style=\"text-align:justify\">Antibakteri/antimikrobial sehingga dapat membantu mengatasi berbagai penyakit akibat virus dan bakteri seperti batuk, radang tenggorokan, bronkitis, dan lain-lain Antibiotik alami sehingga dapat mengoptimalkan kemampuan tubuh melawan penyakit sehingga dapat mempercepat penyembuhan dan pemulihan tubuh setelah sakit Antiinflamasi sehingga dapat membanti mengatasi berbagai penyakit yang bersifat radang Bersifat cleansear (pembersih) darah alami dalam tubuh Antidepresan (bersifat menenangkan) alami, sehingga dapat membantu mengatasi stres dan susah tidur Berdifusi lebih cepat melalui darah dan membantu mengoptimalkan fungsi ginjal dan usus, membantu menambah nafsu makan</p>\r\n\r\n<p><strong>Royal Jelly</strong></p>\r\n\r\n<p style=\"text-align:justify\">Di dalam royal jelly terdapat zat yang sangat bermanfaat bagi kesehatan antara lain: protein dan asam amino, asam lemak esensial 10-HDA (trans-10-hydroxy-2-decenoic acid), vitamin B kompleks (seperti: B1, B2, B6, B12, biotin, asam folat dan inositol), vitamin B5 atau asam pantotenat, asetilkolin, fruktosa, glukosa, dan mineral (seperti: kalium, kalsium, natrium, zink, besi, cuprum, dan mangan). Berbagai zat tersebut secara sinergis dapat membantu menurunkan tingkat kerusakan DNA, sehingga membantu meningkatkan angka harapan hidup Kandungan protein yang terdapat dalam royal jelly bersifat sebagai antioksidan untuk mengatasi radikal bebas, sehingga baik untuk sistem pertahanan tubuh dan mencegah infeksi bakteri dan jamur Kandungan 10-HDA yang terdapat dalam royal jelly dapat membantu meningkatkan produksi kolagen dalam sel kulit, sehingga dapat membantu peremajaan sel kulit dan menghambat penuaan dini Kandungan asetilkolin dalam royal jelly dapat membantu meningkatkan daya ingat dan menghambat pikun Royal jelly dapat menstimulasi pembentukan tulang serta membantu mengurangi risiko terjadinya osteoporosis akibat menurunnya kepadatan tulang.</p>', 189000, 'photos/Madu Salsabil Plus Royal Jelly (Produk).jpg', NULL, 'sholeh', NULL, 'sholeh'),
(62, 2, 'Sari Kurma Ginseng Salsabil', 'sari-kurma-ginseng-salsabil', 'Sari Kurma Ginseng Salsabil adalah minuman kesehatan terbuat dari kurma berkualitas impor yang dipadu dengan ginseng dan diproses secara higienis sehingga mempunyai rasa yang enak, lezat, dan berkhasiat bagi kesehatan.', '<p style=\"text-align:justify\">Sari Kurma Ginseng Salsabil adalah minuman kesehatan terbuat dari kurma berkualitas impor yang dipadu dengan ginseng dan diproses secara higienis sehingga mempunyai rasa yang enak, lezat, dan berkhasiat bagi kesehatan.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi Sari Kurma Ginseng Salsabil secara teratur sesuai dosis yang dianjurkan,dapat memberikan manfaat antara lain:</p>\r\n\r\n<p style=\"text-align:justify\">Membantu meningkatkan stamina, menurunkan keletihan, memperbaiki kecepatan reaksi dan refleks. Membantu meningkatkan daya tahan tubuh dan membantu melawan infeksi, membantu meningkatkan trombosit dan hemoglobin (Hb) pada pasie DBD, serta membantu mengatasi anemia. Membantu melindungi kesehatan hati dan jantung, menyeimbangkan kadar kolesterol dalam darah, serta membantu meningkatkan memori dan kecerdasan otak. Membantu meningkatkan vitalitas dan kesehatan secara menyeluruh. Membantu meningkatkan nutrisi untuk tumbuh kembang anak dan kesehatan orang tua. Sebagai antioksidan yang dapat membantu mengatasi radang tenggorokan, melancarkan saluran pencernaan, dan melancarkan buang air kecil.</p>\r\n\r\n<p style=\"text-align:justify\">Sifat dan Khasiat Herbal Komposisi Sari Kurma Ginseng Salsabil antara lain:</p>\r\n\r\n<p><strong>Sari Kurma</strong></p>\r\n\r\n<p style=\"text-align:justify\">Kurma matang mengandung gula sekitar 80%, sisanya terdiri dari tanin, protein, lemak dan produk mineral termasuk tembaga, besi, magnesium dan asam folat. Secara sinergis kandungan zat dalam kurma tersebut dapat memberikan efek farmakologis mempercepat pengembalian stamina saat keletihan dan mempercepat pemulihan tubuh dari sakit. Kandungan serat dan kalium dalam kurma dapat membantu melancarkan BAB, memperbaiki sistem pencernaan, membantu mencegah penumpukan kolesterol jahat dalam tubuh, dan membantu mengendalikan denyut jantung dan tekanan darah agar tetap normal.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nKandungan tanin dalam kurma bersifat antiinfeksi (membantu tubuh melawan bakteri dan virus), antiinflamasi (mencegah peradangan) dan antihemoragik (mencegah pecahnya pembuluh darah), sehingga dapat membantu agar terhindar dari stroke. Kandungan zat besi dalam kurma dapat membantu meningkatkan hemoglobin dan membantu kelancaran aliran oksigen dalam darah. Kandungan vitamin A dalam kurma dapat membantu menjaga kesehatan kulit, serta dapat melindungi tubuh dari kanker paru-paru dan rongga mulut.</p>\r\n\r\n<p><strong>Ginseng</strong></p>\r\n\r\n<p style=\"text-align:justify\">Kandungan senyawa utama ginseng adalah ginsenosides yang merupakan senyawa kompleks dari sekitar 25 zat aktif individual. Secara sinergis berbagai senyawa itu berefek farmakologis antara lain:</p>\r\n\r\n<p style=\"text-align:justify\">Sebagai peningkat stamina dan membantu pembentukan dan pelepasan hormon-hormon dalam tubuh. Bersifat antidepresi, oleh karena itu ginseng dapat membantu melawan stres dan depresi ringan Bersifat adaptogen, karena dapat meningkatkan daya adaptasi tubuh terhadap faktor stres mental dan fisik, menjaga konsentrasi mental, dan membantu mencegah serta mengatasi aterosklerosis (pengapuran dinding pembuluh darah) dan berbagai penyakit peredaran darah lainnya.</p>', 129000, 'photos/sari_kurma_ginseng_salsabil.jpg', NULL, 'sholeh', NULL, 'nurhidayat'),
(63, 2, 'Kecap Zaitun Sari Manis', 'kecap-zaitun-sari-manis', '<p style=\"text-align:justify\">Kecap Zaitun adalah kecap kriteria MUTU I sesuai Standar Industri Indonesia (SII), dengan bahan baku kedelai hitam lokal terbaik, menggunakan pemanis gula kelapa melalui proses fermentasi alami yang menjaga higienitas, serta menggunakan berbagai tumbuhan segar sebagai bahan penyedapnya. Lebih kaya protein dan bahan baku bebas rekayasa genetika yang berbahaya bagi kesehatan.</p>', '<p style=\"text-align:justify\">Kecap Zaitun adalah kecap kriteria MUTU I sesuai Standar Industri Indonesia (SII), dengan bahan baku kedelai hitam lokal terbaik, menggunakan pemanis gula kelapa melalui proses fermentasi alami yang menjaga higienitas, serta menggunakan berbagai tumbuhan segar sebagai bahan penyedapnya. Lebih kaya protein dan bahan baku bebas rekayasa genetika yang berbahaya bagi kesehatan.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nKelebihan lain yang dikandung Kecap Zaitun yang tidak tampak langsung dalam adalah yang berkaitan dengan pemilihan bahan baku, proses pembuatan kecap, dan kandungan nutrisi kecap. Kelebihan Kecap Zaitun adalah sebagai berikut :<br />\r\na. Kadar Protein Dua Kali Lebih Banyak.<br />\r\nHasil analisa laboratorium independen, kecap ini memiliki kandungan protein sekitar 6% sedangkan kecap lain hanya memiliki kandungan protein sekitar 3%.<br />\r\nb. Diproses Secara Alami Bukan Kimiawi.<br />\r\nAroma Kecap Zaitun yang khas dihasilkan dari proses produksi dengan proses fermentasi alami kedelai yang membutuhkan waktu hingga beberapa bulan. Sedangkan kecap lain menggunakan proses Hidrolisis Kimia yang instan.<br />\r\nc. Menggunakan Kedelai Hitam Non GMO (Genetical Manufactured Organism)<br />\r\nKecap Zaitun hanya menggunakan kedelai lokal dan bukan kedelai impor yang masih diragukan keamanannya. Kedelai impor pada umumnya sudah mengalami proses rekayasa genetika, yang kedelai tersebut ditujukan untuk dapat diproduksi secara masal dan biaya produksi yang rendah. Organisme hasil rekayasa genetika dengan susunan genetika yang berubah akan menimbulkan sampah organisme yang membingungkan alam dalam siklus penguraian dan pembusukan organisme. Termasuk saat proses penyerapan dan metabolisme nutrisi dalam tubuh.<br />\r\nd. Penyedap dari Tumbuhan Segar.<br />\r\nBumbu penyedap yang digunakan berasal dari rempah-rempah segar, alami dan bukan menggunakan penyedap kimia yang bisa menyebabkan alergi.</p>', 25000, 'photos/1_Kecap Zaitun Sari Manis.jpg', NULL, 'sholeh', NULL, NULL),
(64, 2, 'Kecap Zaitun Manis Sedang', 'kecap-zaitun-manis-sedang', '<p style=\"text-align:justify\">Kecap Zaitun adalah kecap kriteria MUTU I sesuai Standar Industri Indonesia (SII), dengan bahan baku kedelai hitam lokal terbaik, menggunakan pemanis gula kelapa melalui proses fermentasi alami yang menjaga higienitas, serta menggunakan berbagai tumbuhan segar sebagai bahan penyedapnya. Lebih kaya protein dan bahan baku bebas rekayasa genetika yang berbahaya bagi kesehatan.</p>', '<p style=\"text-align:justify\">Kecap Zaitun adalah kecap kriteria MUTU I sesuai Standar Industri Indonesia (SII), dengan bahan baku kedelai hitam lokal terbaik, menggunakan pemanis gula kelapa melalui proses fermentasi alami yang menjaga higienitas, serta menggunakan berbagai tumbuhan segar sebagai bahan penyedapnya. Lebih kaya protein dan bahan baku bebas rekayasa genetika yang berbahaya bagi kesehatan.<br />\r\nKelebihan lain yang dikandung Kecap Zaitun yang tidak tampak langsung dalam adalah yang berkaitan dengan pemilihan bahan baku, proses pembuatan kecap, dan kandungan nutrisi kecap. Kelebihan Kecap Zaitun adalah sebagai berikut :<br />\r\na. Kadar Protein Dua Kali Lebih Banyak.<br />\r\nHasil analisa laboratorium independen, kecap ini memiliki kandungan protein sekitar 6% sedangkan kecap lain hanya memiliki kandungan protein sekitar 3%.<br />\r\nb. Diproses Secara Alami Bukan Kimiawi.<br />\r\nAroma Kecap Zaitun yang khas dihasilkan dari proses produksi dengan proses fermentasi alami kedelai yang membutuhkan waktu hingga beberapa bulan. Sedangkan kecap lain menggunakan proses Hidrolisis Kimia yang instan.<br />\r\nc. Menggunakan Kedelai Hitam Non GMO (Genetical Manufactured Organism)<br />\r\nKecap Zaitun hanya menggunakan kedelai lokal dan bukan kedelai impor yang masih diragukan keamanannya. Kedelai impor pada umumnya sudah mengalami proses rekayasa genetika, yang kedelai tersebut ditujukan untuk dapat diproduksi secara masal dan biaya produksi yang rendah. Organisme hasil rekayasa genetika dengan susunan genetika yang berubah akan menimbulkan sampah organisme yang membingungkan alam dalam siklus penguraian dan pembusukan organisme. Termasuk saat proses penyerapan dan metabolisme nutrisi dalam tubuh.<br />\r\nd. Penyedap dari Tumbuhan Segar.<br />\r\nBumbu penyedap yang digunakan berasal dari rempah-rempah segar, alami dan bukan menggunakan penyedap kimia yang bisa menyebabkan alergi.</p>', 25000, 'photos/1_Kecap Zaitun Manis Sedang.jpg', NULL, 'sholeh', NULL, NULL),
(65, 2, 'H&T Food Sari Alang-alang', 'ht-food-sari-alang-alang', '<p style=\"text-align:justify\">H&amp;T FOOD SARI ALANG-ALANG &ldquo;MITRA&rdquo; adalah minuman kesehatan tradisional yang terbuat dari herbal alami berupa rimpang/akar alang-alang (Imperata spec div), batang secang (Caesalpinia sappan), dan batang ketan hitam (Oriza sativa lim) serta menggunakan gula murni sebagai pemanis sekaligus pengawetnya.</p>', '<p style=\"text-align:justify\"><strong>H&amp;T FOOD SARI ALANG-ALANG &ldquo;MITRA&rdquo;</strong> adalah minuman kesehatan tradisional yang terbuat dari herbal alami berupa rimpang/akar alang-alang (Imperata spec div), batang secang (Caesalpinia sappan), dan batang ketan hitam (Oriza sativa lim) serta menggunakan gula murni sebagai pemanis sekaligus pengawetnya.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>H&amp;T FOOD SARI ALANG-ALANG &ldquo;MITRA&rdquo;</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Membantu menurunkan panas dan demam, meredakan bengkak akibat peradangan, menyembuhkan infeksi, meredakan batuk, mengobati tekanan darah tinggi, sakit kuning (hepatitis), menghentikan pendarahan, sesak napas/asma.</li>\r\n	<li style=\"text-align:justify\">Membantu mencegah dan mengatasi penyakit yang disebabkan oleh radikal bebas seperti batuk darah, batuk rejan, asma, radang tenggorokan, radang paru-paru, jantung koroner, campak, dan sebagainya.</li>\r\n	<li style=\"text-align:justify\">Membantu meluruhkan air seni sehingga dapat mempercepat penyembuhan infeksi ginjal, batu ginjal, batu empedu, kencing batu, kencing darah, buang air kecil tidak lancar atau buang air kecil terus-menerus.</li>\r\n	<li style=\"text-align:justify\">Membantu mengobati penyakit pencernaan seperti diare, disentri, dan maag</li>\r\n	<li style=\"text-align:justify\">Membantu menghentikan pendarahan pada mimisan atau pendarahan pada wanita sehabis melahirkan.&nbsp;</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><strong>Sifat dan Khasiat Herbal Komposisi H&amp;T FOOD SARI ALANG-ALANG &ldquo;MITRA&rdquo; &nbsp;antara lain:</strong></p>\r\n\r\n<p><strong>Ekstrak Akar Alang-Alang (Imperata Spec Div)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Akar alang-alang mengandung senyawa aktif antara lain mannitol, glukosa, asam malic, asam sitrat, coixol, arundoin, silindrin, fernerol, simiarenol, anemonin, esin, alkali, saponin, tanin, dan polifenol. Senyawa aktif ini secara sinergis dapat memberikan efek farmakologis sebagai antipiretik (penurun panas), diuretik (peluruh air seni), hemostatik (menghentikan pendarahan), penghilang haus, dan pendingin. &nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Ekstrak Secang (Caesalpinia Sappan L)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Daun dan batang secang mengandung senyawa aktif antara lain saponin, flavonoid, polifenol, minyak atsiri, tanin, asam galat, resin, resorsin, brasilin, brasilein, d-alfa-phellandrene, dan oscimene. Berbagai senyawa aktif ini dapat memberikan efek farmakologis antara lain sebagai penghenti pendarahan, pembersih darah, pengelat, penawar racun, dan antiseptik, sehingga secara umum secang dapat digunakan untuk membantu pengobatan diare, disentri, batuk darah pada TBC, muntah darah, sifilis, malaria, tetanus, pembengkakan (tumor), dan nyeri karena gangguan sirkulasi darah.</li>\r\n</ul>\r\n\r\n<p><strong>Ekstrak Ketan Hitam (Oriza sativa lim)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Di dalam ketan hitam terkandung zat besi sebesar 15,52 ppm yang sangat dibutuhkan untuk membantu pembentukan sel darah merah dan meningkatkan daya tahan tubuh dan menangkal zat alerger (pencetus alergi)</li>\r\n	<li style=\"text-align:justify\">Di dalam ketan hitam juga terdapat zat antioksidan bernama antosianin yang berperan dalam melindungi lambung dari kerusakan, menghambat sel tumor, meningkatkan kesehatan mata, melindungi kerusakan sel tubuh akibat oksidasi zat berbahaya, membantu melindungi sistem kardiovaskular, serta membantu tubuh melawan penyakit kanker dan jantung.</li>\r\n</ul>', 25000, 'photos/1_Alang-ALANG.jpg', NULL, 'sholeh', NULL, 'sholeh'),
(66, 2, 'H&T Food Sari Temulawak', 'ht-food-sari-temulawak', '<p style=\"text-align:justify\">H&amp;T FOOD SARI TEMULAWAK &ldquo;MITRA&rdquo; adalah kapsul herbal yang dibuat dari ekstrak temulawak (Curcumae xanthorizae rizhoma) terbaik dengan pengolahan standar tinggi, mengutamakan kualitas dan higienitas, sehingga sangat membantu untuk menjaga kesehatan, menambah nafsu makan, menurunkan kolesterol jahat, mengatasi maag, demam, radang sendi, serta membantu menjaga kesehatan hati.</p>', '<p style=\"text-align:justify\"><strong>H&amp;T FOOD SARI TEMULAWAK adalah Minuman kesehatan tradisional yang terdiri dari ekstrak temu lawak (Curcumae xanthorizae rizhoma) dan ekstak daun pandan (Pandamus Amaryllifolius) serta gula murni sebagai pemanis sekaligus pengawetnya ini sangat berkhasiat untuk membantu menambah nafsu makan, menurunkan kolesterol, anti-hepatitis, pereda demam, dan meningkatkan daya tahan tubuh.</strong></p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>H&amp;T FOOD SARI TEMULAWAK &ldquo;MITRA&rdquo;</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Membantu meningkatkan nafsu makan</li>\r\n	<li>Membantu meredakan gejala maag</li>\r\n	<li>Membantu mengatasi radang pada persendian</li>\r\n	<li>Membantu melindungi hati</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><strong>Sifat dan Khasiat Ekstrak Temulawak Komposisi H&amp;T FOOD SARI TEMULAWAK &ldquo;MITRA&rdquo; antara lain:</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Ekstrak temulawak mengandung senyawa aktif kurkuminoid yang bersifat sebagai antibakteria, antiradang, dan antioksidan yang dapat membantu melancarkan metabolisme tubuh, sehingga sangat membantu meningkatkan daya tahan tubuh dalam menangkal berbagai penyakit.</li>\r\n	<li style=\"text-align:justify\">Kurkumin dalam ekstrak temulawak juga bersifat sebagai hepatoprotektor (pencegah pelemakan hati), dan hipokolesterolemik (penurun kadar kolesterol), sehingga sangat membantu mencegah dan mengatasi penyakit radang pada hati, radang sendi dengan cara menghambat migrasi sel-sel leukosit ke area radang, serta mencegah penggumpalan darah yang memicu hipertensi.&nbsp;</li>\r\n	<li style=\"text-align:justify\">Ekstrak temulawak mengandung minyak atsiri yang bersifat sebagai analgetik (penghilang rasa sakit), antipiretik (penurun demam), dan mampu meningkatkan produksi getah empedu serta mampu menekan pembengkakan.</li>\r\n	<li style=\"text-align:justify\">Ekstrak temulawak juga mengandung senyawa desmetoksikurkumin yang secara umum bermanfaat untuk menetralkan racun sehingga sangat membantu mempercepat penyembuhan penyakit.</li>\r\n	<li style=\"text-align:justify\">Kandungan minyak atsiri dan kurkuminoid dalam ekstrak temulawak dapat memberikan efek karminativum (merangsang pengeluaran gas berlebih dalam lambung), sehingga dapat mengatasi kembung dan meningkatkan nafsu makan. &nbsp;</li>\r\n	<li style=\"text-align:justify\">Kurkuminoid dalam ekstrak temulawak juga berperan untuk menetralkan asam lambung sebagai penyebab utama penyakit maag, sehingga efektif mengatasi penyakit maag.</li>\r\n</ul>', 25000, 'photos/1_lawak.jpg', NULL, 'sholeh', NULL, 'sholeh'),
(67, 2, 'H&T Food Sari Temumangga', 'ht-food-sari-temumangga', '<p style=\"text-align:justify\">H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo; adalah minuman kesehatan tradisional yang terbuat dari herbal alami berupa ekstrak temumangga (Curcuma mango) dengan aroma khas seperti mangga, ditambah dengan ekstrak daun pandan dan gula murni sebagai pemanis sekaligus pengawetnya.</p>', '<p style=\"text-align:justify\"><strong>H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo;</strong> adalah minuman kesehatan tradisional yang terbuat dari herbal alami berupa ekstrak temumangga (Curcuma mango) dengan aroma khas seperti mangga, ditambah dengan ekstrak daun pandan dan gula murni sebagai pemanis sekaligus pengawetnya.</p>\r\n\r\n<p style=\"text-align:justify\">Keunggulan <strong>H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo;</strong> antara lain:</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Terbuat dari bahan-bahan herbal yang aman, tanpa pengawet dan perasa buatan, serta terbukti berkhasiat untuk kesehatan</li>\r\n	<li style=\"text-align:justify\">Pemanisnya dari gula asli (bukan pemanis buatan) sehingga relatif lebih aman dari risiko diabetes</li>\r\n	<li style=\"text-align:justify\">Komposisi dalam kemasan sachet sudah sesuai dosis dan takaran kebutuhan, dengan kemasan sachet lebih tebal, kuat, serta tidak tembus cahaya sehingga relatif aman dari kontaminasi bahan berbahaya</li>\r\n	<li style=\"text-align:justify\">Rasanya enak dan lebih mudah disenangi konsumen berbagai usia termasuk anak-anak</li>\r\n	<li style=\"text-align:justify\">Dapat membantu memenuhi kebutuhan air bagi tubuh, dan dapat diminum dalam kondisi panas atau dingin sesuai selera, tanpa mengurangi khasiatnya</li>\r\n	<li style=\"text-align:justify\">Dapat diminum setiap saat baik sebelum maupun sesudah makan</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo; secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Membantu meningkatkan daya tahan tubuh, menangkal radikal bebas, dan menetralisasi racun dalam tubuh, sehingga baik digunakan untuk mengatasi bronkitis, radang tenggorokan, asma, radang saluran napas, dan masuk angin</li>\r\n	<li style=\"text-align:justify\">Membantu menurunkan panas dalam dan demam</li>\r\n	<li style=\"text-align:justify\">Membantu menambah nafsu makan, melancarkan BAB, mengurangi kegelisahan, mengurangi nyeri haid, pegal linu, dan nyeri akibat rematik</li>\r\n	<li style=\"text-align:justify\">Membantu membersihkan darah nifas dan membantu memperbaiki rahim sehabis melahirkan&nbsp;</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><strong>Sifat dan Khasiat Herbal Komposisi H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo; antara lain:</strong></p>\r\n\r\n<p><strong>Temumangga (Curcuma Mango)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Ekstrak temumangga mengandung senyawa aktif seperti tanin, kurkumin, amilum, gula, minyak atsiri, damar, saponin, flavonoid, dan protein toksis. Berbagai senyawa ini secara sinergis memiliki efek farmakologis sebagai penurun panas (antipiretik), penangkal racun (antitoksik), pencahar (laksatif), peluruh (diuretik), dan penangkal radikal bebas (antioksidan).</li>\r\n	<li style=\"text-align:justify\">Dalam kurkumin pada ekstrak temumangga terdapat Ribosome Inacting Protein (RIP) yang dapat membantu menonaktifkan pertumbuhan sel kanker, meluruhkan sel kanker tanpa merusak jaringan di sekitarnya, dan memblokir pertumbuhan sel kanker, kemudian melumpuhkannya.</li>\r\n	<li style=\"text-align:justify\">Kandungan tanin dan flavonoid dalam ekstrak temumangga berkhasiat sebagai antioksidan sehingga dapat membantu mencegah sekaligus mengobati bronkitis, asma, radang saluran napas, masuk angin, diare, dan menangkal racun.</li>\r\n	<li style=\"text-align:justify\">Sifat diuretik temumangga membuatnya dapat digunakan untuk membantu membersihkan darah haid dan nifas sehabis melahirkan.</li>\r\n</ul>\r\n\r\n<p><strong>Ekstrak Daun Pandan (Pandanus Amaryllifolius Roxb)</strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Kandungan senyawa aktif daun pandan antara lain alkaloid, saponin, flavonoid, tanin, polifenol, dan zat warna yang secara sinergis memberikan efek farmakologis sebagai tonikum (peningkat daya tahan tubuh), antioksidan (penangkal radikal bebas), penambah nafsu makan, dan penenang.</li>\r\n</ul>', 25000, 'photos/1_mangga.jpg', NULL, 'sholeh', NULL, 'sholeh'),
(68, 2, 'H&T Food Lacafe Latte', 'ht-food-lacafe-latte', '<p style=\"text-align:justify\">H&amp;T FOOD LACAFE LATTE dan MATCHA, adalah minuman sari Habbatussauda yang dipadu dengan beragam komposisi bahan yang berkhasiat serta dapat dikonsumsi dengan nikmat. Komposisi bahan pokok minuman ini adalah :</p>', '<p style=\"text-align:justify\"><strong>H&amp;T FOOD LACAFE LATTE dan MATCHA,</strong> adalah minuman sari Habbatussauda yang dipadu dengan beragam komposisi bahan yang berkhasiat serta dapat dikonsumsi dengan nikmat. Komposisi bahan pokok minuman ini adalah :</p>\r\n\r\n<ol>\r\n	<li>Habbatussauda</li>\r\n	<li>Madu</li>\r\n	<li>Biji Wijen</li>\r\n	<li>Creamer Nabati</li>\r\n	<li>Gula Aren</li>\r\n	<li>Ekstrak Matcha (untuk varian Matcha)</li>\r\n</ol>\r\n\r\n<p><strong>Dengan lima (5) komponen pokok inilah kami menyebutnya H&amp;T FOOD LACAFE.</strong></p>\r\n\r\n<p>Keunggulan masing-masing komponen di antaranya:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Habbatussauda, merupakan immunomodulator yang mampu meningkatkan daya imunitas tubuh sehingga tidak mudah sakit. Dengan minum satu kemasan sachet, nilainya setara dengan minum kurang lebih tiga kapsul habbatussauda serbuk.</li>\r\n	<li style=\"text-align:justify\">Madu, kaya fruktosa sebagaimana kurma. Aman dan berkhasiat buat penderita sakit lambung atau maag. Sehingga minuman ini sangat baik dikonsumsi oleh penderita maag ataupun yang punya gangguan pencernaan</li>\r\n	<li style=\"text-align:justify\">Biji Wijen, kaya akan kandungan seng yang bermanfaat untuk pembentukan kolagen yang berfungsi memperkuat jaringan otot, rambut, dan kulit. Biji wijen juga mengandung jumlah protein yang tinggi yang dapat menambah kekuatan tubuh secara keseluruhan, pertumbuhan sel sehat, mobilitas, tingkat energi dan fungsi metabolisme tubuh.</li>\r\n	<li style=\"text-align:justify\">Creamer Nabati, sehat dan nikmat dikonsumsi tanpa takut nilai kolesterol dalam darah naik. Memberikan rasa gurih yang khas pada minuman.</li>\r\n	<li style=\"text-align:justify\">Gula Aren, memiliki indeks glikemik yang lebih rendah dibandingkan dengan gula pasir, sehingga relatif aman dikonsumsi.</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\">H&amp;T FOOD LACAFE tersedia dalam 2 varian, yakni Latte dan Matcha. Menjadikan H&amp;T Food Lacafe makin nikmat dinikmati.</p>', 43000, 'photos/latte.jpg', NULL, 'sholeh', NULL, 'nurhidayat'),
(69, 2, 'H&T Food Lacafe Matcha', 'ht-food-lacafe-matcha', '<p style=\"text-align:justify\">H&amp;T FOOD LACAFE LATTE dan MATCHA, adalah minuman sari Habbatussauda yang dipadu dengan beragam komposisi bahan yang berkhasiat serta dapat dikonsumsi dengan nikmat. Komposisi bahan pokok minuman ini adalah :</p>', '<p style=\"text-align:justify\"><strong>H&amp;T FOOD LACAFE LATTE dan MATCHA</strong>, adalah minuman sari Habbatussauda yang dipadu dengan beragam komposisi bahan yang berkhasiat serta dapat dikonsumsi dengan nikmat. Komposisi bahan pokok minuman ini adalah :</p>\r\n\r\n<ol>\r\n	<li>Habbatussauda</li>\r\n	<li>Madu</li>\r\n	<li>Biji Wijen</li>\r\n	<li>Creamer Nabati</li>\r\n	<li>Gula Aren</li>\r\n	<li>Ekstrak Matcha (untuk varian Matcha)</li>\r\n</ol>\r\n\r\n<p>Dengan lima (5) komponen pokok inilah kami menyebutnya H&amp;T FOOD LACAFE.</p>\r\n\r\n<p>Keunggulan masing-masing komponen di antaranya:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Habbatussauda, merupakan immunomodulator yang mampu meningkatkan daya imunitas tubuh sehingga tidak mudah sakit. Dengan minum satu kemasan sachet, nilainya setara dengan minum kurang lebih tiga kapsul habbatussauda serbuk.</li>\r\n	<li style=\"text-align:justify\">Madu, kaya fruktosa sebagaimana kurma. Aman dan berkhasiat buat penderita sakit lambung atau maag. Sehingga minuman ini sangat baik dikonsumsi oleh penderita maag ataupun yang punya gangguan pencernaan</li>\r\n	<li style=\"text-align:justify\">Biji Wijen, kaya akan kandungan seng yang bermanfaat untuk pembentukan kolagen yang berfungsi memperkuat jaringan otot, rambut, dan kulit. Biji wijen juga mengandung jumlah protein yang tinggi yang dapat menambah kekuatan tubuh secara keseluruhan, pertumbuhan sel sehat, mobilitas, tingkat energi dan fungsi metabolisme tubuh.</li>\r\n	<li style=\"text-align:justify\">Creamer Nabati, sehat dan nikmat dikonsumsi tanpa takut nilai kolesterol dalam darah naik. Memberikan rasa gurih yang khas pada minuman.</li>\r\n	<li style=\"text-align:justify\">Gula Aren, memiliki indeks glikemik yang lebih rendah dibandingkan dengan gula pasir, sehingga relatif aman dikonsumsi.</li>\r\n</ol>\r\n\r\n<p>H&amp;T FOOD LACAFE tersedia dalam 2 varian, yakni Latte dan Matcha. Menjadikan H&amp;T Food Lacafe makin nikmat dinikmati.</p>', 47000, 'photos/matcha.jpg', NULL, 'sholeh', NULL, 'sholeh'),
(70, 2, 'Salsabil Madu Multiflora 19', 'salsabil-madu-multiflora-19', '<p style=\"text-align:justify\">Madu Multiflora merupakan Madu kombinasi dari beberapa nektar bunga (Nektar adalah cairan manis yang terdapat pada bunga yang biasa dihisap/diserap lebah, merupakan bahan utama madu) yang dihasilkan oleh lebah ternak unggul (apis melifera).</p>', '<p style=\"text-align:justify\">Madu Multiflora merupakan Madu kombinasi dari beberapa nektar bunga (Nektar adalah cairan manis yang terdapat pada bunga yang biasa dihisap/diserap lebah, merupakan bahan utama madu) yang dihasilkan oleh lebah ternak unggul (apis melifera).</p>\r\n\r\n<p style=\"text-align:justify\">Perpaduan madu dari beberapa nektar ini menghasilkan madu dengan kualitas baik dengan cita rasa yang khas yang bermanfaat untuk menjaga stamina dan kebugaran tubuh.<br />\r\nMadu Multiflora memiliki kadar air yang rendah yaitu 19%, sehingga madu lebih kental dengan kualitas yang lebih tinggi. Sementara SNI menetapkan kadar air madu maksimal 22%. Dengan kadar air 19%, maka aman untuk disimpan dalam waktu yang lama.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Kandungan Madu.</strong><br />\r\nMadu adalah makanan yang mengandung aneka zat gizi seperti karbohidrat, protein, asam amino, vitamin, mineral, dekstrin, pigmen tumbuhan, dan komponen aromatik. Bahkan dari hasil penelitian ahli gizi dan pangan, madu mengandung karbohidrat yang paling tinggi di antara produk ternak lainnya; susu, telur, daging, keju, dan mentega. Yaitu sekitar 82,3% lebih tinggi. Setiap 100 gram madu murni bernilai 294 kalori. Dengan kata lain, tiap 1000 gram madu murni setara dengan 50 butir telur ayam atau 5,675 liter susu atau 1680 gram daging. Dari hasil penelitian terbaru didapat bahwa zat-zat atau senyawa yang ada di dalam madu sangatlah kompleks, yaitu mencapai 181 jenis.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nMadu memiliki komponen kimia yang memiliki efek koligemik yakni asetilkolin. Asetikolin yang terkandung dalam madu berfungsi untuk melancarkan peredaran darah dan mengurangi tekanan darah. Gula yang terdapat dalam madu akan terserap langsung oleh darah sehingga menghasilkan energi lebih cepat bila dibandingkan dengan gula biasa. Antioksi dan fenolat dalam madu memiliki daya aktif tinggi serta bisa meningkatkan perlawanan tubuh terhadap tekanan oksidasi (oksidative stress). Madu juga mengandung tepung sari dan berbagai enzim pencernaan, vitamin A, B1, B2, dan mineral seperti kalsium, natrium, kalium, magnesium, besi, juga garam iodine bahkan radium. Selain itu madu juga mengandung antibiotik dan berbagai azam organik seperti malat, tartarat, sitrat, laktat, dan oksalat yang sang bermanfaat bagi kesehatan.<br />\r\n&nbsp;<br />\r\n<strong>Manfaat Madu</strong><br />\r\nKalangan ahli gizi menyatakan madu adalah minuman terbaik di dunia, dan secara empiris telah terbukti membantu penyembuhan berbagai macam penyakit baik pada bayi, anak-anak maupun orang dewasa. Disamping memiliki gizi yang tinggi, madu lebah sangat berpotensi untuk pengobatan. Berdasarkan uji empiris (pengalaman dari pengkonsumsi madu) Madu Multiflora memiliki khasiat sbb:<br />\r\n&bull; &nbsp; &nbsp;Membantu meningkatkan imunitas tubuh<br />\r\n&bull; &nbsp; &nbsp;Membantu mengembalikan stamina tubuh lebih cepat<br />\r\n&bull; &nbsp; &nbsp;Membantu mengatasi hipertensi<br />\r\n&bull; &nbsp; &nbsp;Menstimulus kecerdasan otak<br />\r\n&bull; &nbsp; &nbsp;Membantu mengatasi nyeri dan radang akibat rematik<br />\r\n&bull; &nbsp; &nbsp;Membantu mengatasi susah tidur<br />\r\n&bull; &nbsp; &nbsp;Membantu meningkatkan nafsu makan<br />\r\n&bull; &nbsp; &nbsp;Membantu mengatasi anemia<br />\r\n&bull; &nbsp; &nbsp;Membantu mengatasi berbagai gangguan pencernaan</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Saran Pemakaian</strong><br />\r\nUntuk mendapatkan khasiat yang lebih baik, konsumsilah &ldquo;SALSABIL&rdquo; Madu Multiflora 19 sesuai aturan yang direkomendasikan.</p>\r\n\r\n<p><strong>Dewasa:</strong><br />\r\n&bull; &nbsp; &nbsp;2 sendok makan setiap pagi, siang, dan malam</p>\r\n\r\n<p><strong>Anak-anak:</strong><br />\r\n&bull; &nbsp; &nbsp;&frac12; sendok makan setiap pagi, siang, dan malam</p>\r\n\r\n<p><strong>Saran Tambahan</strong><br />\r\n&bull; &nbsp; &nbsp;Sebaiknya SALSABIL&rdquo; Madu Multiflora 19 tidak disimpan di dalam lemari es<br />\r\n&bull; &nbsp; &nbsp;Hindari mencampurkan &nbsp;SALSABIL&rdquo; Madu Multiflora 19 dengan air panas</p>', 90000, 'photos/salsabil_multiflora.jpg', NULL, 'sholeh', NULL, NULL);
INSERT INTO `default_produk` (`id`, `bisnis_id`, `nama_brg`, `slug`, `keterangan_singkat`, `keterangan`, `harga`, `foto`, `tgl_input`, `petugas_input`, `tgl_update`, `petugas_update`) VALUES
(71, 2, 'H&T Food Sari Alang-alang (banded 3)', 'ht-food-sari-alang-alang-banded-3', '<p style=\"text-align:justify\">H&amp;T FOOD SARI ALANG-ALANG &ldquo;MITRA&rdquo; adalah minuman kesehatan tradisional yang terbuat dari herbal alami berupa rimpang/akar alang-alang (Imperata spec div), batang secang (Caesalpinia sappan), dan batang ketan hitam (Oriza sativa lim) serta menggunakan gula murni sebagai pemanis sekaligus pengawetnya.</p>', '<p style=\"text-align:justify\"><strong>H&amp;T FOOD SARI ALANG-ALANG &ldquo;MITRA&rdquo;</strong> adalah minuman kesehatan tradisional yang terbuat dari herbal alami berupa rimpang/akar alang-alang (Imperata spec div), batang secang (Caesalpinia sappan), dan batang ketan hitam (Oriza sativa lim) serta menggunakan gula murni sebagai pemanis sekaligus pengawetnya.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>H&amp;T FOOD SARI ALANG-ALANG &ldquo;MITRA&rdquo;</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Membantu menurunkan panas dan demam, meredakan bengkak akibat peradangan, menyembuhkan infeksi, meredakan batuk, mengobati tekanan darah tinggi, sakit kuning (hepatitis), menghentikan pendarahan, sesak napas/asma.</li>\r\n	<li style=\"text-align:justify\">Membantu mencegah dan mengatasi penyakit yang disebabkan oleh radikal bebas seperti batuk darah, batuk rejan, asma, radang tenggorokan, radang paru-paru, jantung koroner, campak, dan sebagainya.</li>\r\n	<li style=\"text-align:justify\">Membantu meluruhkan air seni sehingga dapat mempercepat penyembuhan infeksi ginjal, batu ginjal, batu empedu, kencing batu, kencing darah, buang air kecil tidak lancar atau buang air kecil terus-menerus.</li>\r\n	<li style=\"text-align:justify\">Membantu mengobati penyakit pencernaan seperti diare, disentri, dan maag</li>\r\n	<li style=\"text-align:justify\">Membantu menghentikan pendarahan pada mimisan atau pendarahan pada wanita sehabis melahirkan.&nbsp;</li>\r\n</ol>\r\n\r\n<p>Sifat dan Khasiat Herbal Komposisi H&amp;T FOOD SARI ALANG-ALANG &ldquo;MITRA&rdquo; &nbsp;antara lain:</p>\r\n\r\n<ul>\r\n	<li>Ekstrak Akar Alang-Alang (Imperata Spec Div)</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">Akar alang-alang mengandung senyawa aktif antara lain mannitol, glukosa, asam malic, asam sitrat, coixol, arundoin, silindrin, fernerol, simiarenol, anemonin, esin, alkali, saponin, tanin, dan polifenol. Senyawa aktif ini secara sinergis dapat memberikan efek farmakologis sebagai antipiretik (penurun panas), diuretik (peluruh air seni), hemostatik (menghentikan pendarahan), penghilang haus, dan pendingin. &nbsp;</p>\r\n\r\n<ul>\r\n	<li>Ekstrak Secang (Caesalpinia Sappan L)</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">Daun dan batang secang mengandung senyawa aktif antara lain saponin, flavonoid, polifenol, minyak atsiri, tanin, asam galat, resin, resorsin, brasilin, brasilein, d-alfa-phellandrene, dan oscimene. Berbagai senyawa aktif ini dapat memberikan efek farmakologis antara lain sebagai penghenti pendarahan, pembersih darah, pengelat, penawar racun, dan antiseptik, sehingga secara umum secang dapat digunakan untuk membantu pengobatan diare, disentri, batuk darah pada TBC, muntah darah, sifilis, malaria, tetanus, pembengkakan (tumor), dan nyeri karena gangguan sirkulasi darah.</p>\r\n\r\n<ul>\r\n	<li>Ekstrak Ketan Hitam (Oriza sativa lim)</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">Di dalam ketan hitam terkandung zat besi sebesar 15,52 ppm yang sangat dibutuhkan untuk membantu pembentukan sel darah merah dan meningkatkan daya tahan tubuh dan menangkal zat alerger (pencetus alergi)<br />\r\nDi dalam ketan hitam juga terdapat zat antioksidan bernama antosianin yang berperan dalam melindungi lambung dari kerusakan, menghambat sel tumor, meningkatkan kesehatan mata, melindungi kerusakan sel tubuh akibat oksidasi zat berbahaya, membantu melindungi sistem kardiovaskular, serta membantu tubuh melawan penyakit kanker dan jantung.</p>', 75000, 'photos/3 H&T alang-alang.jpg', NULL, 'sholeh', NULL, 'nurhidayat'),
(72, 2, 'H&T Food Sari Temulawak (banded 3)', 'ht-food-sari-temulawak-banded-3', '<p style=\"text-align:justify\">H&amp;T FOOD SARI TEMULAWAK &ldquo;MITRA&rdquo; adalah kapsul herbal yang dibuat dari ekstrak temulawak (Curcumae xanthorizae rizhoma) terbaik dengan pengolahan standar tinggi, mengutamakan kualitas dan higienitas, sehingga sangat membantu untuk menjaga kesehatan, menambah nafsu makan, menurunkan kolesterol jahat, mengatasi maag, demam, radang sendi, serta membantu menjaga kesehatan hati.</p>', '<p style=\"text-align:justify\"><strong>H&amp;T FOOD SARI TEMULAWAK adalah Minuman kesehatan tradisional yang terdiri dari ekstrak temu lawak (Curcumae xanthorizae rizhoma) dan ekstak daun pandan (Pandamus Amaryllifolius) serta gula murni sebagai pemanis sekaligus pengawetnya ini sangat berkhasiat untuk membantu menambah nafsu makan, menurunkan kolesterol, anti-hepatitis, pereda demam, dan meningkatkan daya tahan tubuh.</strong></p>\r\n\r\n<p style=\"text-align:justify\">Dengan mengkonsumsi <strong>H&amp;T FOOD SARI TEMULAWAK &ldquo;MITRA&rdquo;</strong> secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Membantu meningkatkan nafsu makan</li>\r\n	<li style=\"text-align:justify\">Membantu meredakan gejala maag</li>\r\n	<li style=\"text-align:justify\">Membantu mengatasi radang pada persendian</li>\r\n	<li style=\"text-align:justify\">Membantu melindungi hati</li>\r\n</ol>\r\n\r\n<p>Sifat dan Khasiat Ekstrak Temulawak Komposisi H&amp;T FOOD SARI TEMULAWAK &ldquo;MITRA&rdquo; antara lain:</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Ekstrak temulawak mengandung senyawa aktif kurkuminoid yang bersifat sebagai antibakteria, antiradang, dan antioksidan yang dapat membantu melancarkan metabolisme tubuh, sehingga sangat membantu meningkatkan daya tahan tubuh dalam menangkal berbagai penyakit.</li>\r\n	<li style=\"text-align:justify\">Kurkumin dalam ekstrak temulawak juga bersifat sebagai hepatoprotektor (pencegah pelemakan hati), dan hipokolesterolemik (penurun kadar kolesterol), sehingga sangat membantu mencegah dan mengatasi penyakit radang pada hati, radang sendi dengan cara menghambat migrasi sel-sel leukosit ke area radang, serta mencegah penggumpalan darah yang memicu hipertensi.&nbsp;</li>\r\n	<li style=\"text-align:justify\">Ekstrak temulawak mengandung minyak atsiri yang bersifat sebagai analgetik (penghilang rasa sakit), antipiretik (penurun demam), dan mampu meningkatkan produksi getah empedu serta mampu menekan pembengkakan.</li>\r\n	<li style=\"text-align:justify\">Ekstrak temulawak juga mengandung senyawa desmetoksikurkumin yang secara umum bermanfaat untuk menetralkan racun sehingga sangat membantu mempercepat penyembuhan penyakit.</li>\r\n	<li style=\"text-align:justify\">Kandungan minyak atsiri dan kurkuminoid dalam ekstrak temulawak dapat memberikan efek karminativum (merangsang pengeluaran gas berlebih dalam lambung), sehingga dapat mengatasi kembung dan meningkatkan nafsu makan.</li>\r\n	<li style=\"text-align:justify\">Kurkuminoid dalam ekstrak temulawak juga berperan untuk menetralkan asam lambung sebagai penyebab utama penyakit maag, sehingga efektif mengatasi penyakit maag.</li>\r\n</ul>', 75000, 'photos/3 H&T temu_lawak.jpg', NULL, 'sholeh', NULL, 'sholeh'),
(73, 2, 'H&T Food Sari Temumangga (banded 3)', 'ht-food-sari-temumangga-banded-3', '<p style=\"text-align:justify\">H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo; adalah minuman kesehatan tradisional yang terbuat dari herbal alami berupa ekstrak temumangga (Curcuma mango) dengan aroma khas seperti mangga, ditambah dengan ekstrak daun pandan dan gula murni sebagai pemanis sekaligus pengawetnya.</p>', '<p style=\"text-align:justify\">H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo; adalah minuman kesehatan tradisional yang terbuat dari herbal alami berupa ekstrak temumangga (Curcuma mango) dengan aroma khas seperti mangga, ditambah dengan ekstrak daun pandan dan gula murni sebagai pemanis sekaligus pengawetnya.</p>\r\n\r\n<p>Keunggulan H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo; antara lain:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Terbuat dari bahan-bahan herbal yang aman, tanpa pengawet dan perasa buatan, serta terbukti berkhasiat untuk kesehatan</li>\r\n	<li style=\"text-align:justify\">Pemanisnya dari gula asli (bukan pemanis buatan) sehingga relatif lebih aman dari risiko diabetes</li>\r\n	<li style=\"text-align:justify\">Komposisi dalam kemasan sachet sudah sesuai dosis dan takaran kebutuhan, dengan kemasan sachet lebih tebal, kuat, serta tidak tembus cahaya sehingga relatif aman dari kontaminasi bahan berbahaya</li>\r\n	<li style=\"text-align:justify\">Rasanya enak dan lebih mudah disenangi konsumen berbagai usia termasuk anak-anak</li>\r\n	<li style=\"text-align:justify\">Dapat membantu memenuhi kebutuhan air bagi tubuh, dan dapat diminum dalam kondisi panas atau dingin sesuai selera, tanpa mengurangi khasiatnya</li>\r\n	<li style=\"text-align:justify\">Dapat diminum setiap saat baik sebelum maupun sesudah makan</li>\r\n</ol>\r\n\r\n<p>Dengan mengkonsumsi H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo; secara teratur sesuai dosis yang dianjurkan, dapat memberi manfaat antara lain:</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">Membantu meningkatkan daya tahan tubuh, menangkal radikal bebas, dan menetralisasi racun dalam tubuh, sehingga baik digunakan untuk mengatasi bronkitis, radang tenggorokan, asma, radang saluran napas, dan masuk angin</li>\r\n	<li style=\"text-align:justify\">Membantu menurunkan panas dalam dan demam</li>\r\n	<li style=\"text-align:justify\">Membantu menambah nafsu makan, melancarkan BAB, mengurangi kegelisahan, mengurangi nyeri haid, pegal linu, dan nyeri akibat rematik</li>\r\n	<li style=\"text-align:justify\">Membantu membersihkan darah nifas dan membantu memperbaiki rahim sehabis melahirkan&nbsp;</li>\r\n</ul>\r\n\r\n<p>Sifat dan Khasiat Herbal Komposisi H&amp;T FOOD SARI TEMUMANGGA &ldquo;MITRA&rdquo; antara lain:</p>\r\n\r\n<ul>\r\n	<li>Temumangga (Curcuma Mango)</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">Ekstrak temumangga mengandung senyawa aktif seperti tanin, kurkumin, amilum, gula, minyak atsiri, damar, saponin, flavonoid, dan protein toksis. Berbagai senyawa ini secara sinergis memiliki efek farmakologis sebagai penurun panas (antipiretik), penangkal racun (antitoksik), pencahar (laksatif), peluruh (diuretik), dan penangkal radikal bebas (antioksidan).</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nDalam kurkumin pada ekstrak temumangga terdapat Ribosome Inacting Protein (RIP) yang dapat membantu menonaktifkan pertumbuhan sel kanker, meluruhkan sel kanker tanpa merusak jaringan di sekitarnya, dan memblokir pertumbuhan sel kanker, kemudian melumpuhkannya.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nKandungan tanin dan flavonoid dalam ekstrak temumangga berkhasiat sebagai antioksidan sehingga dapat membantu mencegah sekaligus mengobati bronkitis, asma, radang saluran napas, masuk angin, diare, dan menangkal racun. Sifat diuretik temumangga membuatnya dapat digunakan untuk membantu membersihkan darah haid dan nifas sehabis melahirkan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Ekstrak Daun Pandan (Pandanus Amaryllifolius Roxb)</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">Kandungan senyawa aktif daun pandan antara lain alkaloid, saponin, flavonoid, tanin, polifenol, dan zat warna yang secara sinergis memberikan efek farmakologis sebagai tonikum (peningkat daya tahan tubuh), antioksidan (penangkal radikal bebas), penambah nafsu makan, dan penenang.</p>', 75000, 'photos/3 H&T temu mangga.jpg', NULL, 'sholeh', NULL, 'nurhidayat'),
(74, 2, 'Kecap Zaitun Sari Manis (banded 3)', 'kecap-zaitun-sari-manis-banded-3', '<p style=\"text-align:justify\">Kecap Zaitun adalah kecap kriteria MUTU I sesuai Standar Industri Indonesia (SII), dengan bahan baku kedelai hitam lokal terbaik, menggunakan pemanis gula kelapa melalui proses fermentasi alami yang menjaga higienitas, serta menggunakan berbagai tumbuhan segar sebagai bahan penyedapnya. Lebih kaya protein dan bahan baku bebas rekayasa genetika yang berbahaya bagi kesehatan.</p>', '<p style=\"text-align:justify\">Kecap Zaitun adalah kecap kriteria MUTU I sesuai Standar Industri Indonesia (SII), dengan bahan baku kedelai hitam lokal terbaik, menggunakan pemanis gula kelapa melalui proses fermentasi alami yang menjaga higienitas, serta menggunakan berbagai tumbuhan segar sebagai bahan penyedapnya. Lebih kaya protein dan bahan baku bebas rekayasa genetika yang berbahaya bagi kesehatan.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nKelebihan lain yang dikandung Kecap Zaitun yang tidak tampak langsung dalam adalah yang berkaitan dengan pemilihan bahan baku, proses pembuatan kecap, dan kandungan nutrisi kecap. Kelebihan Kecap Zaitun adalah sebagai berikut :</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\na. Kadar Protein Dua Kali Lebih Banyak.<br />\r\nHasil analisa laboratorium independen, kecap ini memiliki kandungan protein sekitar 6% sedangkan kecap lain hanya memiliki kandungan protein sekitar 3%.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nb. Diproses Secara Alami Bukan Kimiawi.<br />\r\nAroma Kecap Zaitun yang khas dihasilkan dari proses produksi dengan proses fermentasi alami kedelai yang membutuhkan waktu hingga beberapa bulan. Sedangkan kecap lain menggunakan proses Hidrolisis Kimia yang instan.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nc. Menggunakan Kedelai Hitam Non GMO (Genetical Manufactured Organism)<br />\r\nKecap Zaitun hanya menggunakan kedelai lokal dan bukan kedelai impor yang masih diragukan keamanannya. Kedelai impor pada umumnya sudah mengalami proses rekayasa genetika, yang kedelai tersebut ditujukan untuk dapat diproduksi secara masal dan biaya produksi yang rendah. Organisme hasil rekayasa genetika dengan susunan genetika yang berubah akan menimbulkan sampah organisme yang membingungkan alam dalam siklus penguraian dan pembusukan organisme. Termasuk saat proses penyerapan dan metabolisme nutrisi dalam tubuh.</p>\r\n\r\n<p><br />\r\nd. Penyedap dari Tumbuhan Segar.<br />\r\nBumbu penyedap yang digunakan berasal dari rempah-rempah segar, alami dan bukan menggunakan penyedap kimia yang bisa menyebabkan alergi.</p>', 75000, 'photos/3 kecap sari manis.jpeg', NULL, 'sholeh', NULL, 'sholeh'),
(75, 2, 'H&T Food Lacafe Latte (banded 3)', 'ht-food-lacafe-latte-banded-3', '<p style=\"text-align:justify\">H&amp;T FOOD LACAFE LATTE dan MATCHA, adalah minuman sari Habbatussauda yang dipadu dengan beragam komposisi bahan yang berkhasiat serta dapat dikonsumsi dengan nikmat. Komposisi bahan pokok minuman ini adalah :</p>', '<p style=\"text-align:justify\">H&amp;T FOOD LACAFE LATTE dan MATCHA, adalah minuman sari Habbatussauda yang dipadu dengan beragam komposisi bahan yang berkhasiat serta dapat dikonsumsi dengan nikmat. Komposisi bahan pokok minuman ini adalah :</p>\r\n\r\n<ol>\r\n	<li>Habbatussauda</li>\r\n	<li>Madu</li>\r\n	<li>Biji Wijen</li>\r\n	<li>Creamer Nabati</li>\r\n	<li>Gula Aren</li>\r\n	<li>Ekstrak Matcha (untuk varian Matcha)</li>\r\n</ol>\r\n\r\n<p>Dengan lima (5) komponen pokok inilah kami menyebutnya H&amp;T FOOD LACAFE.</p>\r\n\r\n<p>Keunggulan masing-masing komponen di antaranya:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Habbatussauda, merupakan immunomodulator yang mampu meningkatkan daya imunitas tubuh sehingga tidak mudah sakit. Dengan minum satu kemasan sachet, nilainya setara dengan minum kurang lebih tiga kapsul habbatussauda serbuk.</li>\r\n	<li style=\"text-align:justify\">Madu, kaya fruktosa sebagaimana kurma. Aman dan berkhasiat buat penderita sakit lambung atau maag. Sehingga minuman ini sangat baik dikonsumsi oleh penderita maag ataupun yang punya gangguan pencernaan</li>\r\n	<li style=\"text-align:justify\">Biji Wijen, kaya akan kandungan seng yang bermanfaat untuk pembentukan kolagen yang berfungsi memperkuat jaringan otot, rambut, dan kulit. Biji wijen juga mengandung jumlah protein yang tinggi yang dapat menambah kekuatan tubuh secara keseluruhan, pertumbuhan sel sehat, mobilitas, tingkat energi dan fungsi metabolisme tubuh.</li>\r\n	<li style=\"text-align:justify\">Creamer Nabati, sehat dan nikmat dikonsumsi tanpa takut nilai kolesterol dalam darah naik. Memberikan rasa gurih yang khas pada minuman.</li>\r\n	<li style=\"text-align:justify\">Gula Aren, memiliki indeks glikemik yang lebih rendah dibandingkan dengan gula pasir, sehingga relatif aman dikonsumsi.</li>\r\n</ol>\r\n\r\n<p>H&amp;T FOOD LACAFE tersedia dalam 2 varian, yakni Latte dan Matcha. Menjadikan H&amp;T Food Lacafe makin nikmat dinikmati.</p>', 129000, 'photos/3 lacafe latte.jpeg', NULL, 'sholeh', NULL, 'sholeh'),
(76, 2, 'H&T Food Lacafe Matcha (banded 3)', 'ht-food-lacafe-matcha-banded-3', 'H&T FOOD LACAFE LATTE dan MATCHA, adalah minuman sari Habbatussauda yang dipadu dengan beragam komposisi bahan yang berkhasiat serta dapat dikonsumsi dengan nikmat. Komposisi bahan pokok minuman ini adalah :', '<p style=\"text-align:justify\">H&amp;T FOOD LACAFE LATTE dan MATCHA, adalah minuman sari Habbatussauda yang dipadu dengan beragam komposisi bahan yang berkhasiat serta dapat dikonsumsi dengan nikmat. Komposisi bahan pokok minuman ini adalah :</p>\r\n\r\n<ol>\r\n	<li>Habbatussauda</li>\r\n	<li>Madu</li>\r\n	<li>Biji Wijen</li>\r\n	<li>Creamer Nabati</li>\r\n	<li>Gula Aren</li>\r\n	<li>Ekstrak Matcha (untuk varian Matcha)</li>\r\n</ol>\r\n\r\n<p>Dengan lima (5) komponen pokok inilah kami menyebutnya H&amp;T FOOD LACAFE.</p>\r\n\r\n<p>Keunggulan masing-masing komponen di antaranya:</p>\r\n\r\n<ol>\r\n	<li>Habbatussauda, merupakan immunomodulator yang mampu meningkatkan daya imunitas tubuh sehingga tidak mudah sakit. Dengan minum satu kemasan sachet, nilainya setara dengan minum kurang lebih tiga kapsul habbatussauda serbuk.</li>\r\n	<li>Madu, kaya fruktosa sebagaimana kurma. Aman dan berkhasiat buat penderita sakit lambung atau maag. Sehingga minuman ini sangat baik dikonsumsi oleh penderita maag ataupun yang punya gangguan pencernaan</li>\r\n	<li>Biji Wijen, kaya akan kandungan seng yang bermanfaat untuk pembentukan kolagen yang berfungsi memperkuat jaringan otot, rambut, dan kulit. Biji wijen juga mengandung jumlah protein yang tinggi yang dapat menambah kekuatan tubuh secara keseluruhan, pertumbuhan sel sehat, mobilitas, tingkat energi dan fungsi metabolisme tubuh.</li>\r\n	<li>Creamer Nabati, sehat dan nikmat dikonsumsi tanpa takut nilai kolesterol dalam darah naik. Memberikan rasa gurih yang khas pada minuman.</li>\r\n</ol>\r\n\r\n<p>Gula Aren, memiliki indeks glikemik yang lebih rendah dibandingkan dengan gula pasir, sehingga relatif aman dikonsumsi.<br />\r\nH&amp;T FOOD LACAFE tersedia dalam 2 varian, yakni Latte dan Matcha. Menjadikan H&amp;T Food Lacafe makin nikmat dinikmati.</p>', 141000, 'photos/3 lacafe macha.jpg', NULL, 'sholeh', NULL, 'sholeh'),
(77, 2, 'Kecap Zaitun Manis Sedang (banded 3)', 'kecap-zaitun-manis-sedang-banded-3', 'Kecap Zaitun adalah kecap kriteria MUTU I sesuai Standar Industri Indonesia (SII), dengan bahan baku kedelai hitam lokal terbaik, menggunakan pemanis gula kelapa melalui proses fermentasi alami yang menjaga higienitas, serta menggunakan berbagai tumbuhan segar sebagai bahan penyedapnya.', '<p style=\"text-align:justify\">Kecap Zaitun adalah kecap kriteria MUTU I sesuai Standar Industri Indonesia (SII), dengan bahan baku kedelai hitam lokal terbaik, menggunakan pemanis gula kelapa melalui proses fermentasi alami yang menjaga higienitas, serta menggunakan berbagai tumbuhan segar sebagai bahan penyedapnya. Kecap Zaitun Manis Sedang memiliki keistimewaan yaitu tingkat kemanisan yang kurang dibanding dengan kemanisan kecap pada umumnya. Kecap ini memenuhi selera Anda yang terbisa dengan makanan yang tidak terlalu manis.</p>\r\n\r\n<p style=\"text-align:justify\">Keunggulan Kecap ini lebih dari sekedar yang tampak dari mata Anda. Terutama &nbsp;yang berkaitan dengan pemilihan bahan baku, proses pembuatan kecap, dan kandungan nutrisi kecap.</p>\r\n\r\n<p>Kelebihan Kecap Zaitun adalah sebagai berikut :</p>\r\n\r\n<p>1. &nbsp; Kekentalan yang Pas</p>\r\n\r\n<p style=\"text-align:justify\">Kekentalan kecap didapatkan dari bahan baku dan formulasi kecap yang didapatkan dari kualitas yang baik. Gula yang digunakan dari gula nira kelapa dan bukan gula pasir. Sehingga, kekentalannya pas.</p>\r\n\r\n<p>2. &nbsp; Warna yang Jernih</p>\r\n\r\n<p style=\"text-align:justify\">Bahan baku yang memiliki kualitas yang baik menyebabkan kecap memiliki warna yang jernih dan tidak keruh.</p>\r\n\r\n<p>3. &nbsp; Kadar Protein Dua Kali Lebih Banyak.</p>\r\n\r\n<p style=\"text-align:justify\">Hasil analisa laboratorium independen, kecap ini memiliki kandungan protein sekitar 6% sedangkan kecap lain hanya memiliki kandungan protein sekitar 3%.</p>\r\n\r\n<p>4. &nbsp; Diproses Secara Alami Bukan Kimiawi.</p>\r\n\r\n<p style=\"text-align:justify\">Aroma Kecap Zaitun yang khas dihasilkan dari proses produksi dengan proses fermentasi alami kedelai yang membutuhkan waktu hingga beberapa bulan. &nbsp;Sedangkan kecap lain menggunakan proses Hidrolisis Kimia yang instan.</p>\r\n\r\n<p>5. &nbsp; Menggunakan Kedelai Hitam Non GMO (Genetical Manufactured Organism)</p>\r\n\r\n<p style=\"text-align:justify\">Kecap Zaitun hanya menggunakan kedelai lokal dan bukan kedelai impor yang masih diragukan keamanannya. &nbsp;Kedelai impor pada umumnya sudah mengalami proses rekayasa genetika, yang kedelai tersebut ditujukan untuk dapat diproduksi secara masal dan biaya produksi yang rendah. Organisme hasil rekayasa genetika dengan susunan genetika yang berubah akan menimbulkan sampah organisme yang membingungkan alam dalam siklus penguraian dan pembusukan organism. &nbsp;Termasuk saat proses penyerapan dan metabolisme nutrisi dalam tubuh.</p>\r\n\r\n<p>6. &nbsp; Penyedap dari Tumbuhan Segar.</p>\r\n\r\n<p style=\"text-align:justify\">Bumbu penyedap yang digunakan berasal dari rempah-rempah segar, alami dan bukan menggunakan penyedap kimia yang bisa menyebabkan alergi. Rasa yang dihasilkan juga sangat gurih dan menyegarkan. Hal ini disebabkan oleh kombinasi bahan baku dan penyedap yang alami.</p>', 75000, 'photos/3 kecap manis sedang.jpeg', NULL, 'sholeh', NULL, NULL),
(78, 2, 'H&T Food Bumbu Racik Non MSG (banded 3)', 'ht-food-bumbu-racik-non-msg-banded-3', 'Komposisi/Bahan Baku:\r\n\r\nGaram, gula, lada putih, ketumbar bubuk, bawang putih bubuk, maltodextrine, kunyit, beef ekstrak, ekstrak ragi, anti kempal', '<p style=\"text-align:justify\"><strong>Komposisi/Bahan Baku:</strong></p>\r\n\r\n<p style=\"text-align:justify\">Garam, gula, lada putih, ketumbar bubuk, bawang putih bubuk, maltodextrine, kunyit, beef ekstrak, ekstrak ragi, anti kempal</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Manfaat:</strong></p>\r\n\r\n<p style=\"text-align:justify\">H&amp;T Food Bumbu Racik Non MSG terbuat dari rempah-rempah asli dan tanpa bahan pengawet. Paduan formula yang pas untuk bumbu pembuatan aneka macam gorengan, yang kuat akan rasa rempah dan gurih yang mantap, serta dibuat tanpa ada penambahan &nbsp;MSG (Monosodium Glutamate), sehingga baik dan sehat untuk yang sensitif terhadap MSG</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cara Penggunaan/Pemakaian:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Siapkan air sebanyak 15 mL</li>\r\n	<li style=\"text-align:justify\">Timbang H&amp;T Food Bumbu Racik Non MSG sebanyak 15 gram</li>\r\n	<li style=\"text-align:justify\">Masukan bumbu racik yang telah ditimbang ke dalam air yang telah disiapkan, aduk hingga merata</li>\r\n	<li style=\"text-align:justify\">Masukan potongan tempe/udang/cumi/ikan ke dalam adonan bumbu, kemudian balurkan dan bolak-balikan tempe/udang/cumi/ikan hingga bumbu menyerap</li>\r\n	<li style=\"text-align:justify\">Goreng tempe/udang/ikan/cumi hingga matang</li>\r\n	<li style=\"text-align:justify\">Gorengan tempe/udang/ikan/cumi bumbu serbaguna siap disajikan<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penyimpanan Sebelum Dibuka:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan ditempat sejuk dan kering, serta bahan yang dapat mengkontaminasi status keHalalan produk</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penyimpanan Setelah Dibuka:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan ditempat sejuk dan kering, serta tertutup pada kemasan dan dapat disimpan didalam toples/kotak</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Hindari penyimpanan produk terlalu lama, jika kemasan produk sudah dibuka<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Penanganan Pengiriman:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan dengan kemasan yang tertutup rapi dan tidak bocor. Jika dalam kardus, simpan dengan disusun secara rata dapat dengan posisi tidur jika kemasan belum dibuka dan tidak bocor</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 30⁰C</li>\r\n	<li style=\"text-align:justify\">Hindari dari kemungkinan kontaminasi yang mengurangi mutu dan status keHalalan &nbsp;produk</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Lakukan pengecekan kondisi tempat pengangkut produk, sebelum proses transportasi berlangsung</li>\r\n</ol>', 63000, 'photos/3 H&T bumbu_racik.jpg', NULL, 'sholeh', NULL, 'nurhidayat'),
(79, 2, 'H&T Food Kaldu Sapi Non MSG (banded 3)', 'ht-food-kaldu-sapi-non-msg-banded-3', 'Komposisi/Bahan Baku:\r\n\r\nGaram, gula, lada putih, ketumbar, bawang putih dan bombay bubuk, penguat rasa daging sapi, ekstrak daging sapi, penguat aroma hewani, hidrolis protein nabati, anti kempal', '<p><strong>Komposisi/Bahan Baku:</strong></p>\r\n\r\n<p style=\"text-align:justify\">Garam, gula, lada putih, ketumbar, bawang putih dan bombay bubuk, penguat rasa daging sapi, ekstrak daging sapi, penguat aroma hewani, hidrolis protein nabati, anti kempal</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Manfaat:</strong></p>\r\n\r\n<p style=\"text-align:justify\">Menambah atau memperkuat rasa dan aroma khas daging sapi pada makanan, dengan penambahan kaldu mampu mengurangi jumlah bumbu masakan yang ditambahkan pada masakan dengan praktis. &nbsp;H&amp;T Food Kaldu Sapi Non MSG merupakan bumbu kaldu tanpa penyedap rasa MSG dan tanpa bahan pengawet, baik untuk masakan yang lebih sehat dan aman bagi keluarga terbuat dari rempah-rempah asli dan tanpa bahan pengawet.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cara Penggunaan/Pemakaian:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Siapkan air sebanyak 1liter dan masak sampai mendidih</li>\r\n	<li style=\"text-align:justify\">Timbang H&amp;T Food Kaldu Sapi Non MSG sebanyak 50 gram</li>\r\n	<li style=\"text-align:justify\">Masukan kaldu yang telah ditimbang ke dalam air yang telah mendidih, aduk hingga semua kaldu larut di dalam air panas</li>\r\n	<li style=\"text-align:justify\">Dapat disajikan sebagai bahan untuk sup dan sejenisnya</li>\r\n	<li style=\"text-align:justify\">Tambahkan potongan daging atau tulang sapi, daun bawang, bawang putih, dan bahan lainnya sebagai pelengkap<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penyimpanan Sebelum Dibuka:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan ditempat sejuk dan kering, serta bahan yang dapat mengkontaminasi status keHalalan produk</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penyimpanan Setelah Dibuka:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan ditempat sejuk dan kering, serta tertutup pada kemasan dan dapat disimpan didalam toples/kotak</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Hindari penyimpanan produk terlalu lama, jika kemasan produk sudah dibuka<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Penanganan Pengiriman:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan dengan kemasan yang tertutup rapi dan tidak bocor. Jika dalam kardus, simpan dengan disusun secara rata dapat dengan posisi tidur jika kemasan belum dibuka dan tidak bocor</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 30⁰C</li>\r\n	<li style=\"text-align:justify\">Hindari dari kemungkinan kontaminasi yang mengurangi mutu dan status keHalalan &nbsp;produk</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Lakukan pengecekan kondisi tempat pengangkut produk, sebelum proses transportasi berlangsung</li>\r\n</ol>', 60000, 'photos/3 H&T bumbu_sapi.jpg', NULL, 'sholeh', NULL, 'nurhidayat'),
