lign:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penyimpanan Setelah Dibuka:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan ditempat sejuk dan kering, serta tertutup pada kemasan dan dapat disimpan didalam toples/kotak</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Hindari penyimpanan produk terlalu lama, jika kemasan produk sudah dibuka<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Penanganan Pengiriman:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan dengan kemasan yang tertutup rapi dan tidak bocor. Jika dalam kardus, simpan dengan disusun secara rata dapat dengan posisi tidur jika kemasan belum dibuka dan tidak bocor</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 30⁰C</li>\r\n	<li style=\"text-align:justify\">Hindari dari kemungkinan kontaminasi yang mengurangi mutu dan status keHalalan &nbsp;produk</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Lakukan pengecekan kondisi tempat pengangkut produk, sebelum proses transportasi berlangsung</li>\r\n</ol>', 20000, 'photos/1_H&T kaldu sapi.jpg', NULL, 'sholeh', NULL, 'sholeh'),
(81, 2, 'H&T Food Bumbu Racik Non MSG', 'ht-food-bumbu-racik-non-msg', 'Komposisi/Bahan Baku:\r\n\r\nGaram, gula, lada putih, ketumbar bubuk, bawang putih bubuk, maltodextrine, kunyit, beef ekstrak, ekstrak ragi, anti kempal', '<p><strong>Komposisi/Bahan Baku:</strong></p>\r\n\r\n<p style=\"text-align:justify\">Garam, gula, lada putih, ketumbar bubuk, bawang putih bubuk, maltodextrine, kunyit, beef ekstrak, ekstrak ragi, anti kempal</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Manfaat:</strong></p>\r\n\r\n<p style=\"text-align:justify\">H&amp;T Food Bumbu Racik Non MSG terbuat dari rempah-rempah asli dan tanpa bahan pengawet. Paduan formula yang pas untuk bumbu pembuatan aneka macam gorengan, yang kuat akan rasa rempah dan gurih yang mantap, serta dibuat tanpa ada penambahan &nbsp;MSG (Monosodium Glutamate), sehingga baik dan sehat untuk yang sensitif terhadap MSG</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cara Penggunaan/Pemakaian:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Siapkan air sebanyak 15 mL</li>\r\n	<li style=\"text-align:justify\">Timbang H&amp;T Food Bumbu Racik Non MSG sebanyak 15 gram</li>\r\n	<li style=\"text-align:justify\">Masukan bumbu racik yang telah ditimbang ke dalam air yang telah disiapkan, aduk hingga merata</li>\r\n	<li style=\"text-align:justify\">Masukan potongan tempe/udang/cumi/ikan ke dalam adonan bumbu, kemudian balurkan dan bolak-balikan tempe/udang/cumi/ikan hingga bumbu menyerap</li>\r\n	<li style=\"text-align:justify\">Goreng tempe/udang/ikan/cumi hingga matang</li>\r\n	<li style=\"text-align:justify\">Gorengan tempe/udang/ikan/cumi bumbu serbaguna siap disajikan<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penyimpanan Sebelum Dibuka:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan ditempat sejuk dan kering, serta bahan yang dapat mengkontaminasi status keHalalan produk</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penyimpanan Setelah Dibuka:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan ditempat sejuk dan kering, serta tertutup pada kemasan dan dapat disimpan didalam toples/kotak</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Hindari penyimpanan produk terlalu lama, jika kemasan produk sudah dibuka<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Penanganan Pengiriman:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan dengan kemasan yang tertutup rapi dan tidak bocor. Jika dalam kardus, simpan dengan disusun secara rata dapat dengan posisi tidur jika kemasan belum dibuka dan tidak bocor</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 30⁰C</li>\r\n	<li style=\"text-align:justify\">Hindari dari kemungkinan kontaminasi yang mengurangi mutu dan status keHalalan &nbsp;produk</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Lakukan pengecekan kondisi tempat pengangkut produk, sebelum proses transportasi berlangsung</li>\r\n</ol>', 21000, 'photos/1_H&T BUMBU RACIK.jpg', NULL, 'sholeh', NULL, 'sholeh'),
(82, 2, 'H&T Food Tepung Crispy Non MSG', 'ht-food-tepung-crispy-non-msg', 'Komposisi/Bahan Baku:\r\n\r\nGaram, bawang putih dan bombay bubuk, beef ekstrak, tepung terigu protein sedang, cabai bubuk, lada bubuk, pengembang', '<p><strong>Komposisi/Bahan Baku:</strong></p>\r\n\r\n<p style=\"text-align:justify\">Garam, bawang putih dan bombay bubuk, beef ekstrak, tepung terigu protein sedang, cabai bubuk, lada bubuk, pengembang</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Manfaat:</strong></p>\r\n\r\n<p style=\"text-align:justify\">Tepung pelapis pada makanan yang memberikan tekstur renyah/crispy, yang dipadukan dengan rasa gurih dan &nbsp;bumbu rempah yang pas, dibuat tanpa ada penambahan MSG (Monosodium Glutamate), sehingga baik dan sehat untuk yang sensitif terhadap MSG</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cara Penggunaan/Pemakaian:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Siapkan H&amp;T Food Tepung Crispy dan buat adonan basah menggunakan Tepung Crispy dan air dengan perbandingan 1:1,5</li>\r\n	<li style=\"text-align:justify\">Siapkan H&amp;T Food Tepung Crispy sebagai adonan kering di wadah kedua</li>\r\n	<li style=\"text-align:justify\">Masukkan ayam/ikan/tahu/tempe/jamur pada adonan basah</li>\r\n	<li style=\"text-align:justify\">Angkat ayam/ikan/tahu/tempe/jamur, lalu masukkan ke dalam adonan kering, dan tekan-tekan agar adonan kering menempel</li>\r\n	<li style=\"text-align:justify\">Angkat bahan yang telah dibalur adonan kering lalu masukkan ke dalam saringan dan goyang-goyangkan saringan hingga tidak ada sisa adonan kering yang jatuh</li>\r\n	<li style=\"text-align:justify\">Panaskan minyak goreng hingga mencapai suhu 120⁰ C -150⁰C</li>\r\n	<li style=\"text-align:justify\">Goreng bahan yang telah dibaluri H&amp;T Food Tepung Crispy selama 8-12 menit hingga berwarna kuning keemasan</li>\r\n	<li style=\"text-align:justify\">Angkat Ayam/ikan/tahu/tempe/jamur crispy dan sajikan<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penyimpanan Sebelum Dibuka:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan ditempat sejuk dan kering, serta bahan yang dapat mengkontaminasi status keHalalan produk</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Cara Penyimpanan Setelah Dibuka:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan ditempat sejuk dan kering, serta tertutup pada kemasan dan dapat disimpan didalam toples/kotak</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 25⁰C</li>\r\n	<li style=\"text-align:justify\">Usahakan simpan dalam posisi tegak/berdiri</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Hindari penyimpanan produk terlalu lama, jika kemasan produk sudah dibuka<br />\r\n	&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>Penanganan Pengiriman:</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Simpan dengan kemasan yang tertutup rapi dan tidak bocor. Jika dalam kardus, simpan dengan disusun secara rata dapat dengan posisi tidur jika kemasan belum dibuka dan tidak bocor</li>\r\n	<li style=\"text-align:justify\">Suhu penyimpanan dibawah 30⁰C</li>\r\n	<li style=\"text-align:justify\">Hindari dari kemungkinan kontaminasi yang mengurangi mutu dan status keHalalan &nbsp;produk</li>\r\n	<li style=\"text-align:justify\">Hindari terkena sinar matahari langsung dan tempat yang basah/lembab</li>\r\n	<li style=\"text-align:justify\">Lakukan pengecekan kondisi tempat pengangkut produk, sebelum proses transportasi berlangsung</li>\r\n</ol>', 45000, 'photos/1_H&T TEPUNG KRISPY.jpg', NULL, 'sholeh', NULL, 'sholeh');
INSERT INTO `default_testimoni` (`id`, `produk_id`, `judul`, `nama`, `alamat`, `foto`, `keterangan`, `created_at`, `updated_at`) VALUES
(7, 4, 'Dengan Perantara SHAD LIN NISA, Istri Saya Hamil', 'Irham Noor', 'Jl. Laksana Intan, Kampoeng Permata 1 No.78, Pekauman, Banjarmasin, Kalimantan Selatan', 'photos/shad_linnisa_1.jpg', '<p style=\"text-align:justify\">Nama saya Irham Noor, sehari-sehari bekerja sebagai tenaga mekanik di sebuah bengkel motor. Istri saya bernama Nudzliana, sehari-hari bekerja di sebuah perusahaan farmasi. Kami tinggal di Jalan Laksana Intan, Kampoeng Permata 1 No.78, Pekauman, Banjarmasin, Kalimantan Selatan. &nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Bagi kami, menikah adalah upaya menjalankan Sunnah Rasulullah SAW. Selain itu, sebagaimana kebanyakan orang, dengan menikah juga kami berharap dapat memiliki keturunan sebagai generasi penerus. Oleh karena itu, setelah kami menikah kami selalu berdoa kepada Allah SWT agar segera memberikan karunia buah hati kepada kami. Namun kenyataan berbicara lain, setelah tiga tahun menikah, Allah SWT belum juga memberikan amanah buah hati tercinta. Kami sangat merindukan kehadiran buah hati agar kebahagiaan dan keceriaan dalam rumah tangga kami semakin bertambah. Oleh karena itu, kami terus berusaha memeriksakan diri ke dokter dan melakukan berbagai pengobatan agar istri dapat segera hamil. Hasil pemeriksaan medis menyimpulkan bahwa kami tidak memiliki hal-hal yang dapat menghambat terjadinya kehamilan. Artinya, baik saya maupun istri dinyatakan sehat dan memungkinkan punya keturunan.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan dasar itu, kami semakin giat dan semangat berusaha melakukan pengobatan secara tradisional seperti urat dan pijat agar mudah hamil, mengkonsumsi buah kurma muda seperti anjuran banyak orang, dan mengkonsumsi makanan lain yang diyakini dapat menambah kesuburan. Ikhtiar secara medis pun kami lakukan, seperti ikut program terapi kehamilan pada dokter. Namun sejauh ini semua belum membuahkan hasil. Meskipun demikian, kami tetap semangat, karena meyakini kelahiran, kematian, dan rizqi, Allah yang menentukan. Kita hanya dituntut untuk berusaha secara maksimal dengan penuh kesabaran. Pada saatnya, insya Allah semua akan membuahkan hasil.</p>\r\n\r\n<p style=\"text-align:justify\">Alhamdulillah, di tengah giatnya kami berusaha, sekitar akhir Januari atau awal Februari 2019 yang lalu, kami bertemu dengan seorang ustadzah bernama Ustadzah Juwai. Selain menyarankan untuk terus berdoa kepada Allah SWT, Ustadzah Juwai menyarankan kepada istri saya untuk terapi menggunakan obat herbal bernama SHAD LIN NISA. Menurut beliau, SHAD LIN NISA adalah herbal yang dapat membantu menambah kesuburan sekaligus menguatkan rahim wanita, sehingga dapat membantu hamil lebih cepat. Agar SHAD LIN NISA dapat bekerja lebih maksimal, kepada istri saya juga disarankan untuk mengkombinasikannya dengan herbal SHAD NIGELLA PLUS.</p>\r\n\r\n<p style=\"text-align:justify\">Dilandasi keinginan yang kuat untuk punya keturunan, istri saya menuruti anjuran Ustadzah Juwai dengan mengkonsumsi SHAD LIN NISA dan SHAD NIGELLA PLUS 2-3 kali sehari masing-masing dua kapsul. Selama tiga bulan istri saya rutin mengkonsumsi SHAD LIN NISA dan SHAD NIGELLA PLUS. Hingga akhirnya pada tanggal 24 April 2019 melalui pemeriksaan alat tes kehamilan, istri saya dinyatakan positif hamil.</p>\r\n\r\n<p style=\"text-align:justify\">Kami sangat bersyukur kepada Allah SWT atas karunia-Nya ini. Kami pun tak henti-henti berdoa agar janin dalam rahim istri selalu berkembang dengan baik dan sempurna, hingga kelak lahir bayi sehat dan kuat seperti yang kami dambakan selama ini. Alhamdulillah, semoga kami dapat mengemban amanah dari Allah SWT ini sebaik mungkin dan menjadi orang tua yang dapat mendidik anak-anak kelak, sehingga menjadi anak yang shalih dan shalihah. Insya Allah (HRM)</p>', '2021-11-11 03:50:33', '2021-11-10 20:50:33'),
(8, 54, 'Saya Lebih Langsing dan “Daging Tumbuh” pada Daun Telinga Anak Semakin Berkurang', 'Ibu Sudarningsih', 'Jl. S.M. Raja, Gang Family, Medan Ampas, Medan', 'photos/teh_hijau_cap_pucuk_1.jpg', '<p style=\"text-align:justify\">Menjalani profesi sebagai seorang guru yang mengajar di SMP Muhammadiyah 5 Medan, sekaligus sebagai dosen di Sekolah Tinggi Agama Islam Sumatera di Medan, membuat saya (Ibu Sudarningsih, Jl. S.M. Raja, Gang Family, Medan Ampas, Medan) sehari-hari padat dengan aktivitas. Hal ini seringkali membuat pola makan saya menjadi tidak teratur, baik waktunya mapun jenis makanannya. Dampaknya membuat saya memiliki kelebihan berat badan. Kondisi ini membuat suami saya menyarankan agar saya melakukan usaha untuk mengurangi berat badan. Berat badan yang melebihi batas ideal ini, selain membuat aktivitas dan pergerakan saya menjadi lebih terbatas, juga seringkali membuat tangan saya terasa ngilu, kebas-kebas, dan sering kesemutan. Bahkan, acap kali membuat tangan saya kesulitan digerakkan.</p>\r\n\r\n<p style=\"text-align:justify\">Suatu hari, saat datang ke sekolah dengan mengendarai sepeda motor, saya kesulitan membuka helm karena tangan kaku dan terasa sangat tebal. Karena kesulitan, saya terpaksa meminta bantuan murid-murid untuk melepaskan helm tersebut. Dengan nada bercanda, murid-murid saya bilang bahwa saya terlalu lebay. Rupanya mereka tak percaya dengan apa yang saya alami. Kejadian ini sering saya alami, terutama saat pagi hari dan saat mengendarai sepeda motor dalam waktu dan jarak agak panjang.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Alhamdulillah, sejak bulan Januari 2018 yang lalu, saya diperkenalkan dengan produk Teh Hijau Istimewa Cap Pucuk. Berdasarkan informasi yang saya dapat, Teh Hijau Istimewa Cap Pucuk memiliki banyak khasiat di antaranya adalah untuk menurunkan berat badan dan mengendalikan kolesterol serta asam urat. Dilandasi keinginan untuk menurunkan berat badan dan untuk mengatasi rasa kebas di tangan yang selama ini saya alami, saya mencoba membeli dan mengkonsumsi Teh Hijau Istimewa Cap Pucuk. Saya mengkomsumsi-nya tanpa gula dengan dosis dua gelas sehari, masing-masing satu gelas setiap pagi sebelum beraktivitas dan satu gelas pada sore hari sepulang mengajar.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Selama dua minggu mengkonsumsi Teh Hijau Istimewa Cap Pucuk secara rutin, perlahan namun pasti, saya merasakan ke-bas-kebas, rasa nyeri, dan tangan terasa tebal saat menggenggam berkurang, bahkan hilang sama sekali. Di luar dugaan saya, ternyata semua sahabat saya di kantor diam-diam memperhatikan penampilan saya. Mereka mengomentari bahwa tubuh saya terlihat lebih ramping, sehingga bertanya obat pelangsing apa yang saya pakai. Saya pun menceritakan tentang Teh Hijau Istimewa Cap Pucuk kepada mereka.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Selain sahabat di tempat kerja yang menyatakan bahwa saya terlihat lebih ramping, saya juga merasakan sendiri bahwa gerakan saya menjadi lebih lincah dan luwes karena memang tubuh saya terasa lebih ringan. Berat badan saya memang sudah turun. Alhamdulil-lah, perut yang telihat buncit kini sudah mulai terlihat rata kembali.</p>\r\n\r\n<p style=\"text-align:justify\">Semua keluarga saya sejak dulu memang suka menggunakan obat herbal untuk mengatasi berbagai keluhan sakit. Oleh karena itu, Teh Hijau Istimewa Cap Pucuk ini juga dikonsumsi oleh semua anggota keluarga saya. Salah satunya Nisa, anak perempuan saya yang saat ini sedang melangsungkan pendidikannya di sebuah perguruan tinggi di Medan. Sekitar dua tahun yang lalu, Nisa mengalami kecelakaan saat mengendarai sepeda motor. Akibatnya, daun telinga sebelah kanannya mengalami sobek. Dokter menyarankan untuk dioperasi dan dijahit, namun saat itu Nisa tidak berani dan memilih untuk dibiarkan saja.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Hal itu membuat daun telinga Nisa tidak sempurna menutup kembali. Pada bekas daun telinga yang sobek terlihat seperti ada &ldquo;daging tumbuh.&rdquo; Kami khawatir &ldquo;daging tumbuh&rdquo; itu adalah bagian dari tumor atau semacamnya. Tapi karena Nisa takut untuk dioperasi, maka hal itu terpaksa kami biarkan saja.</p>\r\n\r\n<p style=\"text-align:justify\">Alhamdulillah, sejak rutin mengkonsumsi Teh Hijau Istimewa Cap Pucuk, &ldquo;daging tumbuh&rdquo; di daun telinga Nisa yang selama ini terlihat besar dan tebal, kini semakin mengecil dan menipis. Karena selama ini Nisa tidak mengkonsumsi obat apapun selain Teh Hijau Istimewa Cap Pucuk, kami yakin bahwa ini adalah bagian dari khasiat Teh Hijau Istimewa Cap Pucuk yang didapatkan Nisa. Boleh jadi keyakinan kami beralasan, karena memang salah satu khasiat Teh Hijau Istimewa Cap Pucuk ini adalah sebagai antitumor dan antikanker.</p>\r\n\r\n<p style=\"text-align:justify\">Kami merasakan khasiat dan pengalaman yang positif dengan Teh Hijau Istimewa Cap Pucuk ini, maka insya Allah kami akan terus mengkonsumsinya secara teratur sebagai bagian dari bentuk usaha dalam menjaga kesehatan. Insya Allah. (HRM)</p>', '2021-11-11 04:27:51', '2021-11-10 21:27:51'),
(9, 58, 'SALAM FIT UNTUK TUMBUH KEMBANG YANG LEBIH BAIK', 'Ibu Naisa Pana dan Ibu Rosmiati', NULL, 'photos/SALAM FIT UNTUK TUMBUH KEMBANG YANG LEBIH BAIK.jpg', '<p style=\"text-align:justify\">Salam Fit adalah food suplement yang sangat baik untuk diberikan kepada anak-anak. Komposisi &nbsp;Salam Fit yang terdiri dari madu hutan alami, minyak Nigella sativa kualitas terbaik (Habbasya), dan minyak zaitun mampu memberikan multivitamin yang lengkap bagi anak-anak yang sangat bermanfaat sebagai pemelihara kesehatan, meningkatkan imunitas tubuh, meningkatkan stamina, melancarkan peredaran darah, meningkatkan pertumbuhan dan kecerdasan anak, dan menambah nafsu makan. Salam Fit juga diperkaya dengan bee polen dan royal jelly.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Manfaat yang ditawarkan dari Salam Fit dapat membantu tumbuh kembang anak-anak. Jika terlampaui dengan baik tumbuh kembangnya, maka anak dapat sangat terbantu memasuki hari depan yang lebih baik.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Berikut adalah testimoni mengenai Salam Fit:</p>\r\n\r\n<p style=\"text-align:justify\">1. &nbsp; &nbsp;Ibu Naisa Pana menceritakan mengenai anak kerabatnya yang bernama Rahmat Hidayat</p>\r\n\r\n<p style=\"text-align:justify\">Keponakan kami adalah seorang anak laki-laki yang berusia sembilan tahun. Ia sangat malas sekali makan dan pertumbuhannya lambat. Setelah kami berikan Salam Fit, alhamdulillah anak kami mengalami perubahan yang dulunya malas makan dan sekarang makannya. Dahulu kalau makan selalu disuapi, sekarang sang anak malah ngambil sendiri bahkan minta tambah. Jika diamati, pertumbuhan tubuhnya juga menjadi sangat baik. Begitu juga dengan perubahan di sekolah, Rahmat menjadi lebih cerdas. Banyak sudah perbaikan yang dialami setelah mengkonsumsi Salam Fit. Daya tahan tubuhnya juga membaik, pernah suatu kali Rahmat terserang penyakit cacar, dan tetap mengkonsumsi Salam Fit, memberikan efek yang luar biasa. Alhamdulillah, penyakit cacarnya cepat sembuh. Biasanya anak lain terkena cacar baru sembuh dalam dua minggu, namun Rahmat dalam tiga hari langsung sehat kembali.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">2. &nbsp; &nbsp;Ibu Rosmiati menceritakan mengenai putranya yang berusia lima tahun, yang bernama M. Akbar. Di tahun-tahun awal, putranya lambat jalan dan malas makan. Bahkan pernah terserang penyakit bronkhitis. Anak yang berat badannya rendah makin berkurang berat badannya. Saat usia dua tahun lebih juga masih memakan bubur saring, padahal anak lain sudah mengkonsumsi makanan padat. Akbar pun selalu ke dokter setiap minggu karena kerap kali sakit. Ibu Rosmiati berkonsultasi dengan mitrautamanya, Bapak H. Andi Alif Kaharuddin, mengenai hal ini. Pak Alif merekomendasikan Salam Fit untuk dikonsumsi, dan setelah habis dua botol baru terasa khasiatnya oleh Akbar. Hasilnya sekarang anak Bu Rosmiati sehat, jika dulu suaranya kecil dan lemah, sekarang suaranya sudah kencang. Akbar pun sekarang jarang sakit dan memiliki daya tahan tubuh yang baik. Alhamdulillah.</p>\r\n\r\n<p>(ARH)</p>', '2021-10-22 00:33:45', '2021-10-22 00:33:45'),
(10, 5, 'BATU GINJALKU KELUAR SENDIRI DAN KELUARGA KAMI SEMAKIN HARMONIS', 'Ibu Yuliarni Suparman dan Bapak H. Suparman Hamry', 'Pondok Labu, Jakarta', 'photos/shad-nigella_1.jpg', '<p style=\"text-align:justify\">Alhamdulillah saya sejak lama mengenal SHAD Nigella Plus, yaitu sekitar tahun 2000-an awal. Saat itu saya menderita penyakit yang saya tidak tahu apa sebenarnya penyakit itu. Saya sudah berobat ke dokter dan &nbsp;belum bisa keputusan jenis penyakit yang diderita. Saya sudah melakukan dua kali foto terhadap organ-organ yang berkaitan dengan keluhan saya yaitu di sekitar perut, kandungan, dan ginjal. Ajaibnya dokter yang memeriksa pun tetap tidak dapat menentukan penyakit dengan tepat.<br />\r\n&nbsp;<br />\r\nSaat itu anak-anak saya yang berjumlah empat orang yang masih kecil-kecil sangat memerlukan peran saya sebagai ibu. Saya pun sudah hampir dua tahun menderita penyakit yang di sekitar perut dan pinggang saya. Penyakit ini membuat saya tidak bisa banyak beraktivitas. Saya tidak bisa banyak beraktivitas. Anak-anak saya sangat memerlukan saya. Saya tetap berusaha untuk kuat. Saya tetap berobat sampai dokter memperkirakan saya terkena kista di ginjal.<br />\r\n&nbsp;<br />\r\nKarena menyadari tugas sebagai ibu yang pernting bagi anak-anak saya yang masih kecil-kecil, saya berdoa kepada Allah SWT selalu agar saya selalu dikuatkan oleh-Nya. Hingga pada suatu malam yang penuh dengan rintik hujan saya melakukan shalat malam. Dalam shalat, saya khusukkan diri saya, tenggelam dalam permohonan doa yang tulus kepada Yang Maha Kuasa, agar saya ditunjukkan penyakit apa yang saya derita. Jika ada obatnya saya mohon kepada-Nya untuk menunjukkan apa obatnya. Satu hal yang benar-benar sangat mengerakkan saya untuk memohonkan kesembuhan kepadanya adalah anak-anak saya yang sangat membutuhkan saya.<br />\r\n&nbsp;<br />\r\nBeberapa hari berselang, datanglah tetangga saya yang mitraniaga SNW, Ibu Showi yang &nbsp;mengatakan sebetulnya sudah lama ingin berkunjung ke rumah saya. Beliau memberi SHAD Nigella Plus kepada saya. Dia bilang herbak ini adalah obat untuk semua penyakit. &ldquo;Banyak sudah yang sehat dengan mengkonsumsi herbal ini,&rdquo; begitu tambahnya.<br />\r\n&nbsp;<br />\r\nSaya mengikuti sarannya. Saya konsumsi langsung SHAD Nigella Plus seperti yang dianjurkan, yaitu tiga kapsul pagi dan tiga kapsul sore. Kurang lebih belum habis satu botol SHAD Nigella Plus saya konsumsi, saya sudah merasa jauh lebih baik. Pada suatu saat adzan Maghrib, saya ingin sekali buang air kecil. Ada sedikit kejadian luar biasa yang saya alami saat itu. Saat Maghrib setelah mengkonsumsi hampir 1 botol Nigella Plus ini ada batu yang keluar dari air seni saya lumayan besar, sebesar ujung kelingking. Ada beberapa butir yang keluar. Setelah saat itu alhamdulillah saya sangat merasa jauh lebih baik dan tidak pernah muncul lagi keluhan-keluhan seperti sebelumnya.<br />\r\n&nbsp;<br />\r\nSampai saat ini saya tetap mengkonsumsi SHAD Nigella Plus. Saya juga mengajak suami saya untuk mengkonsumsi Nigella Plus. Alhamdulillah saya dan suami saat ini sehat wal afiat, stamina selalu baik padahal kami kerap kali keluar kota bersama. Kami sebagai suami istri tambah harmonis. Kami juga turut merekomendasikan SHAD Nigella Plus dan herbal SNW lain bagi yang sedang mengalami sakit berat. Semoga sehat selalu bersama kita. Amin...<br />\r\n&nbsp;<br />\r\n(Seperti yang diceritakan oleh pasangan suami-isteri Ibu Yuliarni Suparman dan Bapak H. Suparman Hamry yang bertempat tinggal di Pondok Labu, Jakarta Selatan). (ARH)</p>', '2021-11-13 04:06:05', '2021-11-12 21:06:05'),
(11, 59, 'Dengan MASTER COFFEE HERBAL PLUS, Semua Urusan Jadi Lancar', 'Ahmad', 'Kampung Baru V, Kebayoran Lama, Jakarta Selatan', 'photos/Dengan MASTER COFFEE HERBAL PLUS, Semua Urusan Jadi Lancar.png', '<p style=\"text-align:justify\">Nama saya Ahmad, 32 tahun, beralamat di Kampung Baru V, Kebayoran Lama, Jakarta Selatan. Secara formal sehari-hari saya bekerja di sebuah perusahaan swasta nasional sebagai desainer grafis. Sudah lebih dari sepuluh tahun saya menekuni bidang ini. Di luar pekerjaan formal itu, saya juga sebagai freelance designer. Pesanan pelanggan di luar pekerjaan formal, biasanya saya kerjakan di rumah yang membutuhkan waktu pengerjaan hingga dini hari. Untuk itu, saya memerlukan ide-ide kreatif dan kondisi fisik yang prima. Bagaimana tidak, setelah berpikir maksimal agar menghasilkan desain yang unik dan menarik hingga dini hari, keesokan harinya saya juga harus bekerja kembali di tempat kerja yang utama.</p>\r\n\r\n<p style=\"text-align:justify\">Banyak teman saya sesama desainer menjadi perokok berat dan ketagihan minum kopi hitam yang kental, dengan alasan pekerjaannya membutuhkan inspirasi sekaligus kekuatan melawan kantuk. Kopi hitam yang kental dan rokok bagi mereka adalah solusi, tapi tidak bagi saya. Untuk pekerjaan yang akrab dengan deadline ketat, saya hanya butuh MASTER COFFEE HERBAL PLUS. Bagi saya yang tidak merokok, MASTER COFFEE HERBAL PLUS adalah pendukung untuk menemukan inspirasi, pengganti rokok, sekaligus sebagai alat untuk melawan kantuk. Sejak tiga tahun terakhir, setelah load pekerjaan saya semakin meningkat, saya semakin rutin minum MASTER COFFEE HERBAL PLUS.</p>\r\n\r\n<p style=\"text-align:justify\">Sebelum mengenal MASTER COFFEE HERBAL PLUS, saya terbiasa minum kopi hitam di beberapa tempat resto kopi franchise dari luar negeri. Tapi saya merasa MASTER COFFEE HERBAL PLUS memiliki rasa yang lebih khas dan lebih enak. Sejak saat itu, saya hanya tertarik mengkonsumsi MASTER COFFEE HERBAL PLUS. Selain dapat membantu saya melawan kantuk dan rasa kopinya yang lebih nikmat, ditambah komposisi herbalnya yang sangat bermanfaat bagi kesehatan, semakin memperkuat alasan saya untuk &rdquo;hijrah&rdquo; ke kopi produk muslim dan memiliki sertifikat halal MUI ini.</p>\r\n\r\n<p style=\"text-align:justify\">Keunggulan lain MASTER COFFEE HERBAL PLUS yang saya rasakan adalah dapat dikonsumsi kapan saja, termasuk saat perut sedang kosong. Kandungan ekstrak mengkudu mencegah meningkatnya asam lambung yang menyebabkan perih di lambung. Berbeda dengan kopi lain yang pernah saya konsumsi. Istimewanya lagi, saya tetap merasa aman dan nyaman mengkonsumsi MASTER COFFEE HERBAL PLUS dalam jumlah dan intensitas yang cukup tinggi, tetap tidak menyebabkan jantung berdebar, pusing, apalagi memicu maag seperti kebanyakan kopi lainnya.</p>\r\n\r\n<p style=\"text-align:justify\">Sejak rutin minum MASTER COFFEE HERBAL PLUS, saya merasa lebih bugar bekerja sehari-hari di kantor, meskipun malamnya begadang karena deadline pekerjaan. Selain itu pula, saya merasa selalu memiliki stamina dan vitalitas yang baik dalam hal hubungan suami istri. Jadi bagi saya pribadi, minum MASTER COFFEE HERBAL PLUS bukan sekedar mengikuti tren gaya hidup, pendukung lancarnya pekerjaan, cara untuk menjaga kesehatan, melainkan juga sebagai alat bantu meningkatkan stamina saya sebagai pria. Insya Allah. (HRM)</p>\r\n\r\n<p>#kopibaikuntukjantung #kopibaikuntukkesehatan #kopiherbalstaminapria #kopiherbalkejantanan #kopiherbaluntukobatkuat #kopiherbaluntukkesehatan #kopiherbaltahanlama #kopiherbal #kopisehattanpagula #kopisehat</p>', '2021-10-22 20:53:18', '2021-10-22 20:53:18'),
(12, 54, 'Dengan Teh Hijau Istimewa Cap Pucuk, Nyeri Sendi Hilang dan Tidur Lebih Pulas', 'Deasy Rosemeri Angkuna', 'Bekasi Timur - Jawa barat', 'photos/teh_hijau_cap_pucuk_2.jpg', '<p style=\"text-align:justify\">Sebagai Aparatur Sipil Negara (ASN) di Kementerian Hukum dan HAM, aktivitas saya cukup padat. Padatnya aktivitas ini, ditambah lagi harus mengurus dua orang anak saya yang masih kecil-kecil, sering kali berefek pada kebugaran tubuh dan turunnya stamina saya. Akibatnya, saya sering mengeluhkan badan dan kaki pegal-pegal, nyeri sendi, dan susah tidur. Kalaupun tertidur rasanya tidak begitu pulas, sehingga saya merasa istirahatnya kurang maksimal. Saya semakin merasa tidak nyaman, karena setiap kali bangun tidur sekujur tubuh, terutama bagian-bagian sendi terasa lebih ngilu dan lebih nyeri.</p>\r\n\r\n<p style=\"text-align:justify\">Untuk menghilangkan rasa khawatir sekaligus ingin tahu faktor penyebabnya, saya memeriksakan diri ke dokter. Hasil pemeriksaan dokter menunjukkan bahwa kadar asam urat dalam tubuh saya tinggi, di atas 7 mg/dl (tepatnya saya lupa). Saya tahu persis dampak negatif dari asam urat bila berlebihan dan dibiarkan terlalu lama, sehingga saya memutuskan harus segera mengatasi hal ini.</p>\r\n\r\n<p style=\"text-align:justify\">Alhamdulillah, dalam whatsapp group teman-teman SD dan SMP, saya tergabung bersama Ary Haryati, teman sejak SD, yang memiliki pengetahuan tentang kesehatan sekaligus memiliki berbagai obat herbal dari perusahaan tempatnya bekerja. Sekitar bulan Oktober 2017 yang lalu, Ary menawarkan Teh Hijau Istimewa Cap Pucuk untuk mengatasi keluhan saya selama ini. Bagi saya yang selama ini memang gemar minum teh, tawaran Teh Hijau Istimewa Cap Pucuk ini menarik, selain menjadi ikhtiar untuk mengatasi kelebihan asam urat yang saya alami, saya juga tidak merasa terbebani dan merasa minum obat karena melakukan sesuatu yang memang menjadi kegemaran saya. Saya pun memutuskan membeli.</p>\r\n\r\n<p style=\"text-align:justify\">Biasanya, saya mengkonsumsi Teh Hijau Istimewa Cap Pucuk tanpa gula pada malam hari sebelum tidur dan saat di kantor. Memang rasanya tidak manis, tapi tetap terasa enak, karena tidak pahit dan tidak juga kecut. Beberapa hari pertama, khasiatnya belum begitu terasa. Saya hanya merasakan lebih banyak dan lebih sering buang air kecil. Namun, setelah seminggu mengkonsumsi Teh Hijau Istimewa Cap Pucuk ini secara rutin, saya merasakan lebih mudah tidur dan tidurnya terasa lebih pulas. Selain itu, saat bangun tidur, pegal-pegal di kaki dan persendian lain di tubuh tidak terasa lagi. Setiap bangun tidur, saya pun merasa lebih bugar. Di tempat kerja stamina juga terasa tetap fit. Alhamdulillah, dengan mengkonsumsi Teh Hijau Istimewa Cap Pucuk ini BAB saya menjadi lebih lancar dan teratur. Pengalaman lain yang saya rasakan setelah minum Teh Hijau Istimewa Cap Pucuk adalah selalu merasa kenyang alias tidak mudah merasa lapar, jadi cocok juga buat orang yang sedang menjalani program diet.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Beberapa waktu kemudian, saat melakukan terapi bekam, saya mengukur kadar asam urat. Saya bersyukur, karena kadar asam urat dalam darah saya sudah normal. Pengalaman positif ini saya ceritakan juga kepada teman-teman lain, baik secara langsung melalui sosial media. Alhamdulillah banyak di antara teman-teman saya yang juga tertarik, kemudian membeli Teh Hijau Istimewa Cap Pucuk ini. Saya berharap dengan Teh Hijau Istimewa Cap Pucuk ini kesehatan dan kebugaran saya tetap dapat terjaga, serta dapat bermanfaat bagi banyak orang lainnya. Insya Allah. (HRM)</p>', '2021-11-13 04:31:24', '2021-11-12 21:31:24'),
(13, 6, 'KONSUMSI SHAD HILBA PLUS, NYERI HAID HILANG', 'Hevi Makmuroh W', 'Bendosari, Sukoharjo', 'photos/Shad_Hilba_Plus_1.jpg', '<p style=\"text-align:justify\">Saya selalu mengalami kesakitan setiap kali datang haid. Hal ini terjadi sejak saya berusia 21 tahun (pertama kali datang bulan). Kalau sedang haid tubuh saya terasa sakit, diikuti mual-mual, muntah, badan terasa kaku, bahkan nyaris pingsan. Jika waktu haid tiba, segala aktivitas saya terhenti, kuliah pun tidak masuk. Setiap kali haid saya selalu minum obat penghilang rasa sakit. Bahkan pernah suatu ketika saya mengalami rasa sakit yang teramat sangat, yang tidak dapat ditahan lagi. Kemudian saya periksa ke bidan dan oleh bidan disarankan jangan minum obat-obatan penghilang nyeri haid, katanya itu tidak baik. Anjuran dari bidan itu saya ikuti, tetapi setiap kali datang haid saya harus pergi ke bidan untuk berobat. Bayangkan pengeluaran saya jadi bertambah setiap bulan.</p>\r\n\r\n<p style=\"text-align:justify\">Suatu hari saya disarankan oleh seorang mitra SHAD NETWORK untuk mencoba SHAD HILBA PLUS. Ketika itu saya masih ragu-ragu, namun setelah membaca buku pengenalan &quot;Manfaat Nigella dan Hilba Plus,&quot; saya memberanikan diri untuk mencobanya.</p>\r\n\r\n<p style=\"text-align:justify\">Sejak itu ketika haid tiba saya terheran-heran karena saya tidak merasakan keluhan seperti baisanya, dan keharusan berobat ke bidan pun saya hentikan sejak saat itu juga. Hingga saat ini saya terus mengkonsumsi SHAD HILBA PLUS, tubuh saya menjadi fit terus dan jarang sakit.</p>', '2021-11-13 08:54:04', '2021-11-13 01:54:04'),
(14, 16, 'BEBAS ASAM URAT DENGAN SHAD ASRATIK', 'Bapak Harry', 'Bintara, Bekasi', 'photos/BEBAS ASAM URAT DENGAN SHAD ASRATIK.jpg', '<p style=\"text-align:justify\">Mengawali aktivitas di tanggal 3 Maret 2014 itu, saya (Harry, 38 tahun, Bintara, Bekasi Barat) sangat bersemangat. Oleh karena itulah, hari itu saya bermaksud berangkat kerja lebih pagi dari biasanya. Namun semangat itu seketika sirna saat saya hendak mengendarai sepeda motor, tiba-tiba jari-jari tangan terasa kebas dan kaku. Rasanya, saat memegang setang sepeda motor tidak dapat menggenggam secara penuh. Saya merasa kaget bercampur khawatir. Karena hari itu hari Senin, di mana kondisi jalanan menuju tempat kerja biasanya padat dan macet, ditambah rasa khawatir akibat jari-jari tangan yang kaku, saya memutuskan untuk tidak masuk kerja.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nKarena rasa khawatir semakin besar disertai rasa penasaran, saya memberanikan diri datang ke klinik terdekat untuk mengecek kadar asam urat. Hasilnya benar-benar membuat saya takut, karena kadar asam urat saya mencapai 9,2 mg/dl. Informasi yang saya dapat, saat kadar asamurat telah mencapai 9-10 mg/dl akan mulai terbentuk kristal di dalam sendi, yang selanjutnya dapat terjadi pembengkakan luar biasa, berpotensi merusak ginjal, dan dapat meningkatkan risiko penyakit jantung koroner.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nDalam kepanikan saya mencari informasi. Akhirnya saya mendapat saran untuk mengkonsumsi obat herbal bernama SHAD ASRATIK. Dari informasi yang saya dapat, SHAD ASRATIK terbuat dari bahan herbal alami yang secara khusus berkhasiat untuk mencegah dan mengobati radang asam urat dan rematik. Sayapun segera mengkonsumsi SHAD ASRATIK dua kali sehari masing-masing dua kapsul sebelum makan. Hal itu saya lakukan rutin semingggu pertama. Untuk mempercepat normalnya kadar asam urat, saya melakukan diet ketat terutama untuk makanan yang mengandung purin tinggi. Saya juga memperbanyak minum air putih dan mulai rutin melakukan olah raga. Pada minggu kedua, karena rasa nyeri dan kaku pada jari tangan saya sudah jauh berkurang, saya mengurangi dosis menjadi dua kali sehari masing-masing &nbsp;satu kapsul. &nbsp;Secara &nbsp;keseluruhan, &nbsp;saya &nbsp;mengkonsumsi SHAD ASRATIK secara rutin selama tiga minggu.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nPada minggu ketiga, saat semua sendi di jari tangan dan sikut sudah terasa normal,saya mencoba memeriksakan kembali kadar asam urat di klinik terdekat. Hasilnya, saya kaget bercampur senang, karena kadar asam urat saya menunjukkan angka 3,2 mg/dl, lebih rendah dari kadar normal yakni 3,5-7 mg/dl. Karena merasa kadar asam urat lebih rendah, saya mulai berani kembali mengkonsumsi makanan kesukaan saya, tempe, sayur kacang, dan beberapa makanan yang mengandung purin lainnya dalam batas yang wajar.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>#asamurat #asamuratgejala #asamuratobatnyaapa #asamuratobat #tangankebasdankaku #obatkakikebasdankaku #kebaskaku #jarijaritangankaku #herbalalami #obatrematiktradisionaldanpantangannya</p>', '2021-10-22 21:19:09', '2021-10-22 21:19:09'),
(15, 10, 'DIAMETER KISTA MENYUSUT 4 CM', 'Ibu Jumaisah', 'Banjarmasin, Kalimantan Selatan', 'photos/zedaca_1_kista.jpg', '<p style=\"text-align:justify\">Sudah lima bulan Ibu Jumaisah (31 tahun) kerap merasa sakit perut yang tidak lazim. Sakit yang dialami sangat luar biasa, seperti melilit dan tertusuk-tusuk di perut bagian bawah. Sakit perut saat masa menstruasi biasanya terjadi di awal, namun ini terjadi di akhir masa menstruasi. Ibu Jumaisah kemudian memutuskan untuk berobat ke dokter, namun dokter belum dapat mendiagnosa penyakit yang beliau alami dan hanya diberi obat penahan rasa sakit. Sehingga sakit perut yang di alaminya kerap muncul kembali, jika sudah begini Ibu Jumaisah pun kembali datang ke dokter sampai dokter menyarankan untuk di USG, dan hasilnya pun diketahui bahwa beliau menderita kista dan sudah berdiameter 4 cm. Dokter lalu memberikan obat untuk dikonsumsi selama beberapa waktu.<br />\r\n&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Saat kembali memeriksakan kondisi rahimnya ke dokter, diameter kistanya bertambah menjadi 5 cm. Ibu Jumaisah lalu memutuskan untuk mencari pengobatan alternatif, dan melalui orang tuanya yang merupakan mitramuda Ibu Andi &nbsp;Erni, &nbsp;PU, &nbsp;beliau &nbsp;diberikan &nbsp;obat &nbsp;herbal &nbsp;ZEDACA. Alhamdulillah setelah sepuluh hari mengkonsumsinya (40 butir ZEDACA) dengan &nbsp;dosis &nbsp;dua &nbsp;kapsul &nbsp;pagi &nbsp;dan &nbsp;sore, &nbsp;Ibu &nbsp;Jumaisah &nbsp;pun &nbsp;kembali memeriksa rahimnya dan kistanya sudah menyusut menjadi berdiameter 1 cm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>#kistaovarium #kistaadalah #kistadirahim #kistaovariumadalah #diameterkistaovarium #makananpenyebabkistaovarium #tandakistamembesar #ukurannormalkista #kistamenyusutovarium #kista4cmapakahberbahaya</p>', '2021-11-11 04:31:51', '2021-11-10 21:31:51'),
(16, 7, 'GULA DARAH NORMAL KEMBALI', 'Dian Khodijah Afriyati', 'Desa Garung Lor, Kaliwungu, Kudus', 'photos/shad_endiabet_1.jpg', '<p style=\"text-align:justify\">Pada awal saya terkena diabetes, saya tidak tahu tanda dan gejalanya. Pada saat itu saya sangat sulit sekali tidur baik siang maupun pada malam hari. Saya merasa sangat terganggu pada malam hari karena sering sekali terbangun untuk buang air kecil. Saya juga tidak tahu ternyata keluarga, teman dan para tetangga memperhatikan kondisi tubuh saya semakin lama semakin kurus, lalu saya disarankan untuk ke dokter. Saya mengikuti anjuran orang-orang terdekat. Setelah saya ke dokter, saya diminta untuk tes laboratorium, dan ternyata gula darah mencapai 460 mg/dl. Saya juga sempat mengkonsumsi obat dokter dan sangat banyak pantangannya.<br />\r\n&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Pada &nbsp;suatu &nbsp;saat &nbsp;saya &nbsp;bertemu &nbsp;dengan &nbsp;Bapak &nbsp;Agus &nbsp;Purwanto yang sekarang menjadi Mitrautama &nbsp;saya. &nbsp;Saat &nbsp;itu &nbsp;Beliau &nbsp;memperkenalkan produk dari SHAD NETWORK yaitu SHAD NIGELLA PLUS dan SHAD ENDIABET. Saya meminum kedua produk tersebut secara teratur dan alhamdulillah &nbsp;gula &nbsp;darah &nbsp;saya &nbsp;turun &nbsp;(normal). &nbsp;Dan &nbsp;sampai &nbsp;saat &nbsp;ini makanan saya tak ada pantangan.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nSaya punya pengalaman yang sangat menggembirakan. Cerita ini menceritakan seorang pasien Rumah Sakit Kudus (Bapak Abdul Rohman) yang menderita penyakit diabetes (demikian diagnosa dokter spesialis RS tersebut). Gejalanya adalah badan gatal-gatal seluruh tubuh, &nbsp;kencing &nbsp;terus menerus, &nbsp;gula &nbsp;dara &nbsp;mencapai 315 (jauh di atas normal), di bawah jari cekot-cekot, luka dan mengeluarkan nanah.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nPada &nbsp;waktu &nbsp;saya &nbsp;berkesempatan &nbsp;untuk &nbsp;mengobservasi &nbsp;Bapak &nbsp;Abdul Rohman &nbsp;beliau menceritakan &nbsp;bahwa &nbsp;dirinya &nbsp;sudah &nbsp;berobat &nbsp;ke &nbsp;mana- mana, mulai minum obat yang dibeli di warung-warung, apotik dan obat- obat anjuran tetangga, sampai pijat syarat, tapi hasilnya nihil. Kemudian pasien tersebut bertanya kepada saya, &quot;berapa kadar gula darah saya?&quot;, jawab saya dengan sedikit banyak menimbulkan kekecewaan, gula darah bapak 315 jauh dari normal dan lukanya masih bernanah.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nKemudian saya anjurkan untuk minum SHAD NIGELLA PLUS dan SHAD ENDIABET dengan dosis 2 x 2 untuk SHAD NIGELLA PLUS dan 2 x 1 untuk SHAD ENDIABET. Beliau setuju dan keesokan &nbsp;harinya saya bawakan masing-masing 1 botol. Alhamdulillah, luka di kaki bapak Abd. Rohman &nbsp;tersebut &nbsp;kering dan &nbsp;gula &nbsp;darahnya &nbsp;berangsur-angsur turun hingga 175 dan akhirnya dokter memperbolehkannya pulang.</p>\r\n\r\n<p>&nbsp;</p>', '2021-11-11 04:05:38', '2021-11-10 21:05:38'),
(17, 51, 'Stamina Terjaga Selama Pemulihan Setelah Sakit DBD', 'Bapak Irwan Sholeh', 'Depok, Jawa Barat', 'photos/Stamina Terjaga Selama Pemulihan Setelah Sakit DBD.jpg', '<p style=\"text-align:justify\">Bapak Irwan Sholeh (29 tahun), seorang karyawan swasta yang bertempat tinggal di Kota Depok pernah menderita penyakit Demam Berdarah Dengue (DBD). Suhu tubuhnya ketika itu menunjukkan angka 40 Dc disertai dengan muntah-muntah. Hasil pemeriksaan darah menunjukkan nilai trombosit yang sangat rendah, yaitu 62 ribu/mm3 sementara standar trombosit dalam kondisi normal adalah 150-440 ribu/mm3. Dokter pun menyarankan untuk rawat inap sampai trombositnya mendekati normal. Selang beberapa hari trombosit Pak Irwan mencapai 110rb/mm3 dan diperbolehkan pulang namun masih harus mengkonsumsi obat, beliau juga disarankan untuk istirahat total di rumah sebagai masa pemulihan agar dapat beraktivitas seperti biasa. Di samping obat dari dokter, Pak Irwan juga mengkonsumsi Teh Celup Hilba dan &quot;SALSABIL&quot; SARI KURMA GINSENG untuk memulihkan stamina.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nPak Irwan kemudian kembali melakukan pengecekkan darah, hemoglobinnya yang semula 8.5 gr/dl naik menjadi 15,7 gr/dl, kadar hemoglobin normal adalah 13,2-17,3 gr/dl. Alhamdulillah khasiat Teh Celup Hilba dan &quot;SALSABIL&quot; SARI KURMA GINSENG benar-benar saya rasakan selama sakit dan saat masa pemulihan stamina saya pasca sakit.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>#sakitdbdminumapa #ciri2sembuhdaridbd #lemassetelahsembuhdbd #tandasembuhdbd #carasembuhdbd #caracepatsembuhdbd #sembuhtotaldaridbd #sembuhdbdtanpaopname #obatdbdpalingampuh #herbaluntukdbd</p>', '2021-10-22 23:33:42', '2021-10-22 23:33:42'),
(18, 15, 'Kolesterol Turun dengan SHAD TENSIKOL', 'Atika Mahfuzah Pangat (A027149831)', 'Medan - Sumatera Utara', 'photos/tensikol_1.jpg', '<p style=\"text-align:justify\">Atika Mahfuzah Pangat (A027149831) adalah seorang mahasiswa di Universitas Medan semester akhir yang hendak di wisuda bulan Oktober 2014. Usia Tika, panggilan akrabnya, sekarang 22 tahun. Seperti anak muda lainnya yang senang mengkonsumsi jajanan seperti bakso, mie ayam, nasi goreng, dan lain-lain, sedikit banyak memberikan pengaruh terhadap keadaan kesehatannya.</p>\r\n\r\n<p style=\"text-align:justify\">Suatu hari Tika merasa tidak enak badan, melakukan beberapa tes darah. Hasil yang didapatkan cukup mencengangkan, kadar kolesterol yang terukur adalah 235 mg/dL. Angka ini sudah masuk ke dalam batas kolseterol batas tinggi. Jika normal kadar kolesterol sebaiknya di bawah 200 mg/dL.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Ibu Sri Ardi, orang tua Tika langsung mengingatkan untuk mengkonsumsi SHAD Tensikol dengan dosis tiga kali sehari satu kapsul. Begitu juga SHAD Nigella Plus yang dikonsumsinya tiga kali sehari satu kapsul. Setelah dua minggu intensif mengkonsumsi SHAD Tensikol dan SHAD Nigella Plus, alhamdulillah kolesterolnya turun menjadi 168 mg/dL. Alhamdulillah sekarang Tika lebih sehat dan siap menjalani saat wisudanya.</p>', '2021-11-13 10:40:19', '2021-11-13 03:40:19'),
(19, 55, 'KONSENTEA Dapat Mengatasi Penurunan Daya Ingat', 'Ibu Dra. Nurul Husna (A024301352)', 'Kisaran Kabupaten Asahan, Sumatera Utara', 'photos/KONSENTEA Dapat Mengatasi Penurunan Daya Ingat.jpg', '<p style=\"text-align:justify\">Semakin bertambah usia, sesorang dapat mengalami penurunan daya ingat. Ditambah lagi jika seorang ibu yang padat aktivitasnya di rumah, di sekolah sebagai pengajar, maupun di organisasi lainnya, kemunkinan mengalami lupa karena penurunan daya ingat semakin besar.</p>\r\n\r\n<p style=\"text-align:justify\">Ibu Dra. Nurul Husna (A024301352), mitraniaga asal Kisaran kabupatan Asahan, Sumatera Utara, yang juga seorang guru dan aktif di organisasi menyadari pentingnya fokus dan konsentrasi dalam setiap aktivitas. Jadwal yang padat tidak mengizinkan untuk sering lupa. Ibu Dra. Nurul Husna (44 tahun) menyadari semakin bertambahnya usia dan semakin padatnya jadwal kegiatan iya sering menjadi lupa dan mengalami penurunan daya ingat.</p>\r\n\r\n<p style=\"text-align:justify\">Ibu Dra. Nurul Husna mengkonsumsi herbal Konsentea untuk membantu menjaga ia tetap konsentrasi dan fokus. Pagi hari setelah sarapan dan hendak berangkat kerja, Ibu Nurul Husna menyedu teh Konsentea. Saat mengajar ia juga menyeduhnya. Ia mengkonsumsi sebanyak satu cangkir dua kali sehari. Alhamdulillah hasilnya ia jarang lupa dan daya ingatnya sekarang dapat diandalkan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>#antipikun #obatantipikun #makananantipikun #vitaminantipikun #gameantipikun #suplemenantipikun #buahantipikun #obatalamiantipikun #obatantipikun #herbalantipikun</p>', '2021-10-22 23:43:44', '2021-10-22 23:43:44'),
(20, 11, 'HEPATITIS A Sembuh dengan SHAD ULIVER dan SHAD NIGELLA PLUS', 'Irfan (17 tahun)', 'Pekanbaru', 'photos/uliver_1.jpg', '<p style=\"text-align:justify\">Irfan adalah anak laki-laki dari Ibu Ade Ekawati, Mitraniaga SHAD NETWORK asal Pekanbaru. Irfan (17 tahun) pernah di rawat di rumah sakit karena terkena penyakit Hepatitis A. Sebelum di rawat, gejala yang muncul adalah demam namun tidak terlalu tinggi, sakit di bagian atas perut dekat ulu hati, dan lama kelamaan mata dan kulit berwarna agak kuning.</p>\r\n\r\n<p style=\"text-align:justify\">Irfan sejak kecil memiliki penyakit asma yang membuatnya diresepkan obat untuk dikonsumsi setiap hari, sehingga bisa jadi karena terlalu sering mengkonsumsi obat kimia Irfan tidak boleh mudah lelah. Kali ini ia terkena penyakit Hepatitis A ia rasakan karena terlalu lelah.</p>\r\n\r\n<p style=\"text-align:justify\">Setelah memperhatikan obat yang diberikan oleh dokter untuk mengobati Hepatitis A ini, Ibu Eka, panggilan akrabnya, mengetahui bahwa sebagian besar kandungannya adalah Curcuma. Ia pun teringat akan Uliver seperti yang sering disampaikan oleh mitrautamanya Ibu Meilina, dan saat itu Ibu Eka langsung ke Mitrasalur RIU-06 untuk mendapatkan Uliver dan memberikannya kepada anaknya. SHAD Nigella Plus dan Uliver diberikan dengan dosis masing-masing tiga kapsul yang dikonsumsi pada pagi dan sore hari. Alhamdulillah, sakit Hepatitis A-nya sembuh.</p>\r\n\r\n<p style=\"text-align:justify\">Sekarang Irfan tetap mengkonsumsi SHAD Nigella Plus dan Uliver dengan dosis masing-masing dua kapsul untuk pagi dan sore hari untuk menjaga kondisi sehatnya. Alhamdulillah Irfan lebih sehat dan asmanya pun jarang datang.</p>', '2021-11-13 10:32:49', '2021-11-13 03:32:49');
